var book = {
	"name": "ဒၫ့နအ့လၭ",
	"numChapters": 12,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> လၧယုဒၫအစဎွၩယဟီအကံၫ့ ကဲၪစဎွၩအနံၪ့ ၥၧၫ့နံၪ့လနံၪ့နီၪ, ဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫဂဲၫ",
			"2": "<sup>2</sup> ထီၩ့ဝ့ၫလၧယရုစလံၫ့တၭ, ဝၩ့ထၬဝ့ၫလီၫ.- ကဆါဖ့ၪ လၫ့ယုဒၫအစဎွၩယဟီအကံၫ့ လၧအစူၪဖၧၩ့တၭ,ယွၩ အဂံၪ့အဎၧၩ့အဎီလနၩ့နီၪ, အဝ့ၫဒၪဆိၬဝ့ၫလၧခးၡဲနၫ အဖၧၩ့လၧအယွၩအဂံၪ့ဖၧၩ့လီၫ. တၭဆိၬဆၧအ ဎၧၩ့အဎီလဖၪနီၪ လၧအယွၩအဂံၪ့အဆၧအီၪက့ၪကီၪ့ အလးဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> တၭစဎွၩမၪလူၬၦဖၫဆွံၪဖိၪအခိၪ စအၭၡပံၫနၭဘဲၫ ၥိၭအမိဂဲၫဆိၬၦအံၫစရ့လၭဖိၪလနၩ့နၩ့, စဎွၩအ",
			"4": "<sup>4</sup> ချံၫအၥၪ,ဒဲၦဒိၪဖၭဒိၪအဖိၪး- ဖိၪၥၪခွၫလၧအလၧၫ့အ ဎွ့ၩ,ဒဲအခံးအဂၩ့ဂ့ၩ, ဒဲမၩဆၧၥ့ၪလၧဆၧကိၪ့ဆၧဆၭ ထီးအလူၬ, ဒဲၥ့ၪထၪ့ဆၧၥ့ၪယၫ, ဒဲအၪ့နၩ့ဖၭဆၧၥ့ၪ ယၫအဆၧၫ့ၥ့ၪ, ၦလၧအဆၧၫ့ထုၪ့လၧစဎွၩအနီးဖၧၩ့ ၥ့ၪ,ဘဲၫၥိၭအမိၥီၪ့လိၪအဝ့ၫၥံၪ လၧၦခၫလဒံအၫဖိၪအ",
			"5": "<sup>5</sup> လံၬအလဲ,ဒဲအလၨဆ့လီၫ.- တၭစဎွၩအီၪက့ၪလၩ့န့ အဝ့ၫၥံၪလၧစဎွၩအဆၧအၪ့အွံၪ လနံၩအဂးလနံၩအ ဂး,ဒဲအစဘံၭထံၫလၧအအီၩဝ့ၫ, ဘဲၫၥိၭၦမိလုအၪ့အ ဝ့ၫၥံၪၥၧၫ့နံၪ့အထးဖၧၩ့တၭ, လၧအလးခဲၫ့နီၪအဝ့ၫၥံၪ မိအီၪဆၧၫ့ထုၪ့လၧစဎွၩအမ့ၬယၫလီၫ.",
			"6": "<sup>6</sup> လၧၦလဖၪနီၪအကျၩ ၦယုဒၫဖိၪအီၪဝ့ၫလနၩ့,မွဲစ ဒၫ့နအ့လၭ,စဟၫ့အနဲအၫ, စမၡ့ၫအ့လၭ,ဒဲစအၭဇရဲ",
			"7": "<sup>7</sup> အၫလီၫ.- တၭၦဖၫဆွံၪဖိၪ အခိၪဖျိၬထဲၩ့အမံၩ့လီၫ. စဒၫ့နအ့လၭနီၪဖျိၬထဲၩ့အမံၩ့ လၧစဘ့ၫလၭတၡၭဇၫ, ဒဲစဟၫ့အနဲအၫနီၪ လၧစၡၫဒၭ, ဒဲစမၡ့ၫအ့လၭနီၪ လၧစမံၡ့ၭး ဒဲစအၭဇရဲအၫနီၪလၧစအဘ့ၫဒန့ဂိၫ လီၫ.",
			"8": "<sup>8</sup> လၧဆၧဘၪဆဲၫ့လၧစဎွၩ အဆၧအၪ့အွံၪ,ဒဲစဘံၭ ထံၫလၧအအီၩဝ့ၫနီၪ, စဒၫ့နအ့လၭအီၪက့ၪဝဲၩလၧအ ၥၭခံဖၧၩ့လၧအမိမၩဘၪၥၭလိၪ အနၫ့ဆါလၧဆၧနီၪဆ့ အ့ၬ. အခိးမွဲဘဲၫနီၪတၭ အၪ့ကံၩ့ဝ့ၫလၧၦဖၫဆွံၪဖိၪအ ခိၪဘဲၫၥိၭအထီးမၩဘၪၥၭလိၪ အနၫ့ဆါလဂ့ၩလီၫ.",
			"9": "<sup>9</sup> တၭယွၩဖ့ၪလၫ့စဒၫ့နအ့လၭ လၧဆၧအခိးအတၩ,ဒဲ ဆၧၥၭအီၪဆၧ လၧၦဖၫဆွံၪဖိၪအခိၪအမ့ၬယၫလီၫ.",
			"10": "<sup>10</sup> တၭၦဖၫဆွံၪဖိၪအခိၪနီၪစံၭစဒၫ့နအ့လၭ, ယၥၭမဲၪယ ကဆါစဎွၩလၧအအီၪက့ၪလၩ့ နၥံၪအဆၧအၪ့ဒဲနၥံၪ အဆၧအီၩလီၫ. အဂဲးဘဲၫယီၩမိဒၪဘၪနၥံၪအမ့ၬလၩ့ ၡါနဲၪ့ၦအီၪဖျဲၪဎုၬ လၧနၥံၪဒံၭမွဲဘၪလဲၪး တၭနၥံၪမိ ဒုၭဘၪယခိၪဎွံၪ လၧဆၧဒဲၩဘၭ လၧစဎွၩအစူၪဖၧၩ့ လီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့စဒၫ့နအ့လၭ, စံၭစမ့လဇၫလၧၦဖၫ ဆွံၪဖိၪအခိၪအီၪက့ၪယူၭဝ့ၫ လၧစဒၫ့နအ့လၭ,စဟၫ့အ နဲအၫ,စမၡ့ၫအ့လၭ, ဒဲစအၭဇရဲအၫအဖၫ့ခိၪနီၪ,",
			"12": "<sup>12</sup> မၩခွါနခ့ၫနၡၩနးဆံၫနံၩဘီၪ. တၭဖ့ၪလၫ့လါပၧၩလၧ ဆၧဒိၭဆၧလၪလၧပမိအၪ့, ဒဲထံၫလၧပမိအီၩဆံၭ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့မွဲဆၧယိပမ့ၬ, ဒဲၦဖိၪၥၪခွၫလၧအအၪ့ စဎွၩအဆၧအၪ့အွံၪလဖၪအမ့ၬ လၧနမ့ၬယၫဆံၭ.",
			"14": "<sup>14</sup> တၭဘဲၫနဒၪဆၧအၥိၭနီၪ မၩနခ့ၫနၡၩဘီၪ.- အဝ့ၫဒၪ ခိၭနၪအလူလၧဆၧနီၪလမံၩ့အကၠီၩ့တၭ, မၩခွါဝ့ၫဆံၫ",
			"15": "<sup>15</sup> နံၩလီၫ.- တၭလၧဆံၫနံၩအထုၬနီၪ အဝ့ၫၥံၪအခံးအ ဂၩ့ဂ့ၩနဲၪ့, ဒဲအဖံၭအယၪဘီၪ့နဲၪ့ကယဲၦဖိၪၥၪခွၫလၧ",
			"16": "<sup>16</sup> အအၪ့စဎွၩအဆၧအၪ့အွံၪထီးအလူၬဒံၭလီၫ.- အခိး မွဲစမ့လဇၫမၩန့ခွံၬအဆၧအၪ့အွံၪ, ဒဲအစဘံၭထံၫလၧ အအီၩဝ့ၫတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪ လၧဆၧဒိၭဆၧလၪ လီၫ.",
			"17": "<sup>17</sup> ဆၧလၧဖိၪၥၪခွၫလံဂၩနီၪ ယွၩဖ့ၪလၫ့အဝ့ၫၥံၪလၧ ဆၧၥ့ၪယၫ,ဒဲအၥုၪ့ဆၭအၥၭဆၭ လၧကယဲဆၧမၩ လိၪ,ဒဲဆၧကိၪ့ၥ့ၪအကျၩ ထီးအလူၬလီၫ. တၭစဒၫ့န အ့လၭနၪၥ့ၪ ကယဲဆၧဒၪဆၧလၧယၫလခီၫ, ဒဲဆၧမံၫ မးကိၭမံၩ့ဒ့ၭထီးအလူၬလီၫ.",
			"18": "<sup>18</sup> တၭမုနံၩလဖၪအထုၬ လၧစဎွၩမၪလူၬယူၭလၧၦမိ ဒုၭဂဲၫနုၬဝ့ၫနီၪ, ၦဖၫဆွံၪဖိၪအခိၪဒုၭဂဲၫနုၬအဝ့ၫၥံၪ",
			"19": "<sup>19</sup> လၧန့ၭဘူၫခၭန့ဇၫအမ့ၬယၫလီၫ.- စဎွၩနီၪအၪ့စိၭ အၪ့စၪ့အဝ့ၫၥံၪတၭ, ၦဘဲၫစဒၫ့နအ့လၭ, စဟၫ့အနဲ အၫ,စမၡ့ၫအ့လၭ, ဒဲစအၭဇရဲအၫအၥိၭအီၪလၧၦ ထီးအလူၬနီၪအကျၩနးဂၩအ့ၬ. တၭအဝ့ၫၥံၪအီၪဆၧၫ့ ထုၪ့လၧစဎွၩအမ့ၬယၫလီၫ.",
			"20": "<sup>20</sup> တၭကယဲဆၧဘၪဆဲၫ့လၧဆၧကိၪ့ၥ့ၪ, ဆၧကိၪ့ဆၧ ဆၭလၧစဎွၩအၪ့စၪ့အဝ့ၫၥံၪ လၧအဂဲးအကၠီၪ့နီၪ,ဒၪ န့ဝ့ၫလၧအဝ့ၫၥံၪဂ့ၩနဲၪ့ဒံၭကယဲၦကွ့ၭလံၬ, ဒဲၦၥ့ၪဆၧ အူၪဆၧပီၩ အီၪလၧအဘၩ့အမုးအဖၧၩ့ ထီးအလူၬ ဆံၫဘျၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> တၭစဒၫ့နအ့လၭအီၪဝ့ၫထီးစဎွၩစဲရၧၭအနံၪ့အခၪ့ ထံၭလနံၪ့လီၫ."
		},
		"2": {
			"1": "<sup>1</sup> တၭလၧစန့ၭဘူၫခၭန့ဇၫကဲၪစဎွၩ အနံၪ့နံၫနံၪ့လနံၪ့ နီၪစန့ၭဘူၫခၭန့ဇၫမံၫမးဆၧမံၫမးလဖၪတၭ, အၥၭ",
			"2": "<sup>2</sup> ခိထၪ့တၭမံၫလန့ဘၪလီၫ.- တၭစဎွၩမၪလူၬဆၧလၧ ၦဘၪကိၭၦကွ့ၭလံၬဒဲၦၥ့ၪဆၧအူၪဆၧပီၩ, ဒဲၦမၩက ဒၩၦမ့ၬ, ဒဲၦခၫလဒံအၫဖိၪၥံၪဘဲၫၥိၭအမိဒုၭနဲၪစဎွၩ လၧအဆၧမံၫမးလဖၪလီၫ. အဝ့ၫၥံၪဂဲၫဝ့ၫတၭ, ဆၧၫ့",
			"3": "<sup>3</sup> ထုၪ့လၧစဎွၩအမ့ၬယၫလီၫ.- တၭစဎွၩစံၭအဝ့ၫၥံၪ, ယမံၫမးဆၧမံၫမးတၭ, ယၥၭခိထၪ့ဘဲၫၥိၭယမိၥ့ၪယၫ ဆၧမံၫမးလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ ၦခၫလဒံအၫဖိၪၥံၪစံၭစဎွၩလၧၦအ မံနအၫဖိၪအလၨ, မွဲစဎွၩမၧၫ့ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪဆံၭ. လီၩဘၪနခ့ၫနၡၩ လၧဆၧမံၫမးနီၪဘီၪး တၭပမိဖၭန့ အခီၫပယီၫလီၫ.",
			"5": "<sup>5</sup> စဎွၩစံၭဆၧၫ့ဆၧတၭ, စံၭၦခၫလဒံအၫဖိၪၥံၪ, ဆၧ ချဲၩ့ထၪ့ဖျ့ၭယူၭလၧယနိၭယူၭ, နၥံၪအ့ၪလဒုၭၥ့ၪယၫ ဘၪယၧၩလၧဆၧမံၫမး, ဒဲအခီၫပယီၫတၭ, ဆၧမိဒၪ့ထ့ၬ ခွံၬနၥံၪလကုၭလကုၭတၭ, နၥံၪအဂံၪ့မိကဲၪထၪ့ဆၧအ့ၪ",
			"6": "<sup>6</sup> အလးလီၫ.- အ့ၪမွဲနၥံၪအ့ၪဒုၭၥ့ၪယၫယၧၩလၧဆၧမံၫ မးဒဲအခီၫပယီၫတၭ, နၥံၪမိန့ဘၪလၬဆီၪ့လဖၪ,ဒဲဆၧ ဖ့ၪလၫ့လဖၪ ဒဲဆၧလၩဖၩ့ဖၭဒိၪလၧယၧၩလီၫ. မၩ အၥၭဘဲၫနီၪတၭ, ဒုၭနဲၪယၧၩလၧဆၧမံၫမးနီၪဒဲအခီၫ ပယီၫဆ့ဆံၭ.",
			"7": "<sup>7</sup> အဝ့ၫၥံၪစံၭဆၧၫ့ဒီၭတၭ,စံၭဝ့ၫ, မွဲစဎွၩလီၩဘၪ အခ့ၫအၡၩလၧဆၧမံၫမးနီၪဆံၭ. တၭပမိဒုၭနဲၪအခီၫ ပယီၫနီၪလီၫ.",
			"8": "<sup>8</sup> စဎွၩစံၭဆၧၫ့ဆၧတၭစံၭဝ့ၫဒၪ, ယၥ့ၪယၫလၩ့ထံး လၩ့ဆ့ၭလၧနၥံၪမိၥုၭနံၩၥုၭၥၫ့, အဂဲးဘဲၫယီၩ နၥံၪ",
			"9": "<sup>9</sup> နါဂၧၫ့ယူၭဆၧချဲၩ့ထၪ့ဖျ့ၭယူၭ လၧယနိၭယူၭ.- နၥံၪ အ့ၪလဒုၭၥ့ၪယၫဘၪယၧၩ လၧဆၧမံၫမးနီၪတၭ,မွဲနၥံၪ ကိၪ့ဆၧလမံၩ့, နၥံၪအုၩ့လၩ့လိၬနၥံၪအၥၭလၧနၥံၪမိ ချဲၩ့ဆၧချဲၩ့အဘျံၭအဘျၪတၭ, အၪ့လီၫန့ဆၧလၧယ မ့ၬယၫထီးအဆၧၫ့အထီဖီၩ့ခွံၬဝ့ၫလီၫ. မၩအၥၭဘဲၫ နီၪတၭ,လီၩဘၪယၧၩလၧဆၧမံၫမးနီၪဆံၭ, တၭယမိ ၥ့ၪယၫလၧနၥံၪဖၭအခီၫပယီၫၥ့ၪလီၫ.",
			"10": "<sup>10</sup> ၦခၫလဒံအၫဖိၪၥံၪစံၭဆၧၫ့ဆၧလၧ စဎွၩအမ့ၬယၫ တၭ,စံၭဝ့ၫဒၪ, ၦလၧအမိစံၭဆၧၫ့စဎွၩအဆၧလမံၩ့ နီၪအီၪလၧဂၪ့ခိၪချိၫ့ယီၩနးဂၩအ့ၬ. မၩအၥၭဘဲၫနီၪ တၭ,စဎွၩအဒိၪအထီၫ, လၧအစီၩ့ဒိၪအမၩ့ထီၫအၪ့ ကံၩ့ဆၧလမံၩ့ ဘဲၫနီၪအၥိၭလၧၦကွ့ၭလံၬ, ၦၥ့ၪဆၧ",
			"11": "<sup>11</sup> အူၪဆၧပီၩ,ၦခၫလဒံအၫဖိၪၥံၪနးဂၩအ့ၬ.- တၭဆၧ လၧစဎွၩအၪ့ကံၩ့ဝ့ၫလမံၩ့နီၪ, မွဲဆၧကၪလမံၩ့လီၫ. အ့ၪလမွဲဘၪကဆါလဖၪ လၧအလအီၪဘၪလၧဆၧ ဖံၭဆၧယၪအဖၧၩ့တၭ, ဆၧဒုၭနဲၪလၧစဎွၩအမ့ၬယၫ ၥ့ၪအီၪနးဂၩအ့ၬ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, စဎွၩၥၭထၪ့ဒဲၥၭခဲၩထၪ့တၭ, မၪလူၬဝ့ၫလၧၦမိဘၪမၩၥံၫ ကယဲၦကိၪ့ၥ့ၪလၧဘၭဘ",
			"13": "<sup>13</sup> လၧၫ့အဖၧၩ့ထီးအလူၬလီၫ.- တၭဆၧအလူလၩ့လၧၦ မိဘၪမၩၥံၫၦကိၪ့ဆၧၥ့ၪလီၫ. တၭၦအၪ့ဎၬစဒၫ့နအ့ လၭဒဲအၥိၭလဖၪဘဲၫၥိၭအမိမၩၥံၫဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့ စဒၫ့နအ့လၭအီၪလၧဆၧကိၪ့ဆၧဆၭ, ဒဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪစံၭဆၧၫ့စဎွၩ အၡၩမၩၥံၫဆၧအ ခိၪစအၫရအီၭ လၧအလ့ၩထၪ့ဝ့ၫဘဲၫၥိၭအမိမၩၥံၫ",
			"15": "<sup>15</sup> ဘၭဘလၧၫ့ အၡၩကိၪ့ဆၧၥ့ၪလဖၪ,- အဝ့ၫဒၪစံၭ ဆၧၫ့ဆၧတၭ, စံၭစဎွၩအၦဒိၪစအၫရအီၭနီၪး မွဲဘၪ နီၫလၫလၧစဎွၩအဆၧမၪလူၬ အီၪထၪ့ချဲၫ့ဖိၭဘိၭယီၩ လဲၪ. တၭစအၫရအီၭဒုၭၥ့ၪယၫစဒၫ့နအ့လၭလၧဆၧ",
			"16": "<sup>16</sup> နီၪလမံၩ့လီၫ.- စဒၫ့နအ့လၭလ့ၩနုၬ လၧစဎွၩအအီၪ တၭ,အၪ့ကံၩ့စဎွၩဖ့ၪလၫ့ဝ့ၫ လၧအဆၧၫ့အထီဘဲၫၥိၭ အမိဖၭန့အခီၫပယီၫလၧစဎွၩအမ့ၬယၫလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့ စဒၫ့နအ့လၭ လ့ၩဝ့ၫလၧအဂံၪ့ဖၧၩ့ တၭး ဒုၭၥ့ၪယၫအၥိၭလဖၪ, စဟၫ့အနဲအၫ,စမၡ့ၫအ့",
			"18": "<sup>18</sup> လၭ,ဒဲစအၭဇရဲအၫ,- ဘဲၫၥိၭအဝ့ၫၥံၪမိအၪ့ကံၩ့မူၭ ခိၪအယွၩအဆၧယၫ့ၥၭ လၧဆၧအီၪၥူၪလမံၩ့ယီၩအ ဂဲး,ဘဲၫၥိၭၦထီးမၩဂၭဂီၩ့ စဒၫ့နအ့လၭ ဒဲအၥိၭအီၪ လၧဘၭဘလၧၫ့အၡၩကိၪ့ဆၧၥ့ၪ အဂူၫဂၩလဖၪအ ၥိၭလဂ့ၩလီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ဆၧနဲၪဖျီၪထၪ့ စဒၫ့နအ့လၭလၧဆၧ အီၪၥူၪလမံၩ့နီၪ, လၧဆၧဒၪဆၧလၧယၫအဖၧၩ့လၧမု နၩလခီၫတၭး စဒၫ့နအ့လၭစံၭထၪ့အၪ့အူၭမူၭခိၪအ ယွၩလီၫ.",
			"20": "<sup>20</sup> စဒၫ့နအ့လၭချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, မွဲယွၩဘၪဆၧ ဆိၪဂ့ၩအဆိၩဆိၩအကၠၪကၠၪဆံၭ. အဂဲးဘဲၫယီၩဆၧ ကိၪ့ၥ့ၪကိၪ့ဘၪဒဲဆၧအစီၩ့အမၩ့အီၪလၧအဝ့ၫလီၫ.",
			"21": "<sup>21</sup> အဝ့ၫဒၪမွဲၦလၧအအၪ့လဲၩဆၧအဆၧၫ့အထီ, ဒဲအမု အလၩတၭး အီၪက့ၪလၩ့ခွံၬစဎွၩလဖၪ, ဒဲအီၪက့ၪ ထၪ့စဎွၩလဖၪ, ဖ့ၪလၫ့ဆၧကိၪ့ၥ့ၪ လၧၦကိၪ့ဆၧၥ့ၪ,",
			"22": "<sup>22</sup> ဒဲဆၧၥ့ၪယၫနီၪလၧၦအၥုၪ့ဆၭအၥၭဆၭလီၫ.- အဝ့ၫ ဒၪနဲၪဖျီၪဆၧအယိၬဒဲဆၧအီၪၥူၪလီၫ. ၥ့ၪယၫဆၧအီၪ ဝ့ၫလၧဆၧခံၭကျၩတၭ, ဆၧဖၩ့အီၪဝ့ၫလၧအၥိၭလီၫ.",
			"23": "<sup>23</sup> တၭယစံၭထၪ့အၪ့အူၭနခိးနတၩ, ယဖါလဖၪအယွၩ ဧ့,ယစံၭထၪ့အၪ့အူၭနၧၩလီၫ. အဂဲးဘဲၫယီၩနဖ့ၪလၫ့ ယၧၩလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ, ဒဲဆၧအစီၩ့အမၩ့တၭ, ဘိၩ့နဲၪ့ယီၩနဒုၭၥ့ၪယၫယူၭယၧၩ ဆၧလၧပအၪ့ကံၩ့ လၧနၧၩလီၫ. အဂဲးဘဲၫယီၩ နဒုၭၥ့ၪယၫပၧၩလၧစဎွၩ အဆၧလမံၩ့နီၪလီၫ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, စဒၫ့နအ့လၭလ့ၩနုၬလၧစအၫ ရအီၭအအီၪလၧစဎွၩအီၪက့ၪလၩ့ဝ့ၫ လၧအမိမၩဂၭ ဂီၩ့ဘၭဘလၧၫ့အၡၩကိၪ့ဆၧၥ့ၪလီၫ. လ့ၩနုၬဝ့ၫတၭ, စံၭအဝ့ၫဘဲၫယီၩ, ထီးမၩဂၭဂီၩ့ ဘၭဘလၧၫ့ အၡၩ ကိၪ့ဆၧၥ့ၪလဂ့ၩး ၥိၫ့ယၧၩ လၧစဎွၩ အမ့ၬယၫတၭ,",
			"25": "<sup>25</sup> ယမိဖၭအခီၫပယီၫလၧစဎွၩအမ့ၬယၫလီၫ.- ထီးနီၪ လဖၧၫ့စအၫရအီၭၥိၫ့ထၪ့စဒၫ့နအ့လၭ လၧစဎွၩအမ့ၬ ယၫချဲၫ့ချဲၫ့တၭ, စံၭအဝ့ၫဘဲၫယီၩ, ယဒၪန့ၦလၧၦယု ဒၫဖိၪၥံၪကဲၪဎီးအကျၩလဂၩ လၧအမိလီၩဘၪစဎွၩလၧ အခီၫပယီၫနီၪလီၫ.",
			"26": "<sup>26</sup> စဎွၩချဲၩ့ထၪ့ဆၧတၭစံၭစဒၫ့နအ့လၭ လၧအမံၩ့မွဲ ဘ့ၫလၭတၡၭဇၫနီၪ, နဒုၭၥ့ၪယၫယၧၩလၧဆၧမံၫမး လၧယဒၪဘၪတၭ, ဖၭန့အခီၫပယီၫနီၪဘၪမိၥ့ၪဧၪ.",
			"27": "<sup>27</sup> စဒၫ့နအ့လၭ စံၭဆၧၫ့ဆၧလၧစဎွၩအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ဆၧအီၪၥူၪလမံၩ့လၧစဎွၩအၪ့ကံၩ့ဝ့ၫနီၪ,ၦ ကိၪ့ဆၧၥ့ၪ, ၦၥ့ၪဆၧအူၪဆၧပီၩ, ၦကွ့ၭလံၬ, ၦယိၡၪ",
			"28": "<sup>28</sup> ၥံၪၥ့ၪနီၪ, ဒုၭနဲၪစဎွၩၥ့ၪနးဂၩအ့ၬ.- မွဲလါနၫ့ဘိၩယွၩ အီၪဝ့ၫလၧမူၭခိၪလဂၩ, လၧအနဲၪဖျီၪဆၧအီၪၥူၪလ ဖၪတၭ,အဝ့ၫဒၪဒုၭၥ့ၪယၫ စဎွၩန့ၭဘူၫခၭန့ဇၫလၧ ဆၧလၧအမိမၩအၥၭ လၧမုနံၩလဖၪလၧယၫနီၪလီၫ. နဆၧမံၫမး, ဒဲနမ့ၬၥၪဒၪဆၧလၧယၫလခီၫလၧနလးမံၫ",
			"29": "<sup>29</sup> အဖၧၩ့နီၪမွဲအယီၩ,- နဝ့ၫဒၪစဎွၩဧ့, နဆၧဆီၫ့မီၪ့ထၪ့ လၧနလးမံၫအဖၧၩ့ လၧဆၧလၧအမိမၩအၥၭလၧခဲၫ့ လၧယၫအဂဲးလီၫ. တၭၦလၧအနဲၪဖျီၪဆၧအီၪၥူၪနီၪ ဒုၭၥ့ၪယၫနၧၩလၧ ဆၧလၧအမိမၩအၥၭလၧနၧၩလီၫ.",
			"30": "<sup>30</sup> တၭဆၧလၧယၧၩယီၩ, ဆၧအီၪၥူၪလမံၩ့ယီၩဖျီၪထၪ့ လၧယမ့ၬယၫမွဲလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ အီၪလၧယၧၩ ဒိၪနဲၪ့ဒံၭကယဲဆၧၥၭမၧၫ့နီၪမွဲအ့ၬ. မွဲဘဲၫၥိၭဆၧမိ ဒုၭၥ့ၪယၫစဎွၩလၧဆၧအခီၫပယီၫနီၪ, ဒဲဘဲၫၥိၭနမိၥ့ၪ ယၫနၥၭအဆၧဆီၫ့မီၪ့လီၫ.",
			"31": "<sup>31</sup> နဝ့ၫဒၪစဎွၩဧ့,နယိဆၧတၭ, ယိခွါ,ဆၧဂၩ့ဖၭဒိၪ တၭ,မွဲအဒိၪအထီၫတၭ, ယုၩ့ယဲဒိၪမၬနီၪ,ဆၧၫ့ထုၪ့ လၧနမ့ၬယၫတၭ, အခံးအဂၩ့အီၪဝ့ၫလၧအကယးအ",
			"32": "<sup>32</sup> ကဖးဒိၪလီၫ.- ဆၧအဂၩ့နီၪမွဲဘဲၫယီၩ, အခိၪဎွံၪမွဲထီၫ့ ဆံၫ့,အၥၭနၫဒဲအစူၪမွဲစ့ၩ, အဂူၭဖိၫ့ဒဲအကံၪထံၭနီၪမွဲ",
			"33": "<sup>33</sup> ထီးဘၩ့,- အခၪ့ဒူၪမွဲထၭ, အခၪ့ယၫၥၭမွဲထၭလကုၭ",
			"34": "<sup>34</sup> ဒဲဖံၬလကုၭလီၫ.- နယိဒံၭဆၧတၭ, ထီးအစူၪလအီၪ ဘၪနီၪ,ဆၧဖျၭန့ခွံၬလိးလဖျိၪ့ လၧအဘၪတီၩ့ဘၪထံၭ ဆၧဂၩ့အခၪ့လၧအမွဲထၭဒဲဖံၬနီၪတၭ, မၩလၩ့ဘျ့ၭဝ့ၫ",
			"35": "<sup>35</sup> လီၫ.- ထီးနီၪလဖၧၫ့,ထၭ, ဖံၬ,ထီးဘၩ့, စ့ၩဒဲထီၫ့ လဖၪနီၪလၩ့ဎီးဝ့ၫစီၪ့ဎးတၭ, ကဲၪထၪ့ဆၧဘဲၫဖ့ၫလၧ ဆၧခိအထီအခရဲးဖၧၩ့အၥိၭနီၪတၭ, လံၩအူၪဒံၩခွံၬ ဝ့ၫတၭ,အလးအီၪလၧအဂးနးစီၪ့အ့ၬ. တၭလိးလၧအ ဘၪတီၩ့ဘၪထံၭဆၧဂၩ့နီၪ ကဲၪထၪ့ခိၪလီၩ့ဖၭဒိၪလ",
			"36": "<sup>36</sup> ဖျိၪ့တၭ,မၩဎွ့ၩဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫလီၫ.- အနီၪမွဲဆၧ မံၫမးနီၪတၭ, ပမိဖၭန့အခီၫပယီၫလၧစဎွၩအမ့ၬယၫ လီၫ.",
			"37": "<sup>37</sup> နဝ့ၫဒၪစဎွၩဧ့, နမွဲစဎွၩလဖၪအစဎွၩး အဂဲးဘဲၫ ယီၩမူၭခိၪအယွၩဖ့ၪလၫ့နၧၩ လၧဆၧအဘၩ့အမုး, ဒဲဆၧအစီၩ့အမၩ့, ဒဲဆၧအဂဲးအဘၭ, ဒဲဆၧလၩဖၩ့",
			"38": "<sup>38</sup> လီၫ.- တၭထီးဒၪၦၡၩၥံၪအီၪဝ့ၫလစီၪ့လါလါနီၪ, အ ဝ့ၫဒၪဖ့ၪလၫ့ဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩ, ဒဲထိၪဖိၪ လံၪဖိၪလၧမူၭဖိၭဖၫ့လဖၪ လၧနစူၪဖၧၩ့တၭ,အီၪက့ၪ နၧၩလၧဆၧထီးအလူၬနီၪအခိၪလီၫ. နဝ့ၫဒၪယီၩ,နမွဲ",
			"39": "<sup>39</sup> ဆၧခိၪဎွံၪထီၫ့လီၫ.- လၧနလးခဲၫ့နီၪဘၩ့မုးအဂူၫဂၩ ဆံၭနဲၪ့ဒံၭနၧၩ လဘၩ့မုးမိအီၪထၪ့တၭ, ဘၩ့မုးထီး ဘၩ့မွဲဘၩ့မုးအဂူၫဂၩ ၥၧၫ့ဘၩ့မုးလဘၩ့မုးလၧအမိ",
			"40": "<sup>40</sup> စ့ၩရၫ့ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫမိအီၪထၪ့လီၫ.- အဘၩ့အမုး လံဘၩ့မုးလဘၩ့မုးနီၪ မိဆီၪ့ဝ့ၫ ဘဲၫထၭအၥိၭလီၫ. ဘဲၫထၭမၩခါခွံၬဒဲမၩလၩ့ဘျ့ၭခွံၬ ကယဲဆၧလမံၩ့လါ လါအၥိၭတၭ ဘဲၫထၭမၩလၩ့ဘျ့ၭဆၧလဖၪအၥိၭနီၪ မိမၩလၩ့ဘျ့ၭဝ့ၫတၭ, မၩလၩ့ဎဲးလၩ့မုၬလၩ့မၫ့ထီး",
			"41": "<sup>41</sup> အလူၬနီၪလီၫ.- မွဲနဒၪဘၪအခၪ့ယၫၥၭဒဲအခၪ့နိၩ့လ ဖၪလၧအမွဲဖံၬလနၩ့ဒဲထၭလနၩ့တၭ, ဘၩ့မုးမိလၩ့မု လၩ့ဖၭလါနၫ့တၭ, ထၭအဂဲးအဘၭဘဲၫထၭအၥိၭမိ အီၪဝ့ၫလၧအဖၧၩ့, အဂဲးဘဲၫယီၩနဒၪဘၪထၭအီၪဎုၬ",
			"42": "<sup>42</sup> လၧဖံၬလီၫ.- ခၪ့နိၩ့လဖၪမွဲထၭလနၩ့ဒဲဖံၬလနၩ့တၭ,",
			"43": "<sup>43</sup> ဘၩ့မုးမိဆီၪ့လနၩ့, ဒဲမိဘူၪလနၩ့လီၫ.- မွဲနဒၪဘၪထၭ အီၪဎုၬလၧဖံၬတၭ, မိမၩဎုၬအၥၭလၧၦၡၩအချံၫအၥၪ လါနၩ့တၭ, လမိဘုၭထၬလိၬဘၪအၥၭလဂၩဒဲလဂၩ, ယိခွါ,ဘဲၫထၭလအီၪဎုၬဘၪ လၧဖံၬအၥိၭနီၪလီၫ.",
			"44": "<sup>44</sup> ဆၧလၧစဎွၩလဖၪနီၪ အမုနံၩအထးဖၧၩ့တၭ, မူၭခိၪ အယွၩမိအီၪက့ၪလၩ့ဘၩ့မုးနးဘၩ့မုး လၧအလမိဂၭ ဂီၩ့ဘၪလၩ့ဆိၩလၩ့ကၠၪလီၫ. တၭဘၩ့မုးနီၪအီၪလၩ့ ထးဘၪဝ့ၫလၧၦဂူၫဂၩ လဆၨၩအဂးအ့ၬ. မိမၩလၩ့ ဘျ့ၭခွံၬအဝ့ၫၥံၪတၭ, မိမၩလူၬခွံၬဘၩ့မုးလဖၪနီၪထီး အလူၬ,အ့ၪမွဲအဝ့ၫနီၪ မိအီၪဂုးခၧၫ့ဝ့ၫ လၩ့ဆိၩလၩ့",
			"45": "<sup>45</sup> ကၠၪလီၫ.- မွဲနဒၪဆၧလၧအစူၪလအီၪဘၪတၭ, ဆၧ ဖျၭန့ခွံၬလိးလဖျိၪ့လၧခိၪလီၩ့အလီၩ့တၭ, အဆၧနီၪ မၩလၩ့ဘျ့ၭထၭ, ထီးဘၩ့,ဖံၬ, စ့ၩဒဲထီၫ့နီၪလီၫ. ယွၩ ဖၭဒိၪဒုၭၥ့ၪယၫစဎွၩ လၧဆၧလၧအမိမၩအၥၭလၧ ခဲၫ့လၧယၫလီၫ. တၭဆၧမံၫမးနီၪမွဲအခၧၫ့တၭ, ဆၧ ဖၭန့အခီၫပယီၫနီၪမွဲအမွဲဆၧတီၩလီၫ.",
			"46": "<sup>46</sup> ထီးနီၪလဖၧၫ့စဎွၩန့ၭဘူၫခၭန့ဇၫ ထွံၩလၩ့ၡီၫ့လၩ့ အၥၭတၭ, မၪလူၬဝ့ၫလၧၦမိလုထၪ့စဒၫ့နအ့လၭလၧ ဆၧလုဒဲဆၧနၧၫ့မၧၫ့လီၫ.",
			"47": "<sup>47</sup> တၭစဎွၩစံၭဆၧၫ့စဒၫ့နအ့လၭတၭ, စံၭဝ့ၫဒၪ,မွဲမၬ, နၥံၪအယွၩနီၪမွဲကဆါလဖၪအယွၩး ဒဲစဎွၩလဖၪအ ကဆါတၭ, မွဲနနဲၪဖျီၪဆၧအီၪၥူၪလမံၩ့ယီၩၥ့ၪတၭ, မွဲဝ့ၫဆၧနဲၪဖျီၪဆၧအီၪၥူၪလဖၪနီၪၥ့ၪလီၫ.",
			"48": "<sup>48</sup> ထီးနီၪလဖၧၫ့စဎွၩအီၪက့ၪစဒၫ့နအ့လၭ လၧၦအခိၪ တၭ,ဖ့ၪလၫ့ဝ့ၫလၧလၬဆီၪ့အဒိၪအအၪတၭ, အီၪက့ၪ ဝ့ၫလၧခးဘၭဘလၧၫ့ ထၧၫ့ဘံၪ့ယၫအဖၫ့ခိၪ, ဒဲဘၭ ဘလၧၫ့အၡၩကိၪ့ဆၧၥ့ၪအခိၪလဖၪ အဒိၪထုၬလီၫ.",
			"49": "<sup>49</sup> စဒၫ့နအ့လၭ အၪ့ကံၩ့ဆၧလၧစဎွၩတၭ, မွဲအအီၪက့ၪ လၩ့စၡၫဒၭ, စမံၡ့ၭ, ဒဲစအဘ့ၫဒန့ဂိၫ လၧဆၧလၧခး ဘၭဘလၧၫ့အဖၧၩ့လဖၪအဖၫ့ခိၪလီၫ. အ့ၪမွဲစဒၫ့နအ့ လၭဆၧၫ့နၩ့ဝ့ၫလၧစဎွၩအတရၫ့ဖၧၩ့နီၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> စဎွၩန့ၭဘူၫခၭန့ဇၫမၩကဲၪထၪ့ဆၧဂၩ့ထီၫ့ လၧအ ထၪ့ထီၫအဖျါဎူၫဆံၫ, ဒဲအဒၪ့ဎၩ့ဎူၫဖျါလီၫ. အီၪက့ၪ ဝ့ၫလၧဆၧပျၩ့ဒုရၫအဖၧၩ့ လၧခးဘၭဘလၧၫ့အဖၧၩ့ လီၫ.",
			"2": "<sup>2</sup> တၭစဎွၩန့ၭဘူၫခၭန့ဇၫအၪ့မၧၫ့ ၦလ့ၩဒုၭအီၪကိၩ့ အီၪကီၪ့ၦဒိၪဖၭဒိၪ, ၦဒိၪၦၡါၥံၪ, ၦပၧၩ့ဆၧဖိၪၥံၪ, ၦ စ့ၩရၫ့ခွးၥံၪ, ၦပၧၩ့စ့ၩၥံၪ, ၦၥ့ၪဆၧၥီၪ့ဆၧၥၫ့ၥံၪ, ၦၥ့ၪ ဆၧမၪလူၬၥံၪ, ဒဲၦပၧၩ့ဆၧလၧခးဖိၪအဖၧၩ့ထီးအလူၬ ဘဲၫၥိၭအမိဂဲၫမၩဘိၪ့ဖလါဆၧဂၩ့ လၧစဎွၩန့ၭဘူၫခၭ န့ဇၫအီၪက့ၪထၪ့ဝ့ၫနီၪလီၫ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့, ၦဒိၪၦၡါၥံၪ, ၦပၧၩ့ဆၧၥံၪ,ၦစ့ၩရၫ့ ခွးၥံၪ,ၦပၧၩ့စ့ၩၥံၪ, ၦၥ့ၪဆၧၥီၪ့ဆၧၥၫ့ၥံၪ, ၦၥ့ၪဆၧမၪ လူၬၥံၪဒဲၦပၧၩ့ဆၧလၧခးဖိၪအဖၧၩ့ ထီးအလူၬနီၪအီၪ ကိၩ့အီၪကီၪ့ဘဲၫၥိၭ အမိမၩဘိၪ့ဖလါဆၧဂၩ့လၧစဎွၩ န့ၭဘူၫခၭန့ဇၫအီၪက့ၪထၪ့ဝ့ၫတၭ, အဝ့ၫၥံၪဆၧၫ့ထုၪ့ ဝ့ၫလၧဆၧဂၩ့လၧစဎွၩန့ၭဘူၫခၭန့ဇၫအီၪက့ၪထၪ့ဝ့ၫ နီၪအမ့ၬယၫလီၫ.",
			"4": "<sup>4</sup> တၭၦကိၭဆၧလဂၩနီၪကိၭၡၭထၪ့ဆၧ, ၦခမျၧးလ ဖၪ,ၦဆၨၩလဖၪ, ဒဲၦချဲၩ့ဆၧအလၨကိၭဆၨၩဒ့ၭၥံၪ",
			"5": "<sup>5</sup> ဧ့,ဆၧမၪလူၬနၥံၪ,- ထီးအထီလၧနၥံၪနါဂၧၫ့ခွ့ၩ,ပံၩ, နါဒံၩ့,ခနၭ,ၥၫ့ထီး, ဖီးနံၫဘီၩ့လမံၩ့, ဒဲကယဲဆၧၥံၫ ကျံၩအၥီၫတၭ, နၥံၪမိဘၪထွံၩလၩ့ နၥံၪအၥၭတၭ, ဘၩထၪ့ဆၧဂၩ့ထီၫ့ လၧစဎွၩန့ၭဘူၫခၭန့ဇၫအီၪက့ၪ",
			"6": "<sup>6</sup> ထၪ့ဝ့ၫလီၫ.- ထီးဒၪၦလၧအလထွံၩလၩ့ဘၪအၥၭတၭ, လဘၩဘၪဝ့ၫလဂၩလါလါနီၪ, ဆၧမိခွံၬလၩ့ခွံၬဝ့ၫ",
			"7": "<sup>7</sup> လၧမ့ၪခဲၩထၪ့အဖံၫ့ချၪဖၧၩ့နီၪချဲၫ့မၬလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ထီးအထီလၧၦကိၭဆၨၩဒ့ၭ နါဂၧၫ့ခွ့ၩ, ပံၩ,နါဒံၩ့,ခနၭ, ၥၫ့ထီး,ဒဲကယဲဆၧၥံၫကျံၩအၥီၫတၭ, ၦခမျၧးလဖၪ, ၦဆၨၩလဖၪ, ဒဲၦချဲၩ့ဆၧအလၨကိၭ ဆၨၩဒ့ၭထီးအလူၬနီၪ ထွံၩလၩ့အၥၭတၭ, ဘၩထၪ့ ဆၧဂၩ့ထီၫ့လၧစဎွၩ န့ၭဘူၫခၭန့ဇၫ အီၪက့ၪထၪ့ဝ့ၫ နီၪလီၫ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦၡၩ,ၦခၫလဒံအၫဖိၪၥံၪလ နၩ့ၥုၭဘူၭအၥၭတၭ, အီၪက့ၪဆၧမၪလၧၦယုဒၫဖိၪၥံၪ",
			"9": "<sup>9</sup> အလီၩ့လီၫ.- အဝ့ၫၥံၪချဲၩ့ဆၧလၧစဎွၩန့ၭဘူၫခၭန့ဇၫ",
			"10": "<sup>10</sup> တၭ,စံၭဝ့ၫ,မွဲစဎွၩမၧၫ့ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪဆံၭ.- နဝ့ၫ ဒၪစဎွၩဧ့, နလူလၩ့လၧကယဲၦၡၩလၧအနါဂၧၫ့ခွ့ၩ,ပံၩ, နါဒံၩ့,ခနၭ,ၥၫ့ထီး, ဖီးနံၫဘီၩ့လမံၩ့, ဒဲကယဲဆၧၥံၫ ကျံၩအၥီၫလဂၩလါလါနီၪ မိဘၪထွံၩလၩ့အၥၭတၭ,",
			"11": "<sup>11</sup> ဘၩထၪ့ဆၧဂၩ့ထီၫ့,- တၭထီးဒၪၦလၧအလထွံၩလၩ့ ဘၪအၥၭတၭ, လဘၩထၪ့ဘၪလဂၩဂၩနီၪ, ဆၧမိဘၪ",
			"12": "<sup>12</sup> ခွံၬလၩ့ခွံၬအဝ့ၫလၧမ့ၪခဲၩအဖံၫ့ချၪဖၧၩ့နီၪလီၫ.- ၦၡၩ ၦယုဒၫဖိၪၥံၪလနၩ့ လၧနအီၪက့ၪလၩ့ လၧခးဘၭဘ လၧၫ့အဆၧမၩအဖၫ့ခိၪ, စၡၫဒၭ,စမံၡ့ၭ, ဒဲစအဘ့ၫ ဒန့ဂိၫလဖၪနီၪအီၪဝ့ၫလီၫ. စဎွၩဧ့, အဝ့ၫၥံၪဒူၩယၪ့ နၧၩအ့ၬ,လမၩဘၪနကဆါလဖၪအဆၧတၭ, ဘၩဆၧ ဂၩ့ထီၫ့လၧနအီၪက့ၪထၪ့ဝ့ၫနီၪဆ့အ့ၬ.",
			"13": "<sup>13</sup> တၭစန့ၭဘူၫခၭန့ဇၫ မၪလူၬဝ့ၫလၧအၥၭထၪ့ဒဲအ ၥၭခဲၩထၪ့ဘဲၫၥိၭၦမိဂဲၫဆိၬ စၡၫဒၭ, စမံၡ့ၭ, ဒဲစအ ဘ့ၫဒန့ဂိၫတၭ, အဝ့ၫၥံၪဂဲၫဆိၬၦလဖၪနီၪလၧစဎွၩအ",
			"14": "<sup>14</sup> မ့ၬယၫလီၫ.- တၭစန့ၭဘူၫခၭန့ဇၫ ချဲၩ့ဆၧလၧအဝ့ၫ ၥံၪတၭစံၭဝ့ၫ, စၡၫဒၭ,စမံၡ့ၭ ဒဲစအဘ့ၫဒန့ဂိၫၥံၪဧ့, မွဲနၥံၪအီၪက့ၪနၥံၪအၥၭ လၧနၥံၪလမၩဘၪယယွၩလ ဖၪအဆၧ, နၥံၪလဘၩထၪ့ဘၪဆၧဂၩ့ထီၫ့လၧယအီၪ",
			"15": "<sup>15</sup> က့ၪထၪ့ဝ့ၫနီၪဆ့ဧၪ.- ဘိၩ့နဲၪ့ယီၩ, ထီးအထီလၧနၥံၪ နါဂၧၫ့ခွ့ၩ, ပံၩ,နါဒံၩ့, ခနၭ,ၥၫ့ထီး, ဖီးနံၫဘီၩ့လမံၩ့, ဒဲကယဲဆၧၥံၫကျံၩအၥီၫနီၪ နၥံၪအ့ၪတဲၩ့ဝဲၩနၥံၪအၥၭ တၭ,နၥံၪအ့ၪထွံၩလၩ့နၥံၪအၥၭ ဒဲဘၩဆၧဂၩ့လၧယ မၩကဲၪထၪ့ဝ့ၫနီၪတၭ, ဂ့ၩယူၭ, အ့ၪမွဲနၥံၪအ့ၪလဘၩ ထၪ့ဘၪတၭ, နၥံၪမိဘၪဆၧခွံၬလၩ့ခွံၬနၥံၪလၧမ့ၪခဲၩ အဖံၫ့ချၪဖၧၩ့လၧနၩရံၩနီၪလီၫ. တၭယွၩလၧအမိမၩ ဖီၩ့ဖျ့ၭနၥံၪလၧယစူၪဖၧၩ့နီၪ, မွဲပလၫလဂၩလဲၪ.",
			"16": "<sup>16</sup> စၡၫဒၭ, စမံၡ့ၭ,ဒဲစအဘ့ၫဒန့ဂိၫနီၪ စံၭဆၧၫ့စ ဎွၩန့ၭဘူၫခၭန့ဇၫတၭ စံၭဝ့ၫဒၪ, ပစံၭဆၧၫ့ဆၧလၧဆၧ",
			"17": "<sup>17</sup> လမံၩ့ယီၩအဂဲးနီၪအလးအီၪအ့ၬ.- ယိခွါ,ပယွၩလၧ ပမၩအဆၧလဂၩနီၪ, မၩဖီၩ့မၩဖျ့ၭပၧၩလၧမ့ၪခဲၩအ ဖံၫ့ချၪဖၧၩ့ၥ့ၪတၭ, မွဲအမိမၩဖီၩ့မၩဖျ့ၭပၧၩ လၧနစူၪ",
			"18": "<sup>18</sup> ဖၧၩ့ဆ့,စဎွၩဧ့,- အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, စဎွၩဧ့,လၧ ပလမၩဘၪနယွၩလဖၪအဆၧ, ပလဘၩထၪ့ဘၪနဆၧ ဂၩ့ထီၫ့လၧနအီၪက့ၪထၪ့နီၪ, ၥ့ၪယၫနဝ့ၫဒၪဆံၭ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ စန့ၭဘူၫခၭန့ဇၫ အၥၭထၪ့ဎွ့ၩတံၭ တၭ,အမ့ၬအခံးအဂၩ့လၩ့မဲၩဒၪဆၧထၫ့ဒၩစၡၫဒၭ, စမံၡ့ၭ,ဒဲစအဘ့ၫဒန့ဂိၫလီၫ. တၭမၪလူၬဝ့ၫ လၧၦမိ",
			"20": "<sup>20</sup> ဘၪမၩဖံၫ့ချၪဖၧၩ့နီၪခိနဲၪ့အလးနွ့ၫဘျၩ့လီၫ.- တၭမၪ လူၬၦအဂဲးဆီၪ့အဘၭဆီၪ့ လၧၦၥုၭမုအကျၩလဖၪ, ဘဲၫၥိၭအမိစၧၩ့ထၬစၡၫဒၭ, စမံၡ့ၭ,ဒဲစအဘ့ၫဒန့ဂိၫ တၭ,ခွံၬလၩ့ခွံၬအဝ့ၫၥံၪ လၧမ့ၪခဲၩအဖံၫ့ချၪဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> ထီးနီၪလဖၧၫ့ၦစၧၩ့ထၬအဝ့ၫၥံၪနီၪ အီၪလၧအဆၧဖျၪ့ ခဲၫ့,ဒဲအဆဲၫ့, ဒဲအဖၬဘဲၩ့,ဒဲအဆၧကီၩ့ဆၧၥိၭအဂူၫ ဂၩတၭ,ခွံၬလၩ့ခွံၬဝ့ၫလၧမ့ၪခဲၩအဖံၫ့ချၪဖၧၩ့ အၥၭ",
			"22": "<sup>22</sup> ကျၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, စဎွၩအဆၧမၪလူၬ ဆီၪ့ဝ့ၫ,ဒဲဖံၫ့ချၪဖၧၩ့နီၪခိနၭနၭလ့ၬအကၠီၩ့တၭ, မ့ၪလၪ ဖျဲၩ့စိၩအၪ့ၥံၫၦၡၩလၧအဆိၬထၪ့စၡၫဒၭ, စမံၡ့ၭ,ဒဲ",
			"23": "<sup>23</sup> စအဘ့ၫဒန့ဂိၫလီၫ.- တၭစၡၫဒၭ, စမံၡ့ၭ,ဒဲစအဘ့ၫဒ န့ဂိၫၥၧၫ့ဂၩနီၪလၩ့ထ့ၬစၧၩ့ထၬအၥၭ လၧမ့ၪခဲၩအဖံၫ့ ချၪဖၧၩ့အၥၭကျၩလီၫ.",
			"24": "<sup>24</sup> ထီးနီၪလဖၧၫ့စဎွၩန့ၭဘူၫခၭန့ဇၫနီၪ မၩထၪ့အၥၭ ထီၫမံၫထီၫမၪတၭ, ဂဲထုၪ့ချဲၫ့ချဲၫ့တၭချဲၩ့ဆၧတၭ,စံၭ အၡၩကိၪ့လိၬအၥၭလဖၪနီၪ, ပခွံၬလၩ့ခွံၬၦဘၪစၧၩ့ ထၬဝ့ၫၥၧၫ့ဂၩလၧမ့ၪအကျၩနီၪမွဲအ့ၬဧၪ. အဝ့ၫၥံၪစံၭ",
			"25": "<sup>25</sup> ဆၧၫ့ဆၧလၧစဎွၩတၭ, စံၭဝ့ၫ,မွဲယူၭ,စဎွၩဧ့,- အဝ့ၫ နီၪစံၭဆၧၫ့ဝ့ၫဒၪတၭ, စံၭဝ့ၫ,ယိခွါ, ယဒၪဘၪၦအီၪ ပျီၩဖျ့ၭဝ့ၫလံဂၩ, လ့ၩဆၧလၧမ့ၪအကျၩတၭ, ဘၪဆၧ အၧၩ့နးမံၩ့အ့ၬ. တၭအဝ့ၫၥံၪလံဂၩလဂၩနီၪ,အခံးအ ဂၩ့မၩအၥၭဘဲၫယွၩအဖိၪခွၫလဂၩအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> ထီးနီၪလဖၧၫ့စန့ၭဘူၫခၭန့ဇၫၥုၭဘူၭအၥၭလၧမ့ၪ ဖံၫ့ချၪအခိၪထိၭလီၫ. ချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ယွၩအ ထီၫထုၬအခ့ၫအၡၩ, စၡၫဒၭ,စမံၡ့ၭ, ဒဲစအဘ့ၫဒန့ဂိၫ ၥံၪဧ့,စဲၪ့ထၪ့ခွံၬတၭ, ဂဲၫထၪ့ဘီၪ. ထီးနီၪလဖၧၫ့စၡၫ ဒၭ,စမံၡ့ၭ, ဒဲစအဘ့ၫဒန့ဂိၫစဲၪ့ထၪ့ခွံၬဝ့ၫလၧမ့ၪကျၩ လီၫ.",
			"27": "<sup>27</sup> တၭၦဒိၪဖၭဒိၪၥံၪ, ၦဒိၪၦၡါၥံၪ, ၦပၧၩ့ဆၧၥံၪ, ဒဲ စဎွၩအၡၩကိၪ့လိၬအၥၭလဖၪ အီၪကိၩ့အီၪကီၪ့ဝ့ၫ တၭ,ယိၦလဖၪယီၩတၭ, မ့ၪအၧၩ့အစီၩ့အမၩ့လအီၪ ဘၪလၧအမိၡါအလီၩ့နးမံၩ့, ဒဲအခိၪၥူၫလခိဂိၬဘၪနး ဘီၩ့,ဒဲအဆၧဖျၪ့ခဲၫ့အီၪဒၪအဆၧတၭ, မ့ၪအနၧၫ့ဎိၪ ဘၪအဝ့ၫၥံၪအ့ၬ.",
			"28": "<sup>28</sup> ထီးနီၪလဖၧၫ့စန့ၭဘူၫခၭန့ဇၫ, ချဲၩ့ဆၧတၭ, စံၭဝ့ၫ ဒၪ,စၡၫဒၭ,စမံၡ့ၭ, ဒဲစအဘ့ၫဒန့ဂိၫလဖၪအယွၩလၧ အအၪ့မၧၫ့လၩ့အၥီၫ့လဂၩတၭ, မၩဖီၩ့မၩဖျ့ၭအခ့ၫ အၡၩလၧအဒိၭနဲၩ့အၥၭလၧအဝ့ၫတၭ, လၨခၫ့ဖၬ စဎွၩအဆၧမၪလူၬတၭ, ဖ့ၪလၫ့ခွံၬအနၫ့ဆါဘဲၫၥိၭ, အ့ၪလမွဲဘၪအယွၩဒၪဝ့ၫလဂၩ, အထီးမၩယွၩဂူၫဂၩ အဆၧ,အထီးဘၩဝ့ၫလဂ့ၩလဂၩနီၪ, မွဲအဘၪဆၧ ဆိၪဂ့ၩဝ့ၫဆံၭ.",
			"29": "<sup>29</sup> မၩအၥၭဘဲၫနီၪတၭ, ယလူလၩ့လၧကယဲၦခမျၧး, ၦဆၨၩလဖၪ, ဒဲၦချဲၩ့ဆၧအလၨကိၭဆၨၩဒ့ၭလၧအ ချဲၩ့မၪဘၪစၡၫဒၭ, စမံၡ့ၭ, ဒဲစအဘ့ၫဒန့ဂိၫလဖၪအ ယွၩလဂၩလါလါနီၪ, ဆၧမိဒၪ့ထ့ၬခွံၬဝ့ၫ လကုၭလ ကုၭတၭ, အဂံၪ့မိကဲၪထၪ့ဆၧအ့ၪအလးလီၫ. အဂဲး ဘဲၫယီၩယွၩအဂူၫဂၩ လၧအမၩဖီၩ့မၩဖျ့ၭဆၧဘဲၫယီၩ အၥိၭအီၪနးဂၩအ့ၬ.",
			"30": "<sup>30</sup> ထီးနီၪလဖၧၫ့စဎွၩဒုၭဘီၪထၪ့ယီၫထၪ့ စၡၫဒၭ, စမံၡ့ၭ, ဒဲစအဘ့ၫဒန့ဂိၫ လၧခးဘၭဘလၧၫ့အဖၧၩ့ လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> တၭစဎွၩန့ၭဘူၫခၭန့ဇၫ စံၭကယဲၦခမျၧး,ၦဆၨၩ လဖၪ,ဒဲၦချဲၩ့ဆၧအလၨကိၭဆၨၩဒ့ၭထီးအလူၬလၧ အအီၪဝ့ၫလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ, မွဲဆၧဘၪလိၬအိၭ",
			"2": "<sup>2</sup> လိၬအၪထၪ့လၧနၥံၪဆံၭ.- ဘၪယၥၭလၧယမိဒုၭနဲၪ ဆၧနဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭလၧယွၩအထီၫ",
			"3": "<sup>3</sup> ထုၬလဂၩမၩယၧၩလီၫ.- အဆၧနဲၪ့လၩ့လၭနီၪဆံၭ ဒိၪလဲၪၬ အလၩ့လိလၩ့လၭနီၪ ဆံၭဒိၪဆံၭအၪလဲၪၬ အဘၩ့အမုးနီၪ မွဲဘၩ့မုးအဆိၩအကၠၪတၭ, အပၧၩ့ ဆၧအလးနီၪအီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"4": "<sup>4</sup> ယဝ့ၫဒၪစန့ၭဘူၫခၭန့ဇၫယီၩ, ယအီၪပွံၭလၧယဂံၪ့",
			"5": "<sup>5</sup> ဖၧၩ့တၭ,ယဘီၪထၪ့ယီၫထၪ့လၧယနီးဖၧၩ့လီၫ.- ယ ဒၪဘၪဆၧမံၫမးလၧအမၩၥၭမဲၪယၧၩတၭ, ယဆီၫ့မီၪ့ ဆၧလဖၪလၧယလးမံၫအဖၧၩ့, ဒဲယဒၪဆၧလၧယၫ",
			"6": "<sup>6</sup> လဖၪနီၪမၩခိယၥၭလီၫ.- တၭယလူလၩ့ဘဲၫၥိၭၦမိဂဲၫ ဆိၬကယဲဘၭဘလၧၫ့အၡၩကိၪ့ဆၧၥ့ၪ လၧယမ့ၬယၫ ဘဲၫၥိၭအမိဒုၭၥ့ၪယၫယၧၩ လၧဆၧမံၫမးနီၪ အခီၫပ",
			"7": "<sup>7</sup> ယီၫလီၫ.- ထီးနီၪလဖၧၫ့ၦကွ့ၭလံၬၥံၪၦၥ့ၪဆၧအူၪဆၧ ပီၩၥံၪ,ၦခၫလဒံအၫဖိၪၥံၪ, ဒဲၦယိၡၪၥ့ၪလဖၪ, ယလီၩ ထဲၩ့ဆၧမံၫမးနီၪလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ. မွဲလါနၫ့ တၭ,အဝ့ၫၥံၪဒုၭၥ့ၪယၫယၧၩ လၧအခီၫပယီၫအ့ၬ.",
			"8": "<sup>8</sup> တၭလၧခဲၫ့ထုၬနီၪ စဒၫ့နအ့လၭဂဲၫနုၬ လၧယမ့ၬယၫ (အမံၩ့မွဲဘ့ၫလၭတၡၭဇၫဘၪလၩ့ဎိၭ လၧယယွၩအ မံၩ့နီၪယွၩဆံၫ့ဎံၪလဖၪ အၥၭအီၪဝ့ၫလၧအဖၧၩ့တၭ,) ယလီၩထဲၩ့ဆၧမံၫမးနီၪလၧအမ့ၬယၫလီၫ.",
			"9": "<sup>9</sup> ၦကွ့ၭလံၬအၦဒိၪအခိၪ စဘ့ၫလၭတၡၭဇၫဧ့,မွဲ ယၥ့ၪယၫလၧယွၩဆံၫ့ဎံၪလဖၪ အၥၭအီၪဝ့ၫလၧနဖၧၩ့ တၭ,ဆၧအီၪၥူၪဝ့ၫနီၪ လမၩခိမၩဝီၩဘၪနၧၩနးမံၩ့, တၭဆၧလၧယဒၪဘၪလၧယၫလခီၫ, ဒဲအခီၫပယီၫနီၪ",
			"10": "<sup>10</sup> လီၩဘၪယၧၩနးထံၪဘီၪ.- ဆၧလၧယခိၪဎွံၪအဒၪဆၧ လၧယၫလခီၫ လၧယလးမံၫအဖၧၩ့မွဲအယီၩ, ယယိ ဆၧတၭ,ယိခွါ, ၥံၪ့လထံၭအီၪဝ့ၫလၧဂၪ့ခိၪအၥၭကျၩ",
			"11": "<sup>11</sup> တၭ,ထၪ့ထီၫဝ့ၫထီၫထီၫလ့ၬလီၫ.- ၥံၪ့နီၪဒိၪထၪ့ဝ့ၫ ဆီၪ့ထၪ့ဝ့ၫတၭ, အထၪ့ထီၫနီၪထၪ့ဘၭလၧမူၭခိၪတၭ,",
			"12": "<sup>12</sup> ဖျီၪဝ့ၫလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫအထုၬလီၫ.- အဒိၭအလၪ နီၪအီၪဝ့ၫလၧအဎံၫအလၩတၭ, အၥၪအီၪအၪအၪလ့ၬ တၭ,ဆၧအၪ့လၧဆၧထီးအလူၬအဂးနီၪ အီၪဝ့ၫလၧ အလီၩ့လီၫ. ဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩ အီၪကဒုၩ လၧအဖၫ့လၬတၭ, ထိၪလၧဆၧဖိၭဖၫ့လဖၪအီၪဝ့ၫလၧ အထဲၩ့အကျၩတၭ, ကယဲဆၧယၪ ထီးအလူၬၥံၪအၪ့",
			"13": "<sup>13</sup> ဆၧလၧအဝ့ၫလီၫ.- ယယိဆၧလၧယခိၪဎွံၪအဒၪဆၧ လၧယၫလခီၫလၧယလးမံၫဖၧၩ့တၭ, ယိခွါ,ၦခိၭဆၧ,",
			"14": "<sup>14</sup> ၦဆံၫ့ဎံၪလဂၩဂဲၫလၩ့လၧမူၭခိၪလီၫ.- အဝ့ၫဒၪကိၭၡၭ ထၪ့တၭ,စံၭဝ့ၫဘဲၫယီၩ, ခူၬလၩ့ခွံၬၥံၪ့လထံၭနီၪတၭ, ဖ့ၬထ့ၬခွံၬအထဲၩ့အဖၫ့, ဒိၪလၩ့ခွံၬအဒိၭအလၪတၭ, မၩလၩ့ပြံၩလၩ့ပၩအၥၪလဖၪဆံၭ. မွဲဆၧဖိၪဆၧဎါ စဲၪ့ထၪ့ခွံၬလၧအဖၫ့လၬ, ဒဲထိၪၥံၪလံၪၥံၪလၧအထဲၩ့",
			"15": "<sup>15</sup> အကျၩဆံၭ.- မွဲလါနၫ့ဒုၭအီၪလၩ့ထးအခိၪဆုၪ့လၧဂၪ့ ခိၪဖၧၩ့, အီၪဝ့ၫလၧၥွ့ၫထၭဒဲၥွ့ၫထီး, လၧမံၩ့လၬကျၩ အနၪ့ၥံၪမံၩ့ၥံၪအကျၩဆံၭ. မိဘၪစီၪလၧမူၭခိၪအဆၩ့ ထံၫအဖၧၩ့တၭ, အဂးမိအီၪဝ့ၫလၧဆၧဖိၪဆၧဎါအၥိၭ",
			"16": "<sup>16</sup> လၧဂၪ့ခိၪအနၪ့ၥံၪမံၩ့ၥံၪအကျၩလီၫ.- အၥၭလကဲၪ လၧၩ့ဘၪၦၡၩအၥၭတၭ, ဆၧမိဖ့ၪလၫ့အဝ့ၫလၧဆၧ ဖိၪဆၧဎါအၥၭတၭ, ဆၧမိဆၧၫ့ထဲၩ့အလးနွ့ၫဘျၩ့လၧ",
			"17": "<sup>17</sup> အဖၫ့ခိၪလီၫ.- ဆၧလမံၩ့ယီၩ, မွဲလၧၦခိၭဆၧလဖၪစ့ၩ ရၫ့ဆၧတၭ, ဆၧအလူလၩ့, ဒဲဆၧဆံၫ့ဎံၪလဖၪအဆၧ မၪလူၬလထံၪမွဲဆၧအၪ့ကံၩ့ဝ့ၫ ဘဲၫၥိၭၦလၧအမၧၫ့ဝ့ၫ လဖၪမိၥ့ၪယၫလၧဆၧထီၫထုၬလဂၩပၧၩ့ဆၧလၧၦၡၩ အဘၩ့အမုးအဖၧၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧထီးဒၪၦလၧအ ဘၪအၥၭလဂၩဂၩတၭ, အီၪက့ၪၦၡၪ့ထုၬလၧအဖၫ့ခိၪ",
			"18": "<sup>18</sup> လီၫ.- အနီၪမွဲဆၧမံၫမးလၧယၧၩစဎွၩန့ၭဘူၫခၭန့ဇၫ ဒၪဘၪဝ့ၫလီၫ. ဘိၩ့နဲၪ့ယီၩနဝ့ၫဒၪဘ့ၫလၭတၡၭဇၫ ဧ့,ဖၭန့အခီၫပယီၫဆံၭ. အဂဲးဘဲၫယီၩ ၦကိၪ့ဆၧၥ့ၪ လၧယဘၩ့ယမုးအဖၧၩ့ထီးအလူၬနီၪ ဒုၭၥ့ၪယၫယၧၩ လၧအခီၫပယီၫၥ့ၪနးဂၩအ့ၬ. အ့ၪမွဲနဝ့ၫဒၪယီၩနၥ့ၪ လီၫ. အဂဲးဘဲၫယီၩ ယွၩဆံၫ့ဎံၪလဖၪ အၥၭအီၪဝ့ၫလၧ နဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ စဒၫ့နအ့လၭလၧအမံၩ့မွဲစဘ့ၫလၭ တၡၭဇၫအၥၭထီၫမံၫထီၫမၪဝ့ၫလဆိဖိၪတၭ, အဆၧဆီၫ့ မီၪ့မၩခိအၥၭလီၫ. စဎွၩချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, စဘ့ၫလၭတၡၭဇၫဧ့, မွဲဆၧမံၫမးဒဲအခီၫပယီၫနီၪထီး မၩခိမၩဝီၩနၥၭလဂ့ၩ. စဘ့ၫလၭတၡၭဇၫ စံၭဆၧၫ့ ဆၧတၭ,စံၭဝ့ၫဒၪ, ယကဆါဧ့, မွဲနဆၧမံၫမးနီၪဘၪ ၦလၧအမ့ၬလဲၩနၧၩတၭ, အခီၫပယီၫဘၪနဒုၪနဒၩၥံၪ",
			"20": "<sup>20</sup> ဆံၭ.- ၥံၪ့လၧနဒၪဘၪဝ့ၫလထံၭလၧအဒိၪထၪ့, ဒဲဆီၪ့ ထၪ့တၭ,ထီၫဝ့ၫထၪ့ဘၭလၧမူၭခိၪတၭ, ဖျီၪဝ့ၫလၧဂၪ့",
			"21": "<sup>21</sup> ခိၪထၧၫ့ဖျိၪ့ယၫ,- တၭအဒိၭအလၪနီၪအီၪလၧအဎံၫ အလၩတၭ, အၥၪအီၪဝ့ၫအၪအၪလ့ၬတၭ, ဆၧအၪ့ လၧဆၧထီးအလူၬအဂးအီၪဝ့ၫလၧအလီၩ့တၭ, ဆၧ ဖိၪဆၧဎါလၧမံၩ့လၬကျၩ အီၪဝ့ၫလၧအဖၫ့လၬတၭ, ထိၪၥံၪလံၪၥံၪလၧမူၭဖိၭဖၫ့နီၪ အီၪဝ့ၫအလးလၧအထဲၩ့",
			"22": "<sup>22</sup> ကျၩတၭ,- မွဲနၧၩစဎွၩဧ့, နဒိၪထၪ့,ဒဲနဆီၪ့ထၪ့တၭ, နဆၧဒိၪနီၪဒိၪထၪ့, ထၪ့ဘၭလၧမူၭခိၪတၭ, နဘၩ့နမုး",
			"23": "<sup>23</sup> နီၪထီၩ့လၧဂၪ့ခိၪအထုၬလီၫ.- တၭစဎွၩဒၪဘၪၦခိၭ ဆၧနီၪ,ၦဆံၫ့ဎံၪလဂၩဂဲၫလၩ့လၧမူၭခိၪ လၧအစံၭဝ့ၫ, ခူၬလၩ့ခွံၬၥံၪ့လထံၭနီၪတၭ, မၩဂၭဂီၩ့အဝ့ၫဆံၭး မွဲ လါနၫ့တၭ,ဒုၭအီၪလၩ့ထးအခိၪဆုၪ့ လၧဂၪ့ခိၪအဖၧၩ့, အီၪလၧၥွ့ၫထၭ, ဒဲၥွ့ၫထီးလၧမံၩ့လၬကျၩအနၪ့ၥံၪမံၩ့ ၥံၪအကျၩဆံၭ. တၭမိဘၪစီၪ လၧမူၭခိၪ အဆၩ့ထံၫ တၭ,အဂးမိအီၪဝ့ၫလၧဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩ အၥိၭထီးဆၧမိဆၧၫ့ထဲၩ့အလး နွ့ၫဘျၩ့လၧအဖၫ့ခိၪ",
			"24": "<sup>24</sup> လီၫ.- အယီၩမွဲအခီၫပယီၫ, စဎွၩဧ့, မွဲဆၧထီၫထုၬ လဂၩအဆၧစ့ၩရၫ့ လၧအဘၪယကဆါ စဎွၩလီၫ.",
			"25": "<sup>25</sup> တၭဆၧမိနၫ့ထၪ့ခွံၬနၧၩ လၧၦၡၩအကျၩတၭ, နအီၪ နလးမိအီၪဘၪလၧဆၧဖိၪဆၧဎါၥံၪ လၧမံၩ့လၬကျၩ အၥိၭတၭ, မိဒုၭအၪ့နၧၩ လၧနၪ့ၥံၪမံၩ့ၥံၪ ဘဲၫချီအၥိၭ တၭ,နလီၩ့မိဘၪစီၪလၧမူၭခိၪ အဆၩ့ထံၫအကျၩတၭ, ဆၧမိဆၧၫ့ထဲၩ့အလးနွ့ၫဘျၩ့ လၧနဖၫ့ခိၪထီးနၥ့ၪယၫ လၧဆၧထီၫထုၬလဂၩ ပၧၩ့ဆၧလၧၦၡၩ အဘၩ့အမုး အဖၫ့ခိၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧထီးဒၪၦလၧအဘၪအၥၭ",
			"26": "<sup>26</sup> လဂၩဂၩလီၫ.- မွဲဆၧမၪလူၬဝ့ၫ ဒုၭအီၪလၩ့ထးၥံၪ့ခိၪ ဆုၪ့တၭ,ထီးနမိၥ့ၪယၫ မူၭခိၪပၧၩ့ဆၧအလးခဲၫ့နီၪန",
			"27": "<sup>27</sup> ဘၩ့နမုးမိအီၪဂုးခၧၫ့လၧနစူၪဖၧၩ့လီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,စဎွၩဧ့, ယဆၧဒုၭကိၪ့မွဲအဘၪနၥၭဆံၭ. မၩ ဆၧတီၩဆၧလီၩ့တၭ, မၩထ့ၬခွံၬ နဆၧဒဲၩဘၭတၭ, နၥုၪ့မိယီၫၥၭမိယီၫ ၦၡၪ့ဖိၪယၬဖိၪတၭ, မၩထ့ၬခွံၬ နဆၧအမၪဆံၭ. ဘၪလဘၪဆၧမိဒုၭယံၬထၪ့နဆၧအီၪ မုၬအီၪဎၩ့လီၫ.",
			"28": "<sup>28</sup> ဆၧထီးအလူၬနီၪ လၩ့ဘၪစဎွၩန့ၭဘူၫခၭန့ဇၫ",
			"29": "<sup>29</sup> လီၫ.- လၩလဆံၫနံၫဘံၪ့အထုၬနီၪ စဎွၩစဲၪ့လဲးလီၩ့ဝ့ၫ",
			"30": "<sup>30</sup> လၧဘၭဘလၧၫ့ဘၩ့မုးအနီးဖၫ့ခိၪလီၫ.- စဎွၩချဲၩ့ဆၧ တၭ,စံၭဝ့ၫဒၪ, အယီၩမွဲဘၭဘလၧၫ့ဖၭဒိၪလၧယမၩ ကဲၪထၪ့ယဝ့ၫလၧယစီၩ့ဒိၪယမၩ့ထီၫ, ဒဲလၧယကယး ကဖးအလၩအဖၩ့အဂး, လၧဘၩ့ၥံၪမုးၥံၪအဂံၪ့အဂး မွဲအ့ၬဧၪ.",
			"31": "<sup>31</sup> ဆၧချဲၩ့လထံၪနီၪ အီၪဒံၭလၧစဎွၩအနိၭအဘိၩ့ဘၭ တၭ,ဆၧအလူၥီၫလၩ့လၧမူၭခိၪစံၭဝ့ၫ, စဎွၩန့ၭဘူၫခၭ န့ဇၫဧ့, ဆၧစံၭနၧၩ, ဘၩ့ၥံၪမုးၥံၪနီၪ စဲၪ့ထၪ့ခွံၬလၧ",
			"32": "<sup>32</sup> နအီၪလီၫ.- တၭဆၧမိနၫ့ထၪ့ခွံၬနၧၩ လၧၦၡၩအကျၩ တၭ,နအီၪအလးနီၪမိအီၪဝ့ၫ လၧဆၧဖိၪဆၧဎါလၧမံၩ့ လၬကျၩအၥိၭလီၫ. ဆၧမိဒုၭအၪ့နၧၩလၧနၪ့ၥံၪမံၩ့ၥံၪ ဘဲၫချီအၥိၭတၭ, ဆၧမိဆၧၫ့ထဲၩ့အလး နွ့ၫဘျၩ့လၧ နဖၫ့ခိၪထီးနၥ့ၪယၫ လၧဆၧထီၫထုၬပၧၩ့ဆၧလၧၦၡၩ အဘၩ့အမုးအဖၫ့ခိၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧထီးဒၪၦလၧ အဘၪအၥၭလဂၩဂၩလီၫ.",
			"33": "<sup>33</sup> ဆၧချဲၩ့ဘၪဆဲၫ့လၧစန့ၭဘူၫခၭန့ဇၫနီၪ လၧၫ့ထၪ့ ဎွ့ၩထၪ့ချဲၫ့မၬတၭ, ဆၧနၫ့ထၪ့ခွံၬအဝ့ၫ လၧၦၡၩအ ကျၩတၭ,အၪ့နၪ့ၥံၪမံၩ့ၥံၪဘဲၫချီအၥိၭတၭ, ဘၪစီၪဝ့ၫ လၧမူၭခိၪအဆၩ့ထံၫအကျၩထီးအဆီၪ့ဂဲၫထၪ့ဝ့ၫဘဲၫ လံၬအၥိၭတၭ, အစူၪမံၪခၪ့မံၪထၪ့ဝ့ၫဘဲၫထိၪၥံၪလံၪ ၥံၪအၥိၭနီၪလီၫ.",
			"34": "<sup>34</sup> ဆၧလၧမုနံၩလဖၪအထုၬနီၪ, ယဝ့ၫဒၪ,စန့ၭဘူၫခၭ န့ဇၫ,ယစၪ့ထၪ့ယမ့ၬ လၧမူၭခိၪတၭ, ယၥၭဂဲၫထဲၩ့ ထဲၩ့လၧယဖၧၩ့တၭ, ယဆိၪဂ့ၩ ဆၧထီၫထုၬလဂၩ တၭ,ယစံၭထၪ့အၪ့အူၭတၭ, ယမၩလၩဖၩ့ၦလၧအ မၧၫ့ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလဂၩနီၪလီၫ. အဂဲးဘဲၫယီၩ အပၧၩ့ဆၧအလးနီၪ အီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪတၭ, အ",
			"35": "<sup>35</sup> ဘၩ့အမုးအီၪဝ့ၫ အဆိၩဆိၩအကၠၪကၠၪလီၫ.- အဝ့ၫ အီၪက့ၪကယဲၦဂၪ့ခိၪဖိၪ ထီးအလူၬနီၪ လၧလမွဲဘၪ ဆၧနးမံၩ့တၭ, မၩဝ့ၫထီးဒၪအၥၭ လၧမူၭခိၪအၥုၭမု ခမျၧးအကျၩ,ဒဲလၧၦဂၪ့ခိၪဖိၪအကျၩတၭ, ၦပဒၩ့ထၬ အစူၪမွဲဂ့ၩ,ၦစံၭအဝ့ၫ, နမၩဘဲၫၥ့ၪလဲၪနီၪမွဲဂ့ၩ,ၥ့ၪနး ဂၩအ့ၬ.",
			"36": "<sup>36</sup> ယၥၭနီၪဂဲၫထဲၩ့ထဲၩ့လၧယဖၧၩ့ ချဲၫ့မၬတၭ,ယဘၩ့ မုးအလၩအဖၩ့ ဒဲယကယးကဖး, ဒဲယဎံၫယလၩဂဲၫ ထဲၩ့ထဲၩ့လၧယအီၪတၭ, ယၡၩကိၪ့လိၬအၥၭ, ဒဲယၦ ဒိၪဖၭဒိၪလဖၪနီၪ အၪ့ဎၬထဲၩ့ယၧၩတၭ, ဆၧဒုၭအီၪ ထၪ့ယၧၩလၧယဘၩ့ယမုးအဖၫ့ခိၪတၭ, ဆၧအီၪက့ၪ အၪထၪ့ယကယးကဖးလီၫ.",
			"37": "<sup>37</sup> ဘိၩ့နဲၪ့ယီၩယဝ့ၫဒၪ, စန့ၭဘူၫခၭန့ဇၫယီၩ,ယစံၭ ထၪ့အၪ့အူၭ, ဒဲအီၪက့ၪဒိၪအီၪက့ၪထီၫ, ဒဲမၩလၩဖၩ့ မူၭခိၪအစဎွၩလီၫ. အဆၧမၩထီးအလူၬနီၪ မွဲဆၧမွဲ ဆၧတီၩတၭ, အဖၧၩ့ၥၭလဖၪနီၪမွဲဆၧစ့ၩရၫ့တီၩတၭ, ၦလၧအအီၪက့ၪထၪ့ထီၫအၥၭလဖၪနီၪ, မွဲအဆၪ့လၩ့ အဝ့ၫၥံၪၥ့ၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> စဎွၩဘ့လၡၭဇၫ မၩဆၧအၪ့ဆၧအီၩဖၭဒိၪလၧအ ၦဒိၪဖၭဒိၪလထီၫ့အဂးတၭ, အီၩစဘံၭထံၫလၧၦလ",
			"2": "<sup>2</sup> ထီၫ့နီၪအမ့ၬယၫလီၫ.- စဘ့လၡၭဇၫအီၩစဘံၭထံၫ အဘိၩ့ဘၭနီၪတၭ မၪလူၬၦဂဲၫဆိၬဖၧၩ့ထီၫ့,ဒဲဖၧၩ့စ့ၩ လၧအဖါစန့ၭဘူၫခၭန့ဇၫဆိၬထၪ့ခွံၬ လၧဆၧလုဂံၪ့ လၧယရုစလံၫ့အဖၧၩ့, ဘဲၫၥိၭစဎွၩ, ဒဲအၦဒိၪဖၭဒိၪ, ဒဲအမၫလဖၪ, ဒဲအၥံၪမၫလဖၪ မိအီၩဆၧလၧအဖၧၩ့",
			"3": "<sup>3</sup> လီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪဂဲၫဆိၬဖၧၩ့ထီၫ့လၧၦဆိၬ ထၪ့ခွံၬဝ့ၫလၧယွၩအဆၧလုဂံၪ့ဖၧၩ့ လၧအအီၪဝ့ၫလၧ ယရုစလံၫ့အဖၧၩ့တၭ, စဎွၩ,ဒဲအၦဒိၪဖၭဒိၪလဖၪ, ဒဲအမၫလဖၪ, ဒဲအၥံၪမၫလဖၪ, အီၩဆၧလၧအဖၧၩ့",
			"4": "<sup>4</sup> လီၫ.- အဝ့ၫၥံၪအီၩ စဘံၭထံၫတၭ, စံၭထၪ့အၪ့အူၭ ယွၩထီၫ့ၥံၪ, ဒဲစ့ၩၥံၪ, ထီးၥံၪ, ထၭၥံၪ, ၥံၪ့ၥံၪ ဒဲလိးၥံၪ နီၪလီၫ.",
			"5": "<sup>5</sup> ၦၡၩအစူၪနိၩ့ ဂဲၫထၪ့ချဲၫ့မၬတၭ, ကွ့ၭဆၧဎၩ့လၧ မ့ၪဒိၩ့လၧစဎွၩအနီးအဒီၪ့ လၧအဂုၪအၥၭအလီၩ့ တၭ,စဎွၩဒၪဘၪဆၧအစူၪ လၧအကွ့ၭဆၧအခံၫထိၭ",
			"6": "<sup>6</sup> လီၫ.- ထီးနီၪလဖၧၫ့စဎွၩအမ့ၬလၩ့ၡါ, ဒဲအဆၧဆီၫ့မီၪ့ နီၪမၩခိအၥၭတၭ, အယးဒံၩ့အဆၧၫ့လၩ့ဖျႃၪ, ဒဲအ",
			"7": "<sup>7</sup> ခၪ့လုးခိၪဘၪထံၭလိၬအၥၭလီၫ.- တၭစဎွၩကိၭၡၭ ထၪ့ဘဲၫၥိၭၦမိဂဲၫဆိၬ ၦၥ့ၪဆၧအူၪဆၧပီၩ, ၦခၫလဒံ အၫဖိၪၥံၪ,ဒဲၦယိၡၪၥ့ၪၥံၪလီၫ. စဎွၩချဲၩ့ထၪ့ဝ့ၫတၭ, စံၭဘၭဘလၧၫ့ အၡၩကိၪ့ဆၧၥ့ၪလဖၪ, ထီးဒၪၦလၧ အမိဖီဆၧကွ့ၭအၥၭယီၩတၭ, ဒုၭနဲၪယၧၩလၧအခီၫ ပယီၫလဂၩဂၩနီၪ, ယမိဒုၭကီၩ့အဝ့ၫလၧဆၧလုၭဖုၭ တၭ,ဒုၭလံၬၥွ့ၫထီၫ့ လၧအခိၬလဝၫ့လီၫ. တၭမိကဲၪ ထၪ့ၦပၧၩ့ဆၧ လၧယဘၩ့ယမုးအဖၧၩ့ ၥၧၫ့ဂၩလဂၩ",
			"8": "<sup>8</sup> လီၫ.- ထီးနီၪလဖၧၫ့စဎွၩအၡၩကိၪ့ဆၧၥ့ၪထီးအလူၬ ဂဲၫဝ့ၫး မွဲလါနၫ့ဘိၩ, ဖီဆၧကွ့ၭအၥၭတၭ, ဒုၭၥ့ၪယၫ",
			"9": "<sup>9</sup> စဎွၩလၧအခီၫပယီၫၥ့ၪနးဂၩအ့ၬ.- ထီးနီၪလဖၧၫ့စဎွၩ ဘ့လၡၭဇၫအၥုၪ့ခိအၥၭဝီၩဒိၪမၬတၭ, အမ့ၬလၩ့ၡါ ဝ့ၫတၭ,အၦဒိၪဖၭဒိၪလဖၪ အၥၭထီၫမံၫထီၫမၪဝ့ၫ လီၫ.",
			"10": "<sup>10</sup> နးဎွၩမုၪဂဲၫဝ့ၫ လၧဆၧအၪ့ဆၧအီၩအဂံၪ့ဖၧၩ့လၧ စဎွၩဒဲအၦဒိၪဖၭဒိၪၥံၪ အလူအကၠီၩ့လီၫ. နးဎွၩမုၪ ချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, စဎွၩဧ့, မွဲနမၧၫ့လၩ့ဆိၩလၩ့ ကၠၪဆံၭ. မွဲနဆၧဆီၫ့မီၪ့ၥံၪနီၪထီးမၩခိနၥၭလဂ့ၩ, မွဲန",
			"11": "<sup>11</sup> မ့ၬထီးလၩ့ၡါလဂ့ၩ.- လၧနဘၩ့နမုးအဖၧၩ့နီၪၦလၧ ယွၩဆံၫ့ဎံၪလဖၪ အၥၭအီၪ လၧအဖၧၩ့နီၪအီၪဝ့ၫလ ဂၩတၭ, လၧနဖါအမုနံၩလဖၪနီၪဆၧဖၩ့, ဆၧကိၪ့ဆၧ ဆၭ, ဒဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ, ဘဲၫယွၩလဖၪအဆၧကိၪ့ ၥ့ၪကိၪ့ဘၪအၥိၭနီၪ အီၪဝ့ၫလၧအဖၧၩ့လီၫ. တၭနဖါ စဎွၩန့ၭဘူၫခၭန့ဇၫ, နဖါဒၪလ့ၬအီၪက့ၪဝ့ၫလၧၦကွ့ၭ လံၬၥံၪ,ၦၥ့ၪဆၧအူၪဆၧပီၩၥံၪ, ၦခၫလဒံအၫဖိၪၥံၪ,",
			"12": "<sup>12</sup> ၦယိၡၪၥ့ၪၥံၪအခိၪ,စဎွၩဧ့,- မွဲအၥၭၥ့ၪဆၧဂ့ၩတၭ, ဆၧၥ့ၪယၫ, ဒဲဆၧကိၪ့ဆၧဆၭ ဘဲၫၥိၭအမိဖၭဆၧမံၫ မး,ဒဲဆၧၡီၩ့ၡါ,ဒဲဒုၭနဲၪဆၧချဲၩ့ ကၪအခီၫပယီၫနီၪအီၪ ဝ့ၫလၧစဒၫ့နအ့လၭအဖၧၩ့, လၧစဎွၩဖျိၬအမံၩ့စဘ့ၫ လၭတၡၭဇၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, မွဲၦကိၭန့စဒၫ့နအ့လၭဆံၭ. တၭအဝ့ၫဒၪမိဖၭဆၧအ ခီၫပယီၫလီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ ၦဂဲၫဆိၬစဒၫ့နအ့လၭလၧစဎွၩအမ့ၬ ယၫလီၫ. စဎွၩချဲၩ့ထၪ့ဆၧတၭ, စံၭစဒၫ့နအ့လၭ,နမွဲ စဒၫ့နအ့လၭလၧၦယုဒၫဖိၪ လၧအကဲၪဎီးလၧယဖါဂဲၫ",
			"14": "<sup>14</sup> ဆိၬလၧခးယုဒၫအဖၧၩ့လဖၪအကျၩနီၪဆ့ဧၪ.- ယနါ ဂၧၫ့ဆၧလၧနဂဲးလၧယွၩလဖၪ အၥၭအီၪဝ့ၫလၧနဖၧၩ့ တၭ,ဆၧဖၩ့,ဒဲဆၧကိၪ့ဆၧဆၭ, ဒဲဆၧကိၪ့ၥ့ၪအၪအၪ",
			"15": "<sup>15</sup> လ့ၬအီၪဝ့ၫလၧနဖၧၩ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩၦဂဲၫဆိၬ ၦကိၪ့ဆၧၥ့ၪ, ၦၥ့ၪဆၧအူၪဆၧပီၩလၧယမ့ၬယၫ, ဘဲၫ ၥိၭအမိဖီဆၧကွ့ၭအၥၭယီၩ, ဒဲဒုၭၥ့ၪယၫယၧၩလၧအ ခီၫပယီၫဆ့လီၫ. မွဲလါနၫ့တၭ, ဒုၭနဲၪဆၧလမံၩ့ယီၩ",
			"16": "<sup>16</sup> အခီၫပယီၫၥ့ၪအ့ၬ.- ယနါဂၧၫ့လၧနဂဲးလၧနဖၭန့ဆၧ ၥ့ၪ,ဒဲဒုၭနဲၪဆၧချဲၩ့ကၪ အခီၫပယီၫၥ့ၪလီၫ. ဘိၩ့နဲၪ့ ယီၩနဖီဆၧကွ့ၭအၥၭယီၩတၭ, ဒုၭၥ့ၪယၫယၧၩလၧ အခီၫပယီၫအၪၥ့ၪတၭ, ယမိဒုၭကီၩ့ဒုၭၥိၭနၧၩလၧ ဆၧလုၭဖုၭတၭ, ဒုၭလံၬၥွ့ၫထီၫ့လၧနခိၬနးဝၫ့တၭ, နမိ ကဲၪထၪ့ၦပၧၩ့ဆၧလၧယဘၩ့ယမုးအဖၧၩ့ ၥၧၫ့ဂၩလ ဂၩလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့စဒၫ့နအ့လၭ စံၭဆၧၫ့ဆၧတၭ,စံၭဆၧ လၧစဎွၩအမ့ၬယၫ, မွဲနဆၧဖ့ၪလၫ့လဖၪအီၪဝ့ၫလၧနနၫ့ ဆါဒၪနဝ့ၫဆံၭ. တၭမွဲနဖ့ၪလၫ့နလံၩ့နလဲၫလဖၪလၧၦ ဂူၫဂၩဆံၭ. မွဲလါနၫ့တၭ, ယမိဖီဘၪဒဲဖ့ၪနဲၪစဎွၩလၧ ဆၧကွ့ၭအၥၭတၭ, မိဒုၭၥ့ၪယၫဝ့ၫလၧအခီၫပယီၫဆ့",
			"18": "<sup>18</sup> လီၫ.- နဝ့ၫဒၪယီၩစဎွၩဧ့, ယွၩအထီၫထုၬဖ့ၪလၫ့နဖါ စန့ၭဘူၫခၭန့ဇၫ လၧဘၩ့ၥံၪမုးၥံၪ, လၧဆၧအဒိၪအ",
			"19": "<sup>19</sup> ထီၫဒဲဆၧလၩဖၩ့, လၧဆၧအကယးကဖးလီၫ.- လၧ ဆၧကယးကဖး လၧဆၧဖ့ၪလၫ့အဝ့ၫအကၠီၩ့နီၪတၭ, ကယဲၦခမျၧးၦဆၨၩလဖၪ, ဒဲၦချဲၩ့ဆၧအလၨကိၭ ဆၨၩဒ့ၭထီးအလူၬနီၪဝၭထိၬဝ့ၫတၭ, ၥၭမဲၪဆၧလၧ အမ့ၬယၫလီၫ. ထီးဒၪအၥၭတၭ, မၩၥံၫၦလဂၩဂၩ တၭ,ထီးဒၪအၥၭတၭ, ဒုၭမၧၫ့ၦလဂၩဂၩ, ထီးဒၪအ ၥၭတၭ,အီၪက့ၪထၪ့ထီၫၦလဂၩဂၩတၭ, ထီးဒၪအ",
			"20": "<sup>20</sup> ၥၭတၭဆၪ့လၩ့ၦလဂၩဂၩလီၫ.- အ့ၪမွဲထီးအအီၪက့ၪ ထၪ့ထီၫအၥၭတၭ, အၥၭနီၩ့လၧအအီၪက့ၪဖိၪလိၫအ ၥၭအကၠီၩ့တၭ, ဆၧခွံၬလၩ့ခွံၬဝ့ၫ လၧအစဎွၩအလး",
			"21": "<sup>21</sup> ဆီၩ့ဆီတၭ, ဆၧထုၭထၪ့ခွံၬအလၩအဖၩ့,- တၭဆၧ နၫ့ထၪ့ခွံၬအဝ့ၫလၧၦၡၩအကျၩတၭ, ဆၧဒုၭကဲၪထၪ့ အၥၭဘဲၫဆၧဖိၪဆၧဎါအၥိၭ, အအီၪအလးအီၪဝ့ၫလၧ ကၥ့ၪယီၩ့အမံၩ့အကျၩလီၫ. တၭၦဒုၭအၪ့အဝ့ၫလၧ နၪ့ၥံၪမံၩ့ၥံၪဘဲၫချီအၥိၭတၭ, ဘၪစီၪဝ့ၫလၧမူၭခိၪအ ဆၩ့ထံၫအကျၩထီးအၥ့ၪယၫ လၧယွၩဆၧထီၫထုၬလ ဂၩပၧၩ့ဆၧလၧၦၡၩအဘၩ့အမုးအဖၫ့ခိၪ ဒဲအီၪက့ၪ ဝ့ၫလၧအဖၫ့ခိၪ ထီးဒၪၦလၧအဘၪအၥၭ လဂၩဂၩ",
			"22": "<sup>22</sup> လီၫ.- နဝ့ၫဒၪအဖိၪခွၫစဘ့လၡၭဇၫဧ့, နၥ့ၪယၫဆၧ",
			"23": "<sup>23</sup> ယီၩထီးအလူၬလါနၫ့တၭ, နဆၪ့လၩ့နၥၭအ့ၬ.- အ့ၪမွဲ နအီၪက့ၪထၪ့ထီၫနၥၭ လၧမူၭခိၪအယွၩအဖၫ့ခိၪတၭ, ၦဂဲၫဆိၬအဂံၪ့အဆၧဖၧၩ့လဖၪ လၧနမ့ၬယၫတၭ,နဝ့ၫ ဒၪ,ဒဲနၦဒိၪလဖၪ, နမၫလဖၪ,ဒဲနၥံၪမၫလဖၪနီၪအီၩ စဘံၭထံၫလၧအဖၧၩ့တၭ, နစံၭထၪ့အၪ့အူၭယွၩစ့ၩ ၥံၪ,ထီၫ့ၥံၪ,ထီးၥံၪ, ထၭၥံၪ, ၥံၪ့ၥံၪ ဒဲလိးၥံၪ, လၧအ လဒၪဘၪဆၧ, ဒဲလနါဂၧၫ့ဘၪဆၧ, ဒဲအလၥ့ၪယၫဘၪ ဆၧလီၫ. အ့ၪမွဲယွၩလၧနၥၪအီၪဝ့ၫ လၧအစူၪဖၧၩ့တၭ, နဖၧၩ့ၥၭထီးအလူၬအီၪဝ့ၫလၧအဝ့ၫလဂၩနီၪ နမၩလၩ ဖၩ့အဝ့ၫအ့ၬ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအၪ့မၧၫ့လၩ့စူၪလခီၫအ",
			"25": "<sup>25</sup> ခံၫထိၭနီၪတၭ, ဆၧကွ့ၭအၥၭယီၩ,- တၭအယီၩမွဲဆၧ ကွ့ၭလၧအကွ့ၭအၥၭ,",
			"26": "<sup>26</sup> မံၫန့ၫ, မံၫန့ၫ, တက့လၭ, အူဖၫစံၫ့, အယီၩမွဲဆၧအခီၫပယီၫ. မံၫန့ၫ, ဘဲၫၦစံၭဆၧအၥိၭ, ယွၩနီၪဝံထၪ့နၬထၪ့ယူၭ နဘၩ့နမုးတၭမၩလူၬခွံၬဝ့ၫလီၫ.",
			"27": "<sup>27</sup> တက့လၭ, ဘဲၫၦစံၭဆၧအၥိၭ, ဆၧခံၫ့နၧၩ လၧခံၫ့ ဖၧၩ့တၭ, နလလၧၫ့လဎွ့ၩဘၪလီၫ.",
			"28": "<sup>28</sup> ပံၫရံၫ, ဘဲၫၦစံၭဆၧအၥိၭ, နဘၩ့နမုးလၩ့ဖၭလိၬ အၥၭတၭ, ဆၧဖ့ၪလၫ့အဝ့ၫလၧၦမံဒအၫဖိၪ, ဒဲၦပၧၡၫ ဖိၪလီၫ.",
			"29": "<sup>29</sup> ထီးနီၪလဖၧၫ့ စဘ့လၡၭဇၫ မၪလူၬဆၧတၭ,ၦဒုၭ ကီၩ့ဒုၭၥိၭ စဒၫ့နအ့လၭလၧဆၧလုၭဖုၭတၭ, ဒုၭလံၬ ၥွ့ၫထီၫ့လၧအခိၬလဝၫ့တၭ, ၦကိၭထၪ့ဝ့ၫလၧအဂဲး လၧအမိကဲၪထၪ့ၦပၧၩ့ဆၧၥၧၫ့ဂၩလဂၩ လၧဘၩ့မုး အဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> ဆၧလၧမုလနၩနီၪ ဆၧမၩၥံၫၦခၫလဒံအၫဖိၪၥံၪအ",
			"31": "<sup>31</sup> စဎွၩဘ့လၡၭဇၫလီၫ.- တၭၦမံဒအၫဖိၪစဒရဲအၧၭအ ၥၭၡါအနံၪ့ဎူၫဆံၫနံၫနံၪ့တၭ, မၩန့ဘၩ့ၥံၪမုးၥံၪလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ဘၪစဒရဲအၧၭအၥၭတၭ, အီၪက့ၪၦဒိၪဖၭဒိၪလယၩ နံၫဆံၫလၧဘၩ့ၥံၪမုးၥံၪအဖၫ့ခိၪ, ဘဲၫၥိၭအမိအီၪဝ့ၫ",
			"2": "<sup>2</sup> လၧအဘၩ့အမုးထၧၫ့ဘံၪ့ယၫအဖၫ့ခိၪလီၫ.- အီၪက့ၪ ၦအခိၪၥၧၫ့ဂၩ လၧအဝ့ၫၥံၪအဖၫ့ခိၪတၭ, စဒၫ့နအ့လၭ မွဲၦလၧအကျၩလဂၩ, ဘဲၫၥိၭၦဒိၪလဖၪနီၪမိဖ့ၪလံၬ",
			"3": "<sup>3</sup> လၧအဝ့ၫၥံၪ,ဒဲစဎွၩအဆၧထီးလၩ့မါလဂ့ၩလီၫ.- ထီး နီၪလဖၧၫ့ဆၧအီၪက့ၪစဒၫ့နအ့လၭလဂၩနီၪ လၧၦအ ခိၪလဖၪ, ဒဲၦဒိၪဖၭဒိၪလဖၪအဖၫ့ခိၪလၧအၥၭဂ့ၩလၧ အအီၪဝ့ၫလၧအဖၧၩ့အကၠီၩ့တၭ, စဎွၩမိအီၪက့ၪဝ့ၫ လၧဘၩ့မုးထၧၫ့ဘံၪ့ယၫအဖၫ့ခိၪလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ၦအခိၪလဖၪ, ဒဲၦဒိၪဖၭဒိၪလဖၪအၪ့ ဎၬအလးထၫ့ဒၩ စဒၫ့နအ့လၭ လၧဘၩ့မုးအဂဲးလါနၫ့ တၭ,လဒၪန့ဘၪအလးနးမံၩ့, ဒၪန့ဆၧမၪဆ့အ့ၬ. အ ဂဲးဘဲၫယီၩ ဘဲၫအမၩဝ့ၫတီၩတီၩလီၩ့လီၩ့အၥိၭတၭ, ဆၧမၪမွဲဂ့ၩ, မၩဆၧလတီၩဘၪလမံၩ့မံၩ့မွဲဂ့ၩ, အီၪ",
			"5": "<sup>5</sup> လၧအလီၩ့အ့ၬ.- ထီးနီၪလဖၧၫ့ ၦၡၩလဖၪနီၪစံၭဝ့ၫ ဒၪ,အ့ၪလမွဲဘၪလၧဆၧဘၪဆဲၫ့လၧ အယွၩအဆၧၥီၪ့ ဆၧၥၫ့တၭ, ပဒၪန့ဆၧအလးထၫ့ဒၩ စဒၫ့နအ့လၭလ ဂၩယီၩအ့ၬ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ ၦအခိၪလဖၪ, ဒဲၦဒိၪဖၭဒိၪလဖၪနီၪ အီၪကိၩ့အီၪကီၪ့လၧစဎွၩအအီၪတၭ, စံၭဝ့ၫဘဲၫယီၩ,",
			"7": "<sup>7</sup> စဎွၩဒရဲအၧၭဧ့, မွဲနမၧၫ့လၩ့ဆိၩလၩ့ကၠၪဆံၭ.- ကယဲ ဘၩ့မုးအခိၪ, ဒဲၦဒိၪဖၭဒိၪ, ၦဒိၪၦၡါ, စဎွၩအၡၩဒုၭ ကိၪ့ဆၧ,ဒဲၦပၧၩ့ဆၧထီးအလူၬနီၪ ကိၪ့လိၬအၥၭဘဲၫ ၥိၭဆၧအလူမိလၩ့လၧစဎွၩတၭ, ဆၧၥီၪ့ဆၧၥၫ့မိအီၪ ဂုးခၧၫ့လထံၪယီၩ, အ့ၪလမွဲဘၪလၧနၧၩတၭ, ထီးဒၪၦ လၧအအၪ့ကံၩ့ဆၧလၧယွၩမွဲဂ့ၩ, လၧၦၡၩမွဲဂ့ၩ,အနံၩ ၥၧၫ့ဆံၫအထးဖၧၩ့လဂၩဂၩနီၪ, မိဘၪဆၧခွံၬလၩ့ခွံၬ",
			"8": "<sup>8</sup> ဝ့ၫလၧဆၬလၥၧၫ့အဖၧၩ့လီၫ.- ဘိၩ့နဲၪ့ယီၩစဎွၩဧ့, ဒုၭအီၪထၪ့နဆၧမၪလူၬတၭ, ဒုၭကွ့ၭလံၬ,လၧဆၧမၩ ကဒံၩကဒၩဝ့ၫလၥ့ၪဘၪ, ဘဲၫၦမံဒအၫဖိၪဒဲၦပၧၡၫဖိၪ လဖၪအဆၧၥီၪ့ဆၧၥၫ့အၥိၭ လၧအကဒံၩကဒၩလၥ့ၪ",
			"9": "<sup>9</sup> ဘၪနီၪဆံၭ.- မၩအၥၭဘဲၫနီၪတၭ, စဎွၩဒရဲအၧၭဒုၭ ကွ့ၭလံၬနီၪတၭ, ဒုၭအီၪထၪ့ဆၧမၪလူၬနီၪလီၫ.",
			"10": "<sup>10</sup> ထီးစဒၫ့နအ့လၭၥ့ၪယၫဝ့ၫ လၧဆၧကွ့ၭအၥၭဂီၩ့ တၭ,လ့ၩနုၬလၧအဂံၪ့ဖၧၩ့တၭ, အတရၫ့လံၩၥံၪအီၪဝဲ ထၪ့အၥၭလၧအဒူၭထၪ့ထီၫလဆၫ့ ဖိးထၪ့ဝ့ၫလၧယရု စလံၫ့လခီၫတၭ, အဝ့ၫချံၭလၩ့အခၪ့လနံၩၥၧၫ့ဖၧၫ့တၭ, အၪ့ကံၩ့ဘၩဆိၪဖၪဆၧတၭ, စံၭထၪ့အၪ့အူၭဆၧအခိး အတၩလၧအယွၩအမ့ၬယၫ ဘဲၫအမၩဝ့ၫလၧအခၪ့ ထံၭအၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့ ၦလဖၪနီၪအီၪကိၩ့အီၪကီၪ့တၭ,ဒၪန့ စဒၫ့နအ့လၭဘၩဆိၪဖၪဆၧ, ဒဲအၪ့ကံၩ့ဆၧလၧအယွၩ",
			"12": "<sup>12</sup> အမ့ၬယၫလီၫ.- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪၥုၭဘူၭအၥၭ တၭ,ချဲၩ့ဆၧလၧစဎွၩအမ့ၬယၫ လၧစဎွၩအဆၧမၪလူၬ အဂဲး နကွ့ၭဆၧမၪလူၬနီၪ, အ့ၪလမွဲဘၪလၧနၧၩတၭ, ထီးဒၪၦလၧအအၪ့ကံၩ့ဆၧလၧယွၩ လဂၩဂၩမွဲဂ့ၩ, လၧၦၡၩလဂၩဂၩမွဲဂ့ၩ, လၧအနံၩၥၧၫ့ဆံၫအထး ဖၧၩ့နီၪမိဘၪဆၧခွံၬလၩ့ခွံၬအဝ့ၫ လၧဆၬလၥၧၫ့အ ဖၧၩ့,မွဲအ့ၬဧၪ, စဎွၩဧ့. တၭစဎွၩစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ဆၧနီၪအီၪဂုးခၧၫ့ယူၭ ဘဲၫၦမံဒအၫဖိၪ, ဒဲၦ ပၧၡၫဖိၪလဖၪအဆၧၥီၪ့ဆၧၥၫ့အၥိၭ လၧအကဒံၩက",
			"13": "<sup>13</sup> ဒၩလၥ့ၪဘၪလီၫ.- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪစံၭဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫလၧစဎွၩအမ့ၬယၫ, စဒၫ့နအ့လၭလၧအ အီၪဝ့ၫလၧၦယုဒၫဖိၪၥံၪ လၧအကဲၪဎီးအကျၩလဂၩ နီၪ,လဒူၩလယၪ့ဘၪနၧၩ, ဒဲဆၧမၪလူၬလၧနကွ့ၭယူၭ နီၪ,စဎွၩဧ့, မွဲအအၪ့ကံၩ့အၪ့ယၫ ဆၧလၧလနံၩဘၪ လနံၩလနံၩဘၪလနံၩၥၧၫ့ဖၧၫ့လီၫ.",
			"14": "<sup>14</sup> ထီးစဎွၩနါဂၧၫ့ဆၧချဲၩ့ၥံၪနီၪတၭ, အၥုၪ့ခိအၥၭဝီၩ လၧအကၠီၩ့တၭ, ၥၭအီၪစဒၫ့နအ့လၭ ဘဲၫၥိၭအမိမၩ ဖီၩ့မၩဖျ့ၭအဝ့ၫတၭ, ကိၪ့ဝ့ၫထီးမုလၩ့နုၬဘဲၫၥိၭအမိ",
			"15": "<sup>15</sup> မၩဖီၩ့မၩဖျ့ၭအဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ၦလဖၪနီၪအီၪ ကိၩ့အီၪကီၪ့လၧစဎွၩအအီၪတၭ, စံၭစဎွၩ,စဎွၩဧ့,ၥ့ၪ ယၫလၧၦမံဒအၫဖိၪဒဲၦပၧၡၫဖိၪလဖၪ အီၪလၧဆၧၥီၪ့ ဆၧၥၫ့လထံၪ, လၧဆၧမၪလူၬမွဲဂ့ၩဆၧၥီၪ့ဆၧၥၫ့မွဲဂ့ၩ လၧစဎွၩဒုၭအီၪထၪ့ဝ့ၫနီၪ ဆၧမၩကဒံၩကဒၩဘၪဝ့ၫ",
			"16": "<sup>16</sup> နးထံၪအ့ၬ.- စဎွၩမၪလူၬဝ့ၫတၭ, ၦဂဲၫဆိၬစဒၫ့နအ့ လၭတၭ, ခွံၬလၩ့ခွံၬအဝ့ၫလၧဆၬလၥၧၫ့အဖၧၩ့လီၫ. စဎွၩချဲၩ့ဆၧတၭ, စံၭစဒၫ့နအ့လၭ, နယွၩလၧနမၩအ ဆၧမၩလထံၪဎးလဘီၩ့ဎးလဂၩနီၪ, အဝ့ၫဒၪမိမၩဖီၩ့",
			"17": "<sup>17</sup> မၩဖျ့ၭနၧၩလီၫ.- ၦဂဲၫဆိၬလိးလဖျိၪ့တၭ, အီၪက့ၪဝ့ၫ လၧဆၧဖၧၩ့အခိၪထိၭတၭ, စဎွၩစဲၩနဲၪ့ထၬဝ့ၫလၧအ ဆၧစဲၩနဲၪ့ဝ့ၫ, ဒဲအၦဒိၪဖၭဒိၪလဖၪအဆၧစဲၩနဲၪ့ဘဲၫၥိၭ ဆၧကိၪ့ဝ့ၫလၧစဒၫ့နအ့လၭအဂဲး ထီးကဒံၩကဒၩနး",
			"18": "<sup>18</sup> မံၩ့လဂ့ၩလီၫ.- ထီးနီၪလဖၧၫ့စဎွၩလ့ၩဝ့ၫလၧအနီးဖၧၩ့ တၭ, ဒုၪဆၧအၪ့ဆၧအီၩၥၫ့နၩချီၩ့တၭ, ၦလဂဲၫဆိၬ ဘၪအၥံၪမၫလဖၪလၧအအီၪတၭ, မံၫဝ့ၫလန့ဘၪ လီၫ.",
			"19": "<sup>19</sup> စဎွၩဂဲထုၪ့ဂီၩဂီၩလ့ၬတၭ, လ့ၩဝ့ၫချဲၫ့ချဲၫ့လ့ၬလၧ",
			"20": "<sup>20</sup> ဆၬလၥၧၫ့အဖၧၩ့လီၫ.- တၭထီးအအီၪဘူၭလၧဆၧ ဖၧၩ့တၭ,ကိၭထၪ့ဆၧလၧအလူဖၭဒိၪ လၧစဒၫ့နအ့လၭ အအီၪလီၫ. စဎွၩချဲၩ့ဆၧတၭ, စံၭစဒၫ့နအ့လၭ, ယွၩ လၧအမၧၫ့ဝ့ၫလဂၩ, အခ့ၫအၡၩစဒၫ့နအ့လၭဧ့,နယွၩ လၧနမၩအဆၧလထံၪဎးနီၪ မၩဖီၩ့မၩဖျ့ၭနၧၩလၧဆၬ",
			"21": "<sup>21</sup> လၥၧၫ့လဖၪၥ့ၪယူၭဧၪ.- ထီးနီၪလဖၧၫ့စဒၫ့နအ့လၭ,",
			"22": "<sup>22</sup> စံၭစဎွၩ,စဎွၩဧ့,မွဲနမၧၫ့လၩ့ဆိၩလၩ့ကၠၪဆံၭ.- ယယွၩ အၪ့မၧၫ့လၩ့အၥီၫ့လဂၩတၭ, မၩဘံၭဆၬလၥၧၫ့အနိၭ တၭ,အဝ့ၫၥံၪမၩအၧၩ့ဘၪယၧၩနးမံၩ့အ့ၬ. အဂဲးဘဲၫ ယီၩဆၧဒဲၩဘၭလအီၪဘၪလၧယလီၩ့ လၧအမ့ၬယၫ တၭ,စဎွၩဧ့, ယမၩဆၧအၧၩ့ လၧနမ့ၬယၫနးမံၩ့ဆ့",
			"23": "<sup>23</sup> အ့ၬ.- ထီးနီၪလဖၧၫ့ စဎွၩၥၭထိၬလၧအၥၭခံဖၧၩ့တၭ, မၪလူၬဝ့ၫလၧၦမိထုၭထၪ့န့ထဲၩ့ စဒၫ့နအ့လၭလၧဆၧ ဖၧၩ့လီၫ. မွဲအထုၭထၪ့န့ထဲၩ့စဒၫ့နအ့လၭ လၧဆၧဖၧၩ့ တၭ,ဆၧမၩအၧၩ့အဝ့ၫလအီၪဘၪ လၧအလီၩ့နးမံၩ့, အဂဲးဘဲၫယီၩ မွဲအဒိၭနဲၩ့အၥၭလၧယွၩလီၫ.",
			"24": "<sup>24</sup> တၭစဎွၩမၪလူၬဆၧတၭ, အဝ့ၫၥံၪဂဲၫဆိၬၦၡၩလဖၪ လၧအအီၪက့ၪဆၧမၪ လၧစဒၫ့နအ့လၭအလီၩ့တၭ, ခွံၬလၩ့ခွံၬအဝ့ၫၥံၪ လၧဆၬလၥၧၫ့အဖၧၩ့, အဝ့ၫၥံၪ အဖိၪအလံၩ, ဒဲအဖိၪအမၫတၭ, လၧအလချႃၭထီၩ့ လၩ့ဒံၭဘၪလၧဆၧဖၧၩ့အခဲၫ့ဒၭတၭ, ဆၬလၥၧၫ့မၩ နၧၩ့မၩစၪအဝ့ၫၥံၪတၭ, မၩခါလၩ့ဘျ့ၭအဎွံၪအနၧၩ့ ထီးအလူၬလီၫ.",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့စဎွၩဒရဲအၧၭ ကွ့ၭန့ကယဲၦခမျၧးလ ဖၪ,ၦဆၨၩလဖၪ, ဒဲၦချဲၩ့ဆၧအလၨကိၭဆၨၩဒ့ၭလၧ အအီၪဝ့ၫလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ, မွဲဆၧဘၪလိၬအိၭ",
			"26": "<sup>26</sup> လိၬအၪထၪ့လၧနၥံၪအဂးဆံၭ.- ယမၪလူၬဆၧလၧၦ ဘၪဝၭထိၬဝ့ၫ, ဒဲၥၭမဲၪဝ့ၫ လၧစဒၫ့နအ့လၭအယွၩအ မ့ၬယၫလၧကယဲထံၫၥံၪခးၥံၪ လၧယဘၩ့ယမုးအဖၧၩ့ ထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩမွဲယွၩလၧအမၧၫ့ဝ့ၫတၭ, အီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪတၭ, အဘၩ့အမုးလထီၩ့ဘၪ",
			"27": "<sup>27</sup> လၧဆၧဂၭဂီၩ့တၭ, မိပၧၩ့ဝ့ၫထီးအထုၬလီၫ.- အဝ့ၫနီၪ ထိးထဲၩ့တၩ့ထဲၩ့ဆၧ, ဒဲမၩဖီၩ့မၩဖျ့ၭဆၧ, ဒဲမၩဆၧ နဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭလၧမူၭခိၪ, ဒဲလၧဂၪ့ ခိၪချိၫ့တၭ, မၩဖီၩ့မၩဖျ့ၭယူၭစဒၫ့နအ့လၭလၧဆၬလ ၥၧၫ့အစီၩ့အမၩ့ယူၭလီၫ.",
			"28": "<sup>28</sup> တၭစဒၫ့နအ့လၭလဂၩနီၪ ဘီၪထၪ့ယီၫထၪ့လၧစဒ ရဲအၧၭကဲၪစဎွၩအဘိၩ့ဘၭ, ဒဲလၧၦပၧၡၫဖိၪ စစဲရၧၭ ကဲၪစဎွၩအဘိၩ့ဘၭနီၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ဘၭဘလၧၫ့အစဎွၩဘ့လၡၭဇၫ အခၪ့ထံၭလနံၪ့နီၪ, စဒၫ့နအ့လၭအီၪလၧဆၧမံၫမး, ဒဲအခိၪဎွံၪဒၪဆၧလၧ ယၫလခီၫ လၧအလးမံၫဖၧၩ့လီၫ. ထီးနီၪလဖၧၫ့ကွ့ၭ လၩ့ဆၧမံၫမးတၭ, လီၩဘၪဆၧချဲၩ့အမိၡါလီၫ.",
			"2": "<sup>2</sup> စဒၫ့နအ့လၭချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ယယိထံၫဆၧ လၧယဒၪဆၧလၧယၫ လၧမုနၩလခီၫအဘိၩ့ဘၭတၭ, ယိခွါ,မူၭခိၪအလံၩလံခီၫ ဘုၪ့ဖိးဆၧလၧမၫဆမံၭဖၭ",
			"3": "<sup>3</sup> ဒိၪအဖၫ့ခိၪလီၫ.- တၭဆၧဖိၪဆၧဎါဖၭဒိၪလံဒုၩ ဂဲၫ ထၪ့လၧမၫဆမံၭဖၧၩ့, လၩ့မဲၩလိၬအၥၭလဒုၩဒဲလဒုၩ",
			"4": "<sup>4</sup> လီၫ.- အခၪ့ထံၭလဒုၩမၩအၥၭဘဲၫဆၬလၥၧၫ့အၥိၭ, အီၪဝ့ၫလၧလၫ့ကထၬအဒံၭလီၫ. တၭယယိထံၫထီး ဆၧထ့ၭထၪ့ခွံၬအဒံၭတၭ, ဆၧဒုၭထၪ့အဝ့ၫလၧဂၪ့ခိၪ အဖၫ့ခိၪတၭ, ဆၧဒုၭဆၧၫ့ထုၪ့အဝ့ၫလၧအခၪ့ဘဲၫၦ",
			"5": "<sup>5</sup> ၡၩအၥိၭတၭ, ဆၧဖ့ၪလၫ့ဝ့ၫလၧၦၡၩအၥၭလီၫ.- တၭ ယိခွါ,ဆၧဖိၪဆၧဎါအဂူၫဂၩနံၫဒုၩလဒုၩ, မၩအၥၭ ဘဲၫဖုၫထၫ့အၥိၭနီၪ, ဆိၬထၪ့အၥၭလၧလခီၫဖၩတၭ, အီၪဝ့ၫလၧဆၧဂုၬဎွံၪၥၧၫ့ဘီၩ့လၧအနိၭဖၧၩ့လၧအၥွၫ အဘိၩ့ဆၧၩ့တၭ, ဆၧစံၭအဝ့ၫဘဲၫယီၩ, ဂဲထုၪ့အၪ့ဆၧ",
			"6": "<sup>6</sup> ယၪအၪဆံၭ.- လၧအလးခဲၫ့နီၪ ယယိထံၫဆၧတၭ, ယိခွါ,အဂူၫဂၩလဒုၩမၩအၥၭဘဲၫခ့ၫစံၫဖီးအၥိၭနီၪ တၭ,အီၪဝ့ၫလၧထိၪအဒံၭလံဘံၪ့ လၧအချိၫ့ခိၪတၭ, အီၪဝ့ၫလၧအခိၪဎွံၪလံဖျိၪ့တၭ, ဆၧဖ့ၪလၫ့အဝ့ၫလၧ",
			"7": "<sup>7</sup> အဘၩ့အမုးလီၫ.- လၧဆၧအလးခဲၫ့နီၪယယိထံၫဆၧ လၧဆၧဒၪလၧယၫလၧမုနၩလခီၫတၭ, ယိခွါ,ဆၧဖိၪ ဆၧဎါလံဒုၩလဒုၩ, ဆၧမၩၥၭမဲၪဆၧအလးတၭ,ဆီၪ့ ဝ့ၫတၭ,အဂဲးဆီၪ့အဘၭဆီၪ့ဝ့ၫဒိၪဒိၪလ့ၬတၭ, အီၪ ဝ့ၫလၧအၥွၫထၭဖၭဒိၪလဖၪလီၫ. အၪ့ဆၧတၭ,မၩ ခါလၩ့ဘျ့ၭဆၧတၭ, ယဲးထဲးဆၧအီၪလၩ့ထးလၧအ ခၪ့တၭ,လၩ့မဲၩဝ့ၫလၧကယဲဆၧဖိၪဆၧဎါ လၧအအီၪ ဝ့ၫလၧအမ့ၬယၫထီးအလူၬတၭ, အီၪလၧအနိၩ့ဆံၫ",
			"8": "<sup>8</sup> ဘီၩ့လီၫ.- ယယိဆီၫ့မီၪ့အနိၩ့လဖၪတၭ, ယိခွါ,အနိၩ့ ဖိၪအဂူၫဂၩလဘီၩ့ထၪ့ဝ့ၫလၧအကျၩတၭ, လၧအနိၩ့ လၧအခၪ့ထံၭလဖၪအကျၩနီၪ, နိၩ့ၥၧၫ့ဘီၩ့ဘၪဆၧထ့ၭ ထၪ့ခွံၬဝ့ၫလၧနိၩ့ဖိၪအမ့ၬယၫလီၫ. တၭယိခွါ,အမ့ၬ ၥၪဘဲၫၦၡၩအမ့ၬၥၪအၥိၭ, ဒဲအနိၭလၧအချဲၩ့ဆၧဖၭ ဒိၪလဖၪအီၪဝ့ၫလၧနိၩ့လဘီၩ့နီၪအလီၩ့လီၫ.",
			"9": "<sup>9</sup> ယယိဒံၭဆၧထီး ဆၧအီၪက့ၪလၩ့လးဆီၩ့ဆီလ ဖၪတၭ,ဆၧအီၪလၧဖျိၩ့လဂၩဆၧၫ့နၩ့ဝ့ၫတၭ, အကီၩ့အ ၥိၭနီၪဘွၩဝ့ၫဘဲၫမူၭခိၪဖီၫအၥိၭတၭ, အခိၪၥူၫမၩအ ၥၭဘဲၫၥိၪအဆီၪ့ဘွၩအၥိၭနီၪလီၫ. အလးဆီၩ့ဆီမွဲ",
			"10": "<sup>10</sup> မ့ၪလၪ,အလဲၪ့ပၪနီၪမွဲမ့ၪလၪအၪ့ဆၧလီၫ.- မ့ၪအကၠီၪ့ ဂဲၫထၪ့တၭစဲၪ့ဝ့ၫလၧအမ့ၬယၫလီၫ. ၦအထီၫ့ၥံၪအ ဘျၩ့အထီၫ့လဖၪမၩအဆၧ, ၦအလၬၥံၪအဘျၩ့အလၬ လဖၪဆၧၫ့ထုၪ့လၧအမ့ၬယၫလီၫ. ဆၧစ့ၩရၫ့ခွးအီၪ",
			"11": "<sup>11</sup> ထၪ့ဝ့ၫတၭ, လံၬလဖၪအီၪဝဲထၪ့အၥၭလီၫ.- ထီးနီၪ လဖၧၫ့ယယိဒံၭဆၧလၧနိၩ့လဘီၩ့နီၪ ချဲၩ့ဆၧချဲၩ့ဖၭဒိၪ အၥီၫလဖၪအကၠီၩ့လီၫ. ယယိဒံၭဆၧထီးဆၧမၩၥံၫ ဆၧဖိၪဆၧဎါလဒုၩနီၪတၭ, အစွၪဂၭဂီၩ့တၭ,ဆၧဖ့ၪ",
			"12": "<sup>12</sup> လၫ့ခွံၬဝ့ၫလၧမ့ၪလၪလၧအအၪ့ဆၧလီၫ.- ဆၧလၧဆၧ ဖိၪဆၧဎါလၧအအီၪလၩ့ထးလဖၪနီၪ ဆၧမၩန့ထၪ့ခွံၬ အစီၩ့အမၩ့လါနၫ့တၭ, ဆၧဒုၭမၧၫ့ဒံၭအဝ့ၫၥံၪထီးအ မုအလၩဒဲအဆၧၫ့အထီဘၪဝ့ၫလီၫ.",
			"13": "<sup>13</sup> တၭယယိဒံၭဆၧလၧယဆၧဒၪ လၧယၫလၧမုနၩလ ခီၫ,ယိခွါ,ဆၧမၩအၥၭဘဲၫ ၦၡၩအဖိၪခွၫလဂၩအၥိၭ နီၪဂဲၫဝ့ၫလၧမူၭခိၪထူၬဆၧအုၪ့တၭ, ၥုၭဘူၭအၥၭလၧ ဆၧအီၪလၧဖျိၩ့လဂၩအအီၪတၭ, ဆၧၥိၫ့ထၪ့ဝ့ၫဘူၭ",
			"14": "<sup>14</sup> လၧအမ့ၬယၫလီၫ.- ဆၧဖ့ၪလၫ့အဝ့ၫလၧဆၧပၧၩ့ဆၧ အလးတၭ,ဆၧလၩဖၩ့, ဒဲဆၧအဘၩ့အမုးဘဲၫၥိၭက ယဲၦခမျၧးလဖၪ, ၦဆၨၩလဖၪ,ဒဲၦချဲၩ့ဆၧအလၨကိၭ ဆၨၩဒ့ၭထီးအလူၬနီၪ မိမၩအဆၧလီၫ. အပၧၩ့ဆၧ အလးနီၪ မွဲဆၧပၧၩ့ဆၧအလး အဆိၩအကၠၪလၧအ လူၬလၥ့ၪဘၪတၭ, အဘၩ့အမုး ထီၩ့လၧဆၧဂၭဂီၩ့ ၥ့ၪအ့ၬ.",
			"15": "<sup>15</sup> ဆၧလၧယၧၩစဒၫ့နအ့လၭယီၩ ယၥုၪ့ခိယၥၭဝီၩ လၧယအီၩ့ဖၧၩ့တၭ, ယခိၪဎွံၪအဒၪဘၪဆၧလၧယၫ",
			"16": "<sup>16</sup> လခီၫနီၪမၩၥၭမဲၪယၧၩလီၫ.- ယၥုၭဘူၭယၥၭလၧ ၦလၧအဆၧၫ့ထုၪ့ လၧအနဲၩ့ထံၭလဖၪအကျၩလဂၩ တၭ,ယအၪ့စၪ့ဝ့ၫလၧဆၧယီၩ ထီးအလူၬလဖၪအမွဲ အတီၩအဂဲးလီၫ. တၭအဝ့ၫဒၪလီၩဘၪယၧၩ ဒဲဒုၭ",
			"17": "<sup>17</sup> ၥ့ၪယၫယၧၩ လၧအခီၫပယီၫလီၫ.- ဆၧဖိၪဆၧဎါဖၭ ဒိၪလၧအအီၪလံဒုၩနီၪ မွဲစဎွၩလံဂၩလၧအမိအီၪထၪ့",
			"18": "<sup>18</sup> လၧဂၪ့ခိၪချိၫ့လီၫ.- ဆၧထီၫထုၬလဂၩ အၡၩဆံၫ့ဎံၪ လဖၪနီၪမိန့ဘၪဘၩ့ၥံၪမုးၥံၪတၭ, မိအီၪလၧဘၩ့ၥံၪ မုးၥံၪလၩ့ဆိၩလၩ့ကၠၪ, မွဲမၬအဆိၩဆိၩအကၠၪကၠၪ လီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ယအၪ့စၪ့ ဆၧအမွဲအတီၩဘၪဆဲၫ့လၧ ဆၧဖိၪဆၧဎါလံဒုၩလဒုၩလၧ အလၩ့မဲၩဒၪဆၧလၧအ ဂူၫဂၩထီးအလူၬ, လၧအမၩၥၭမဲၪဆၧဒိၪဒိၪလ့ၬ, လၧ အၥွၫမွဲထၭ, ဒဲအခၪ့မံၪမွဲထီးတၭ, အၪ့ခွံၬဆၧ, မၩခါ လၩ့ဘျ့ၭဆၧတၭ, ယဲးထဲးဆၧအီၪလၩ့ထးနီၪ,လၧအ",
			"20": "<sup>20</sup> ခၪ့း- ဒဲဆၧဘၪဆဲၫ့လၧအနိၩ့ဆံၫဘီၩ့ လၧအအီၪဝ့ၫ လၧအခိၪဎွံၪ, ဒဲအဂူၫဂၩလဘီၩ့လၧအထၪ့ဝ့ၫတၭ,နိၩ့ ၥၧၫ့ဘီၩ့လၩ့ထ့ၬလၧအမ့ၬယၫ, လၧအအီၪဝ့ၫလၧအ မ့ၬၥၪလဖၪ, ဒဲအနိၭလၧအချဲၩ့ဆၧဖၭဒိၪလဖၪလၧအ",
			"21": "<sup>21</sup> ခံးအဂၩ့ဆီၪ့နဲၪ့ဒံၭအၥိၭလဖၪလီၫ.- ယယိဒံၭဆၧ တၭ,နိၩ့လဘီၩ့နီၪဒုၭဆၧလၧ ၦဆံၫ့ဎံၪလဖၪတၭ,မၩ",
			"22": "<sup>22</sup> နၧၩ့အဝ့ၫၥံၪ,- ထီးဆၧအီၪလၧဖျိၩ့လဂၩနီၪဂဲၫဝ့ၫတၭ, ဆၧစ့ၩရၫ့ခွးအီၪက့ၪအၥၭ လၧဆၧထီၫထုၬလဂၩအ ၡၩဆံၫ့ဎံၪလဖၪအဂးတၭး အမုအလၩဘၪဝ့ၫ လၧၦ ဆံၫ့ဎံၪလဖၪနီၪန့ဘၪယူၭ ဘၩ့ၥံၪမုးၥံၪလီၫ.",
			"23": "<sup>23</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪစံၭဘဲၫယီၩ, ဆၧဖိၪဆၧဎါ လံဒုၩလဒုၩနီၪ မွဲဘၩ့ၥံၪမုးၥံၪလံဘၩ့မုးလဘၩ့မုးလၧ ဂၪ့ခိၪချိၫ့လၧအလၩ့မဲၩဝ့ၫ လၧဘၩ့ၥံၪမုးၥံၪ ထီးအ လူၬတၭ,မိအၪ့ခွံၬဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫတၭ, မိယဲးထဲး",
			"24": "<sup>24</sup> ဝ့ၫတၭ,မၩလၩ့ဘျ့ၭဝ့ၫလီၫ.- နိၩ့ဆံၫဘီၩ့လဖၪနီၪမွဲ စဎွၩဆံၫဂၩ လၧအမိအီၪထၪ့လၧဘၩ့မုးလဘၩ့မုးနီၪ အဖၧၩ့တၭ, အဂူၫဂၩမိအီၪထၪ့လၧအလးခဲၫ့တၭ,မိ လၩ့မဲၩဝ့ၫ လၧအခၪ့ထံၭလဂၩတၭ, မိမၩနၧၩ့ စဎွၩ",
			"25": "<sup>25</sup> ၥၧၫ့ဂၩလီၫ.- မိချဲၩ့ဆၧချဲၩ့လၧဆၧထီၫထုၬလဂၩအ ဖၫ့ခိၪတၭ, မိမၩၡၪ့မၩနၭ ဆၧထီၫထုၬလဂၩ အၡၩ ဆံၫ့ဎံၪလဖၪတၭ, မိအီၪက့ၪအၥၭ လၧအမိမၩကဒံၩ ကဒၩဆၧအဆၧၫ့အထီ ဒဲဆၧၥီၪ့ဆၧၥၫ့လီၫ. တၭဆၧ မိဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪလၧအစူၪဖၧၩ့လၧအထီလထီ,ဒဲ",
			"26": "<sup>26</sup> အထီလဖၪ, ဒဲအထီအၪ့နၩ့ဖၭဝ့ၫဖိၭဖၫ့လီၫ.- ဆၧစ့ၩ ရၫ့ခွးနီၪမိဆၧၫ့နၩ့ဝ့ၫတၭ, ဆၧမိထုၭထၪ့ခွံၬအဘၩ့အ မုးဘဲၫၥိၭအမိမၩလူၬခွံၬဝ့ၫတၭ, မၩဂၭဂီၩ့ဝ့ၫလၩ့ဆိၩ",
			"27": "<sup>27</sup> လၩ့ကၠၪလီၫ.- တၭဆၧမိဖ့ၪလၫ့ဘၩ့ၥံၪမုးၥံၪ, ဒဲပၧၩ့ ဆၧအလး, ဒဲဘၩ့ၥံၪမုးၥံၪအစီၩ့အမၩ့လၧမူၭခိၪထၧၫ့ ဘံၪ့ယၫအဖၫ့လၬနီၪ လၧဆၧထီၫထုၬလဂၩအၡၩဆံၫ့ ဎံၪလဖၪအၡၩခမျၧးအစူၪဖၧၩ့လီၫ. အဘၩ့အမုးနီၪ မွဲဘၩ့မုးအဆိၩအကၠၪတၭ, ကယဲဘၩ့ဖိၪမုးဖိၪထီးအ လူၬမိမၩအဆၧ, ဒဲခိၭနၪအလူလီၫ.",
			"28": "<sup>28</sup> ထီးယီၩမွဲဆၧနီၪအထုၬလီၫ. ဆၧလၧယၧၩစဒၫ့န အ့လၭယီၩ, ယဆီၫ့မီၪ့ဆၧနီၪမၩခိယၥၭတၭ, ယမ့ၬ လၩ့ၡါလီၫ. မွဲလါနၫ့ဘိၩ, ယအီၪက့ၪဆၧလမံၩ့နီၪ လၧယၥၭခံဖၧၩ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> စဎွၩဘ့လၡၭဇၫအနံၪ့ၥၧၫ့နံၪ့လနံၪ့နီၪ ဆၧဒၪဆၧ လၧယၫလခီၫနီၪဖျီၪထၪ့လၧယၧၩ, စဒၫ့နအ့လၭအမ့ၬ ယၫ,လၧဆၧဖျီၪထၪ့ဝ့ၫလၧ အခၪ့ထံၭအလးခဲၫ့နီၪလီၫ.",
			"2": "<sup>2</sup> ယဒၪဘၪဆၧလၧယၫလခီၫတၭ, ဆၧမၩအၥၭလၧ ယဒၪဘၪဆၧနီၪအဘိၩ့ဘၭတၭ, ယအီၪလၧနီးရှုၡၫ့ အဖၧၩ့,လၧအအီၪဝ့ၫလၧခးအံလၫ့အဖၧၩ့တၭ, ယဒၪ ဆၧလၧယၫလခီၫအဖၧၩ့နီၪ, ယအီၪလၧထံၫမိၡါယု",
			"3": "<sup>3</sup> လအဲၫအနဲၩ့လီၫ.- ထီးနီၪလဖၧၫ့ယစၪ့ထၪ့ယမ့ၬတၭ, ယယိဆၧတၭ, ယိခွါ,ၥိၪဖၫလဒုၩဆၧၫ့ထုၪ့လၧထံၫမိၡါ အနဲၩ့တၭ, အီၪဝ့ၫလၧအနိၩ့နံၫဘီၩ့တၭ, အနိၩ့နံၫဘီၩ့ နီၪထၪ့ဝ့ၫထီၫထီၫလ့ၬလါနၫ့တၭ, လထီၫၥိၭလိၬဘၪ အၥၭနီၪ,ဖၨၪထီၫဝ့ၫလီၫ. တၭအထီၫလဘီၩ့နီၪထၪ့ဝ့ၫ",
			"4": "<sup>4</sup> လၧခဲၫ့ထုၬလီၫ.- ယဒၪဘၪၥိၪဖၫလဒုၩနီၪ ဘျႃၪ့ဆၧ လၧမုနုၬလခီၫ, ဒဲလၧမုဖၩလခီၫ, ဒဲလၧမုခံၫ့လခီၫတၭ, ဆၧဖိၪဆၧဎါ ဆၧၫ့ထုၪ့လၧအမ့ၬယၫ ၥ့ၪနးဒုၩအ့ၬ. တၭဆၧမၩဖီၩ့မၩဖျ့ၭဆၧလၧအစူၪဖၧၩ့ အီၪနးမံၩ့အ့ၬ. မၩဒၪဆၧထီးဒၪအၥၭတၭ, အီၪက့ၪဒိၪအၥၭလီၫ.",
			"5": "<sup>5</sup> ယဆီၫ့မီၪ့ဆၧအဘိၩ့ဘၭတၭ, ယိခွါ,ဘ့ၪဖၫလဒုၩ ဂဲၫလၧမုနုၬလခီၫ ထီးအဎံၩ့ဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫတၭ, ထိၭဘၪဂၪ့ခိၪအဖၫ့ခိၪအ့ၬ. တၭဘ့ၪလဒုၩနီၪအီၪဝ့ၫ လၧအနိၩ့အီၪဖျီၪလဘီၩ့ လၧအမ့ၬၥၪ အဘိၩ့ဆၧၩ့",
			"6": "<sup>6</sup> လီၫ.- အဝ့ၫဂဲၫစိၩလၧၥိၪဖၫလဒုၩ အီၪလၧအနိၩ့နံၫ ဘီၩ့လၧယဒၪဘၪဝ့ၫ အဆၧၫ့ထုၪ့လၧထံၫမိၡါအနဲၩ့ တၭ,စဲၪ့တလဲးလၧအအီၪ လၧအၥၭခဲၩထၪ့အစီၩ့အ",
			"7": "<sup>7</sup> မၩ့လီၫ.- ယဒၪဘၪဝ့ၫလၧအဂဲၫဘူၭလၧၥိၪဖၫလဒုၩ အဘိၩ့ဘၭတၭ, ၥၭထၪ့ထၫ့ဒၩအဝ့ၫတၭ, ကျီၪ့ခွံၬၥိၪ ဖၫတၭ, မၩခါခွံၬဝ့ၫအနိၩ့နံၫဘီၩ့တၭ, ၥိၪဖၫအဂဲးအ ဘၭလၧအမိဆၧၫ့ထုၪ့ လၧအမ့ၬယၫ အီၪနးဆံၭအ့ၬ. တၭမၩလၩ့ထံၩဖါအဝ့ၫ လၧဂၪ့ခိၪတၭ, ယဲးထဲးဝ့ၫ တၭဆၧမၩဖီၩ့မၩဖျ့ၭ ၥိၪဖၫလၧအစူၪဖၧၩ့အီၪအ့ၬ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘ့ၪဖၫလဒုၩနီၪဒိၪထၪ့ဒိၪဒိၪလ့ၬ တၭ,ထီးအဂဲးဆီၪ့ထၪ့တၭ, အနိၩ့ဖၭဒိၪလဘီၩ့ခါဝ့ၫ တၭ, ဆၧမၩအၥၭ ဘဲၫအနိၩ့လံဘီၩ့ထၪ့ဝ့ၫလၧအလး",
			"9": "<sup>9</sup> ဒိၭအၥၭလၧမူၭခိၪအလံၩလံခီၫလီၫ.- လၧနိၩ့ၥံၪနီၪ အကျၩလဘီၩ့အလီၩ့ နိၩ့ဖိၪလဘီၩ့ထၪ့ဝ့ၫတၭ, ဒိၪ ထၪ့ဝ့ၫဒိၪဒိၪလ့ၬတၭ, ဒိၭအၥၭလၧမုခံၫ့လခီၫ, ဒဲလၧ",
			"10": "<sup>10</sup> မုထၪ့လခီၫ, ဒဲလၧခးအဎံၫအလၩလီၫ.- အီၪက့ၪဒိၪ ထၪ့အၥၭထီၩ့လၧမူၭခိၪအၥုၭမုခမျၧးတၭ, ခွံၬလၩ့ခွံၬ ဆၧၥုၭမုလနၩ့, ဒဲၡၪၥံၪလနၩ့လၧဂၪ့ခိၪအဖၫ့ခိၪတၭ,",
			"11": "<sup>11</sup> ယဲးထဲးဝ့ၫလီၫ.- မွဲမၬ, အီၪက့ၪဒိၪအၥၭလၧဆၧၥုၭ မုခမျၧးအၦဒိၪဖၭဒိၪအဖၫ့ခိၪတၭ, ဆၧထုၭထၪ့ခွံၬဆၧ လုလနံၩဘၪလနံၩလၧအဝ့ၫအစူၪဖၧၩ့တၭ, ဆၧအလး",
			"12": "<sup>12</sup> ဆံၫ့ဎံၪအီၪဝ့ၫအလးနီၪလၩ့ဎီးဝ့ၫလီၫ.- လၧဆၧမၩ ကဒံၩကဒၩအကၠီၩ့ ဆၧအီၪက့ၪဆၧၥုၭမုလၧဆၧလု လနံၩဘၪလနံၩအဖၫ့ခိၪတၭ, မၩလၩ့ထ့ၬဆၧမွဲဆၧ တီၩလၧဂၪ့ခိၪလီၩ့တၭ, မၩဝ့ၫထီးဒၪအၥၭတၭ, ဘီၪ ထၪ့ယီၫထၪ့ဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ ယနါဂၧၫ့ဆၧဆံၫ့ဎံၪလဂၩချဲၩ့ဆၧ တၭ,ဆၧဆံၫ့ဎံၪလဂၩဒၪနီၪစံၭ ၦလဂၩလၧအချဲၩ့ဆၧ နီၪး တၭဆၧဒၪဆၧလၧယၫလခီၫ, ဆၧလုလနံၩဘၪလ နံၩ,ဒဲဆၧမၩကဒံၩကဒၩ လၧအမိထီၩ့လၧဆၧဂၭဂီၩ့, ဆၧဖ့ၪလၫ့ဆၧအလးဆံၫ့ဎံၪ ဒဲဆၧအၥုၭမုခမျၧး ဘဲၫ",
			"14": "<sup>14</sup> ၥိၭဆၧမိယဲးထဲးအဝ့ၫနီၪ, မွဲအဆံၭယံၬလဲၪ.- တၭ အဝ့ၫဒၪစံၭယၧၩ, ထီၩ့လၩ့မုနံၩလဖၪနံၫထီၫ့ၥၧၫ့ယၩ လီၫ.ထီးနီၪလဖၧၫ့ ဆၧမိမၩဆံၫ့ခွံၬဆၧအလးဆံၫ့ဎံၪ နီၪလီၫ.",
			"15": "<sup>15</sup> ထီးယၧၩစဒၫ့နအ့လၭ ဒၪဘၪယူၭဆၧလၧယၫလ ခီၫတၭ, ယအၪ့စၪ့အခီၫပယီၫနီၪ, ယိခွါ,ဆၧမၩအၥၭ လၧဆၧဆၧၫ့ထုၪ့လၧယမ့ၬယၫလဂၩ ဖျီၪဝ့ၫဘဲၫၦၡၩ",
			"16": "<sup>16</sup> အၥိၭနီၪလီၫ.- ယနါဂၧၫ့ၦၡၩအလူလၧယုလအဲၫအ နဲၩ့အဘိၩ့ဆၧၩ့တၭ, ကိၭထၪ့ဆၧတၭစံၭဝ့ၫဒၪ, ဂၫဘြံ လၭဧ့,ဒုၭနၪၥ့ၪၦလဂၩယီၩ လၧဆၧဒၪဆၧလၧယၫလ",
			"17": "<sup>17</sup> ခီၫနီၪဆံၭ.- အခိးမွဲအဝ့ၫဒၪ ဂဲၫဘူၭဝ့ၫထီးယဆၧၫ့ ထုၪ့အလးနီၪတၭ, ထီးအဂဲၫ, ယၥၭမဲၪဆၧတၭ,ယ ထိၪလၩ့ထံၩဖါချႃၬလၩ့ယၥၭလီၫ. အ့ၪမွဲအဝ့ၫဒၪစံၭ ယၧၩ,နၪၥ့ၪဆၧဆံၭ, ၦၡၩအဖိၪခွၫဧ့, ဆၧဒၪဘၪဆၧ လၧယၫလခီၫယီၩ, အီၪဝ့ၫလၧဆၧအထုၬအဆၧၫ့အ",
			"18": "<sup>18</sup> ထီအဂးနီၪထီးန့ဆံၭ.- လၧအချဲၩ့ဆၧလၧယၧၩအ ဘိၩ့ဘၭတၭ, ယမံၫမၪချႃၬလၩ့ လၧဂၪ့ခိၪအဖၫ့ခိၪ, အ့ၪမွဲအဝ့ၫဒၪထိၭယၧၩတၭ, ဒုၭဆၧၫ့ထုၪ့ယၧၩထုၪ့",
			"19": "<sup>19</sup> လုၪ့လီၫ.- တၭစံၭဝ့ၫဒၪ, ယိခွါ, ယမိဒုၭၥ့ၪယၫနၧၩ လၧဆၧလၧအမိမၩအၥၭ လၧဆၧၥၭထၪ့ အထုၬအ ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ အထုၬနီၪ မွဲဆၧဖၭဝဲၩဝ့ၫအ ဆၧၫ့အထီလီၫ.",
			"20": "<sup>20</sup> ၥိၪဖၫအီၪလၧအနိၩ့နံၫဘီၩ့ လၧနဒၪဘၪလဒုၩနီၪ",
			"21": "<sup>21</sup> မွဲမံဒအၫဒဲပၧၡၫအစဎွၩလဖၪလီၫ.- ဘ့ၪဖၫအဆီၪ့ရှုၫ လဒုၩနီၪမွဲဂြံစၭအစဎွၩတၭ, နိၩ့ဖၭဒိၪလဘီၩ့လၧအ အီၪဝ့ၫလၧအမ့ၬၥၪအဘိၩ့ဆၧၩ့နီၪ မွဲစဎွၩအခၪ့ထံၭ",
			"22": "<sup>22</sup> လဂၩလီၫ.- နိၩ့လဘီၩ့လၧအခါဝ့ၫတၭ, အနိၩ့လံဘီၩ့ ထၪ့ဝ့ၫလၧအလးနီၪ မွဲဘၩ့မုးလံဘၩ့မုးမိအီၪထၪ့ဝ့ၫ လၧၦဆၨၩအကျၩ, မွဲလါနၫ့တၭ, အီၪလၧအဝ့ၫဒၪအ",
			"23": "<sup>23</sup> စီၩ့အမၩ့ဆ့အ့ၬ.- လၧအဘၩ့အမုးအဆၧၫ့အထီအ ထုၬနီၪထီးၦမၩမၪဆၧဖိၪမၩဎွ့ၩဆၧတၭ, စဎွၩအီၪ လၧအမ့ၬဒူၩ, ဒဲအဆၧကိၪ့ယိၬလဂၩမိအီၪထၪ့ဝ့ၫလီၫ.",
			"24": "<sup>24</sup> အစီၩ့အမၩ့မိဆီၪ့ထၪ့လါနၫ့တၭ, မွဲအစီၩ့အမၩ့ဒၪဝ့ၫ အ့ၬ. မိမၩဂၭဂီၩ့လၩ့မဲၩဒၪဆၧတၭ, ဘီၪထၪ့ယီၫထၪ့ တၭ,မၩထီးဒၪအၥၭတၭ, မၩဂၭဂီၩ့ၦအၪဂၩ, ၦဆံၫ့",
			"25": "<sup>25</sup> ဎံၪအၡၩခမျၧးဒၪလ့ၬလီၫ.- မွဲအမၩဝ့ၫလၧဆၧကိၪ့ ၥ့ၪတၭ,ဆၧအၪ့လီၫမိဘီၪထၪ့ယီၫထၪ့ လၧအစူၪဖၧၩ့ တၭ,မိအီၪက့ၪဒိၪအၥၭလၧအၥၭခံဖၧၩ့, မွဲအမိမၩဂၭ ဂီၩ့ၦအၪဂၩ လၧအဆၧဘၪလိၬအိၭလိၬ အဖၧၩ့လီၫ. အဝ့ၫဒၪမိဆၧၫ့ထုၪ့ထၫ့ဒၩ ၦဒိၪဖၭဒိၪလဖၪအၦဒိၪဖၭ ဒိၪလဂၩတၭ, လၧၦအစူၪလအီၪဘၪနီၪ မိထီၩ့ဝ့ၫလၧ",
			"26": "<sup>26</sup> ဆၧဂၭဂီၩ့လီၫ.- တၭဆၧဒၪဆၧလၧယၫလခီၫလၧမုဂၪ လၩ့ဒဲလၧမုဂီၩလၧဆၧလီၩလၩ့လၬလၩ့ဝ့ၫနီၪ, မွဲဆၧအ တီၩလီၫ. စဲၩနဲၪ့ထၬဆၧဒၪဆၧလၧယၫလခီၫနီၪဆံၭ. အဂဲးဘဲၫယီၩ အီၪဝ့ၫလၧအၪနံၩအၪၥၫ့အဂးလီၫ.",
			"27": "<sup>27</sup> ယဝ့ၫဒၪစဒၫ့နအ့လၭလဂၩယီၩ ယၥၭလၩ့ဘဲၩ, ဒဲယဆၫထၪ့လၧမုနံၩလဖၪလီၫ. လၧခဲၫ့ထဲၩ့နီၪယဂဲ ထုၪ့တၭ,မၩစဎွၩအဆၧတၭ, ယၥၭထီၫမံၫထီၫမၪ လၧဆၧဒၪဆၧလၧယၫလခီၫအကၠီၩ့တၭ, ၦနၪၥ့ၪဝ့ၫ နးဂၩအ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> ၦမံဒအၫဖိၪၥံၪအချံၫအၥၪ စအဟၭရှုၫအံရၧၭအဖိၪ ခွၫစဒရဲအၧၭအနံၪ့ခၪ့ထံၭလနံၪ့ လၧအကဲၪထၪ့ၦခၫ",
			"2": "<sup>2</sup> လဒံအၫဖိၪၥံၪ အဘၩ့အမုးအစဎွၩနီၪ,- လၧအကဲၪ စဎွၩအနံၪ့ခၪ့ထံၭလနံၪ့နီၪ, ယၧၩစဒၫ့နအ့လၭယီၩ, ယနၪၥ့ၪနံၪ့အဆၧဝံဆၧနၬ လၧယွၩအလူလၧအဘၪမီၪ စယ့ၫရမဲအၫလၧလံၬၥံၪလဲၥံၪ လၧအမိမၩဎွ့ၩထၪ့ယရု",
			"3": "<sup>3</sup> စလံၫ့အဆၧအီၪယူအနံၪ့နွ့ၫဆံၫလီၫ.- ယဒိၭယမ့ၬ လၧကဆါယွၩအအီၪ ဘဲၫၥိၭယမိအၪ့ဂူၬဘၩဆိၪဖၪ ဆၧ,ဒဲအၪ့ကံၩ့အၪ့ယၫဆၧ, ဒဲအီၪလၧဆၧဒုၪဆၧအၪ့",
			"4": "<sup>4</sup> ဆၧအီၩ, ဒဲလၧရၧၬအဆၧယၬ, ဒဲဖံၫ့ချၪလီၫ.- ယဘၩ ဆိၪဖၪယဟိဝၩယယွၩတၭ, ယလီၩလၩ့လၬလၩ့ယ ဆၧဒဲၩဘၭတၭး ယစံၭ, ဆၧဒိၪဆၧထီၫဆၧလၩ့လိ လၩ့လၭအယွၩ လၧအထီးန့ဆၧအုၩ့လၩ့ ဒဲဆၧအခိး အတၩလၧၦလၧအအဲၪဝ့ၫ ဒဲၦလၧအထီးန့အဆၧမၪ",
			"5": "<sup>5</sup> လူၬလဖၪအဂးလဂၩ, ကဆါဧ့,- ပမၩမၪယူၭဆၧ,ပ မၩယူၭဆၧဒဲၩဘၭ ပမၩအၧၩ့ဆၧယူၭ, ပပိၩ့ထၪ့ဆၧ ယူၭတၭ,ပကၠၪခွံၬယူၭပၥၭ လၧနဆၧမၪလူၬ,ဒဲနဆၧ",
			"6": "<sup>6</sup> ၥီၪ့ဆၧၥၫ့,- တၭနခ့ၫနၡၩမီၪလဖၪအလူ လၧအချဲၩ့ ဆၧလၧနမံၩ့ လၧပစဎွၩၥံၪ, ဒဲပၦဒိၪဖၭဒိၪၥံၪ, ဒဲပဖါ",
			"7": "<sup>7</sup> ၥံၪ,ဒဲၦခးဖိၪထီးအလူၬနီၪပခိၭနၪအ့ၬ.- ကဆါဧ့,ဆၧ တီၩဆၧလီၩ့အီၪဝ့ၫလၧနၧၩတၭ, အ့ၪမွဲဆၧမ့ၬမဲအီၪ ဝ့ၫလၧပၧၩ ဘဲၫလၧမုလနံၩယီၩအၥိၭ, လၧယုဒၫအၦ ၡၩလဂၩဘၪလဂၩဆုၬဆုၬ, ဒဲလၧၦယရုစလံၫ့ဖိၪ,ဒဲ လၧအံၫစရ့လၭထီးအလူၬ, ၦလၧအဘူၭ ဒဲၦလၧအ ယဲၩ့,လၧခးထီးအလူၬအဖၧၩ့ ထီးအလးလၧနနၫ့ထၪ့ ခွံၬအဝ့ၫၥံၪ လၧအဆၧမၪအကၠီၩ့, လၧအမၩမၪဘၪ",
			"8": "<sup>8</sup> နၧၩလီၫ.- ကဆါဧ့, ဆၧမ့ၬမဲအီၪလၧပၧၩ, ပစဎွၩၥံၪ ဒဲပၦဒိၪဖၭဒိၪၥံၪ, ဒဲပဖါၥံၪလၧပမၩမၪဘၪနၧၩအကၠီၩ့",
			"9": "<sup>9</sup> လီၫ.- ဆၧယၫ့ၥုၪ့ဆၧယၫ့ၥၭ, ဒဲဆၧမၩဖီၩ့မၩဖျ့ၭဆၧ လဖၪအီၪလၧယွၩပကဆါနီၪ, အဂဲးဘဲၫယီၩပမၩမၪ",
			"10": "<sup>10</sup> ယူၭအဝ့ၫယူၭလီၫ.- တၭယဟိဝၩပယွၩအလူဘဲၫၥိၭ ပမိလ့ၩဆၧလၧအဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့ လၧအအီၪက့ၪ လၩ့ဝ့ၫလၧပမ့ၬယၫ လၧအခ့ၫအၡၩမီၪလဖၪအစူၪဖၧၩ့",
			"11": "<sup>11</sup> နီၪပခိၭနၪဆ့အ့ၬ.- မွဲမၬ,ၦအံၫစရ့လၭဖိၪ ထီးအလူၬ လၨၪခၫ့ဖၬယူၭနဆၧၥီၪ့ဆၧၥၫ့တၭ, ကၠၪခွံၬအၥၭဘဲၫ ၥိၭအထီးခိၭနၪနလူလဂ့ၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ နဒုၭဘၪယူၭပၧၩလၧဆၧဆိၪအၧၩ့, ဆၧဆိၪအၧၩ့လၧ အကွ့ၭအၥၭလၧယွၩအခ့ၫအၡၩ စမိစ့ၭအဆၧၥီၪ့ဆၧ ၥၫ့အဖၧၩ့, အဂဲးဘဲၫယီၩပမၩမၪယူၭအဝ့ၫယူၭလီၫ.",
			"12": "<sup>12</sup> တၭဆၧမၩခၧၫ့ယူၭအဆၧချဲၩ့ လၧအချဲၩ့ဆၧထၫ့ဒၩ ပၧၩ,ဒဲလၧအထၫ့ဒၩၦၡၩစ့ၩရၫ့ခွး လၧအစ့ၩရၫ့ပၧၩနီၪ, လၧအဒုၭဘၪယူၭပၧၩ လၧဆၧအၧၩ့ဖၭဒိၪယူၭ, အဂဲး ဘဲၫယီၩလၧမူၭခိၪထၧၫ့ဘံၪ့ယၫအဖၫ့လၬ ဆၧမၩအ ၥၭဘဲၫဆၧမၩအၥၭလၧယရုစလံၫ့အၥိၭနီၪ နးစီၪ့အ့ၬ.",
			"13": "<sup>13</sup> ဘဲၫဆၧကွ့ၭအၥၭ လၧစမိစ့ၭ အဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့ အၥိၭနီၪ, ဆၧအၧၩ့ထီးအလူၬယီၩဘၪပၧၩလီၫ. မွဲလါ နၫ့တၭ, ပအၪ့ကံၩ့အၪ့ယၫဆၧလၧယဟိဝၩပယွၩအ မ့ၬယၫဘဲၫၥိၭပမိကၠၪခွံၬပၥၭ လၧပဆၧအၧၩ့, ဒဲနၪၥ့ၪ",
			"14": "<sup>14</sup> ဆၧလၧနဆၧမွဲဆၧတီၩနီၪဆ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ယဟိဝၩအီၪခိၭဆၧအၧၩ့နီၪတၭ, ဒုၭဘၪပၧၩ လီၫ.အဂဲးဘဲၫယီၩ ယဟိဝၩပယွၩနီၪ တီၩဝ့ၫလၧအ ဆၧမၩထီးအလူၬအဖၧၩ့ လၧအမၩဝ့ၫလီၫ.အဂဲးဘဲၫ",
			"15": "<sup>15</sup> ယီၩပခိၭနၪအလူအ့ၬ.- တၭဘိၩ့နဲၪ့ယီၩယွၩပကဆါ လၧအဒုၭစဲၪ့ထၪ့နၡၩခမျၧး လၧခးအံဇံၭအဖၧၩ့လၧ ဆၧအစူၪဆီၪ့တၭ, မၩန့ဆၧအမံၩ့လၧနဂး ဘဲၫလၧမု လနံၩယီၩအၥိၭနီၪ, လဂၩဧ့, ပမၩမၪဘၪယူၭဆၧ",
			"16": "<sup>16</sup> ယူၭ,ပမၩအၧၩ့ယူၭဆၧယူၭ,- ကဆါဧ့, ဘဲၫနဆၧတီၩ ဆၧလီၩ့ထီးအလူၬအၥိၭနီၪ ဘိၭကၠၪကဒၩခွံၬ နၥၭ ထၪ့ဒဲနၥၭခဲၩထၪ့လၧနဒိၩ့ယရုစလံၫ့, နခိၪလီၩ့ဆံၫ့ဎံၪ အအီၪနီၪဆံၭ. အဂဲးဘဲၫယီၩ လၧပဆၧမၪအကၠီၩ့ဒဲ လၧပဖါလဖၪအဆၧအၧၩ့အကၠီၩ့နီၪ, ယရုစလံၫ့ဒဲနၡၩ ခမျၧးကဲၪထၪ့ဆၧဒုၪဒွ့ၪအလး လၧကယဲၦလၧအအီၪ",
			"17": "<sup>17</sup> ဝၬဖီၩ့ပၧၩအမ့ၬယၫလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ,ပယွၩဧ့, ခိၭနၪနခ့ၫနၡၩ အဆၧဘၩဆိၪဖၪ, ဒဲအဆၧအၪ့ကံၩ့ အၪ့ယၫတၭ, ဒုၭဖၩ့ဘၪနမ့ၬလၧနလးဆံၫ့ဎံၪလၧအ",
			"18": "<sup>18</sup> အီၪယူဝ့ၫနီၪ, လၧကဆါအကၠီၩ့နီၪဆံၭ.- ယယွၩဧ့, ဒိၭနိၩ့ဒိၭနါတၭ, ခိၭနၪဆၧ, စၪ့ထၪ့နမ့ၬတၭယိပဆၧ အီၪယူလဖၪ, ဒဲဒိၩ့လဖျိၪ့လၧဆၧဖျိၬဝ့ၫ လၩ့ဎိၭလၧ နမံၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩပအၪ့ကံၩ့အၪ့ယၫဆၧလၧ နမ့ၬယၫလၧပဆၧတီၩဆၧလီၩ့အကၠီၩ့လမွဲဘၪ, မွဲလၧ",
			"19": "<sup>19</sup> နခိးနတၩအၪအကၠီၩ့လီၫ.- ကဆါဧ့, ခိၭနၪဆၧဆံၭး ကဆါဧ့,ကွဲၪဖျါဆၧဆံၭး ကဆါဧ့,ခိၭနၪဆၧတၭ,မၩ ဆၧဆံၭ, လၧနကၠီၩ့ဒၪနဝ့ၫထီးၥုၭနံၩၥုၭၥၫ့လဂ့ၩ, ယ ယွၩဧ့း အဂဲးဘဲၫယီၩ ဆၧဖျိၬနဒိၩ့ဒဲနၡၩခမျၧးလၩ့ဎိၭ လၧနမံၩ့လီၫ.",
			"20": "<sup>20</sup> တၭယချဲၩ့ဆၧ, ဒဲဘၩဆိၪဖၪဆၧ,ဒဲလီၩလၩ့လၬ လၩ့ယဆၧဒဲၩဘၭ, ဒဲယၡၩခမျၧးအံၫစရ့လၭအဆၧ ဒဲၩဘၭတၭ, အီၪက့ၪလၩ့ယဆၧအၪ့ကံၩ့အၪ့ယၫလၧ ယဟိဝၩယယွၩအမ့ၬယၫ လၧယယွၩအခိၪလီၩ့ဆံၫ့",
			"21": "<sup>21</sup> ဎံၪအဂးအဘိၩ့ဘၭနီၪ,- မွဲမၬ, လၧယဘၩဆိၪဖၪဆၧ အဘိၩ့ဘၭဒၪလ့ၬ, ၦၡၩဂ့ဘြံၫလၭလဂၩ လၧယဒၪ ဘၪလၧဆၧဒၪဆၧလၧယၫလခီၫအဖၧၩ့ လၧအခၪ့ထံၭ နီၪ, ဆၧဒုၭဂဲၫဝ့ၫချဲၫ့ချဲၫ့တၭ, လၧၦမၩဘိၪ့ဆၧလၧ မုဂၪလၩ့အထီနီၪ, ၥုၭဘူၭအၥၭလၧယအီၪထိၭဘၪ",
			"22": "<sup>22</sup> ယၧၩလီၫ.- ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ယၧၩတၭ, ချဲၩ့ဒုၪ့ယၧၩ စံၭဝ့ၫဒၪ,စဒၫ့နအ့လၭဧ့, ယဂဲၫထၪ့ဘဲၫၥိၭ ယမိၥီၪ့",
			"23": "<sup>23</sup> လိၪနၧၩလၧဆၧကိၪ့ဆၧဆၭလီၫ.- လၧနအၪ့ကံၩ့အၪ့ ယၫဆၧအခၪ့ထံၭနီၪဆၧအလူလၩ့တၭ, ယဂဲၫလီၩဘၪ နၧၩလီၫ. အဂဲးဘဲၫယီၩ နဘၪဆၧအၥၭလီၫ. မၩအၥၭ ဘဲၫနီၪတၭ, ထီးန့ဆၧအလူနီၪ, နၪၥ့ၪဆၧဒၪဆၧလၧ",
			"24": "<sup>24</sup> ယၫလခီၫနီၪဆံၭ.- မုအနွ့ၫအဘျၩ့နွ့ၫဆံၫအီၪက့ၪအ ၥၭလၧနၡၩခမျၧးဒဲနဒိၩ့ဆံၫ့ဎံၪအဂး, ဘဲၫၥိၭအမိမၩ လူၬခွံၬဆၧမၪတၭ, စဲၩနဲၪ့ထၬဆၧဒဲၩဘၭ, ဒဲမၩဖီၩ့မၩ ဖျ့ၭဆၧအၧၩ့အဂး, ဒဲဒုၭဂဲၫနုၬဆၧတီၩဆၧလီၩ့အဆိၩ အကၠၪ,ဘဲၫၥိၭအမိစဲၩနဲၪ့ထၬ ဆၧဒၪဆၧလၧယၫလ ခီၫ, ဒဲချဲၩ့ဆၧလၧမီၪအချိၬ, ဒဲဂုၪဆၧဆံၫ့ဎံၪထုၬလဂၩ",
			"25": "<sup>25</sup> လီၫ.- ၥ့ၪယၫတၭနၪၥ့ၪလၧဆၧမၪလူၬ လ့ၩထၪ့ဘဲၫၥိၭ ပမိမၩၥၫ့ထၪ့ထဲၩ့ယရုစလံၫ့ ဖိးလၧၦဒိၭဂုၪအၥၭဆၧ အခိၪလဂၩနီၪ, မွဲမုအနွ့ၫအဘျၩ့နွ့ၫဘျၩ့ဒဲမုအနွ့ၫအ ဘျၩ့ဎူၫဆံၫနံၫဘျၩ့နီၪး တၭဆၧမၩၥၫ့ထၪ့ထဲၩ့အဖၧၩ့ ၥၭဖၭလဲ, ဒဲအလးအံၪ့လၧအဆၧၫ့အထီဘၪခိဘၪဝီၩ",
			"26": "<sup>26</sup> အဖၧၩ့လီၫ.- တၭလၧမုအနွ့ၫအဘျၩ့ဎူၫဆံၫနံၫဘျၩ့ အလးခဲၫ့နီၪ ၦဒိၭဂုၪအၥၭလဂၩ မိဘၪဆၧဒၪ့ထ့ၬခွံၬ ဝ့ၫ,လါနၫ့မွဲလၧအဂးဒၪဝ့ၫအ့ၬ. တၭဆၧအခိၪအၡၩ ခမျၧးလၧအမိဂဲၫလဖၪနီၪ မိမၩဂၭဂီၩ့ဒိၩ့နီၪ,ဒဲဆၧအ လးဆံၫ့ဎံၪလီၫ. မွဲလါနၫ့တၭ, အထုၬနီၪမိအီၪဝ့ၫလၧ ဆၧလုၬဘံၭဆၧတၭ, ဒုၭဆၧမိအီၪထီးအထုၬ, ဆၧ",
			"27": "<sup>27</sup> အီၪယူလၧဆၧစ့ၩရၫ့ဝဲၩဝ့ၫနီၪမိအီၪလီၫ.- အဝ့ၫဒၪ မိအုၩ့လၩ့ဆၧဂုးဂုးခၧၫ့ခၧၫ့ လၧၦအၪဂၩ လၧမုလနွ့ၫ အထးဖၧၩ့, ဒဲလၧဖိၭဖၫ့နွ့ၫအထးဖၧၩ့နီၪ မိဒုၭအီၪ ပထုၬဆၧလုဒဲဆၧမၩဘိၪ့တၭ, ဆၧမၩယူဆၧနီၪမိအီၪ ဝ့ၫလၧဆၧအီၪလၧအဒံၭ လၧဆၧၥၭလိၪဝ့ၫအဖၫ့ခိၪ တၭ,ဆၧလၧဆၧစ့ၩရၫ့ဝဲၩဝ့ၫနီၪ မိဂါလၩ့အၥၭလၧ ဆၧလၧအမိဂၭဂီၩ့အဖၫ့ခိၪ ထီၩ့လၧဆၧဂၭဂီၩ့လူၬဝ့ၫ လီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ပၧၡၫအစဎွၩစဲရၧၭ အနံၪ့ၥၧၫ့နံၪ့လနံၪ့နီၪဆၧနဲၪ ဖျီၪဆၧချဲၩ့လၧစဒၫ့နအ့လၭ လၧအမံၩ့မွဲဘ့ၫလၭတၡၭ ဇၫတၭ, ဆၧချဲၩ့နီၪမွဲဆၧအတီၩတၭ, ဆၧဒုၭဆၧနီၪ မွဲအဒိၪတၭ, အဝ့ၫဒၪနၪၥ့ၪဆၧချဲၩ့နီၪ, အဂဲးဘဲၫယီၩ",
			"2": "<sup>2</sup> ဆၧဒုၭနၪၥ့ၪလၧဆၧဒၪဆၧလၧယၫလခီၫလီၫ.- ဆၧ လၧမုနံၩလဖၪနီၪ, ယၧၩစဒၫ့နအ့လၭယီၩယၥုၪ့အုၭ",
			"3": "<sup>3</sup> ယၥၭအုၭမုနံၩအနွ့ၫၥၧၫ့နွ့ၫလီၫ.- ကိၪလၧအအွံၪယ လအၪ့ဘၪနးမံၩ့တၭ, ဆၧယၪဒဲစဘံၭထံၫဂဲၫနုၬဘၪ လၧယနိၭဖၧၩ့အ့ၬ. တၭယလဂုၪဘၪယၥၭနးဆံၭထီး မုနံၩအနွ့ၫၥၧၫ့နွ့ၫဎွ့ၩထၪ့လီၫ.",
			"4": "<sup>4</sup> တၭလၧလၩအခၪ့ထံၭ, လၩထၪ့နံၫဆံၫလံနံၩလနံၩ နီၪယအီၪလၧထံၫမိၡါအနဲၩ့ လၧအမွဲဟံၭဒက့လၭ",
			"5": "<sup>5</sup> လီၫ.- ထီးနီၪလဖၧၫ့ယစၪ့ထၪ့ယမ့ၬယယိဆၧတၭ, ယိခွါ, ၦၡၩလဂၩကီၩ့ၥိၭဝ့ၫလၧ ဆၧဘွၩဖျ့ၫလံၬကံၭ တၭ,အယးဒံၩ့ခဲးထူၬအၥၭ လၧယုဖၭအထီၫ့ဆံၫ့,",
			"6": "<sup>6</sup> တၭအနၫ့ဆါမၩအၥၭ ဘဲၫထၫ့မျါဘၩ့ယ့ၫအၥိၭတၭ, အမ့ၬဖျီၪဝ့ၫဘဲၫလၫ့ဝဲဒံၭအၥိၭတၭ, အမ့ၬၥၪမၩအၥၭ ဘဲၫမ့ၪဒိၩ့ခဲၩဖၩ့လဖၪအၥိၭတၭ, အစူၪဒဲအခၪ့ဖျီၪဝ့ၫ မၩအၥၭဘဲၫထီးဘၩ့ဘၪဆၧထူၭကျံၩ့ဝ့ၫတၭ, အဆၧ ချဲၩ့အလူမၩအၥၭ ဘဲၫၦခမျၧးကိၭၡၭဆၧအၥိၭနီၪ လီၫ.",
			"7": "<sup>7</sup> တၭယၧၩစဒၫ့နအ့လၭယီၩ, ယဒၪဆၧလၧယၫလ ခီၫလဂၩဎးလီၫ. တၭၦအီၪဝ့ၫလၧယၥိၭလဖၪနီၪဒၪ ဘၪဆၧလၧယၫလခီၫအ့ၬ. အ့ၪမွဲအဝ့ၫၥံၪဘၪၥၭမဲၪ ၥၭဖျဲၩ့ဒိၪမၬ ထီးအစဲၪ့တလဲးဝ့ၫဘဲၫၥိၭအမိအီၪက့ၪ",
			"8": "<sup>8</sup> ၥူၪအၥၭလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဝ့ၫဒၪယအီၪ လၩ့ထးလဂၩဎးတၭ, ယဒၪဆၧဖျီၪလၧယၫလခီၫဖၭ ဒိၪယီၩတၭ, ယဂဲးယဘၭ အီၪလၩ့ထးလၧယဖၧၩ့ အ့ၬ. အဂဲးဘဲၫယီၩ ယဎံၫယလၩကဲၪထၪ့ဘဲၫဆၧၥံၫ",
			"9": "<sup>9</sup> အၥိၭတၭ, ယဂဲးယဘၭအီၪလၧၩ့အ့ၬ.- ယနါဂၧၫ့ ဆၧချဲၩ့လဖၪအၥီၫ, လၧယနါဂၧၫ့အဆၧချဲၩ့လဖၪအ ၥီၫနီၪတၭ, ယမံၫမၪချႃၬလၩ့တၭယမ့ၬကျၭလၩ့အၥၭ လၧဂၪ့ခိၪအဖၫ့ခိၪလီၫ.",
			"10": "<sup>10</sup> တၭယိခွါ, ဆၧအစူၪထိၭယၧၩလၧအဒုၭဆၧၫ့ထုၪ့",
			"11": "<sup>11</sup> ယၧၩလၧယခၪ့လုးခိၪဒဲယစူၪယၫၥၭလီၫ.- တၭစံၭ ယၧၩၦလၧအဘၪဆၧအဲၪဝ့ၫဖၭဒိၪလဂၩ, စဒၫ့နအ့လၭ ဧ့,ထီးန့ဆၧချဲၩ့လၧယချဲၩ့ဒုၪ့နၧၩတၭ, ဆၧၫ့ထုၪ့ထုၪ့ လုၪ့ဆံၭ. အဂဲးဘဲၫယီၩဘိၩ့နဲၪ့ယီၩ ဆၧအၪ့မၧၫ့လၩ့ ယၧၩလၧနအီၪလီၫ. တၭထီးအချဲၩ့ဒုၪ့ယၧၩဆၧချဲၩ့ လထံၪနီၪတၭ, ယဆၧၫ့ထုၪ့တၭ,ယဝၭထိၬဝၭတ့ၭ",
			"12": "<sup>12</sup> လီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭယၧၩ, စဒၫ့နအ့လၭဧ့, ထီးၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩခီၫလၧမုနံၩအခၪ့ ထံၭလၧနအီၪက့ၪနၥၭ ဘဲၫၥိၭနမိနၪၥ့ၪဆၧတၭ, ဆၪ့ လၩ့နၥၭလၧယွၩအမ့ၬယၫတၭ, ဆၧခိၭနၪနဆၧချဲၩ့",
			"13": "<sup>13</sup> တၭ,ယဂဲၫလၧနဆၧချဲၩ့အကၠီၩ့လီၫ.- အ့ၪမွဲပၧၡၫအ ဘၩ့အမုးအခိၪလဂၩနီၪ ပဒၩ့ယၧၩအနံၩနံၫဆံၫလနံၩ အ့ၪမွဲ,ယိခွါ, ဆၧအခိၪလဂၩမဲၫခအ့လၭမၩဆၧတၭ, ယၧၩတၭ,ယအီၪလၩ့ထးထီးနီၪ လၧပၧၡၫအစဎွၩလ",
			"14": "<sup>14</sup> ဖၪအၥိၭနီၪလီၫ.- တၭယဂဲၫဒုၭၥ့ၪယၫနၧၩလၧဆၧလၧ အမိဘၪနၡၩခမျၧးလၧမုနံၩအထုၬလဖၪနီၪလီၫ. အ ဂဲးဘဲၫယီၩဆၧဒၪဆၧလၧယၫလခီၫ အီၪဒံၭလၧမုနံၩ",
			"15": "<sup>15</sup> လဖၪအဂးလီၫ.- အဝ့ၫဒၪချဲၩ့ဒုၪ့ယၧၩဆၧလဖၪဘဲၫ နီၪအဘိၩ့ဘၭတၭ, ယအီၪက့ၪယမ့ၬလၧဂၪ့ခိၪအဖၫ့",
			"16": "<sup>16</sup> ခိၪတၭ,ယအီၪလၩ့မါပံၭလီၫ.- ယိခွါ,ဆၧဖျီၪဝ့ၫဘဲၫ ၦၡၩၥံၪအဖိၪလဂၩထိၭယနိၭဖျံၩတၭ, ယအၩ့ထၪ့ယ နိၭတၭယချဲၩ့ဆၧတၭ, ယစံၭၦလၧအဆၧၫ့ထုၪ့လၧ ယမ့ၬယၫယကဆါဧ့, ယဎံၫယလၩလၧယလီၩ့ဂၭ ဂီၩ့ယူၭ, တၭယဂဲးယဘၭလအီၪလၧၫ့ဘၪလၧဆၧဒၪ",
			"17": "<sup>17</sup> ဆၧလၧယၫလခီၫအကၠီၩ့လီၫ.- တၭယကဆါလဂၩ ယီၩအခ့ၫအၡၩချဲၩ့ဒုၪ့ဆၧလၧ ယကဆါလဂၩယီၩ မိၥ့ၪဘဲၫၥ့ၪလဲၪ. တၭဆၧလၧယၧၩယီၩယၥၪဆၧအီၪ လၧၩ့လၧယဖၧၩ့ဆ့အ့ၬ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ဆၧအီၪလၧၦၡၩ အခံးအဂၩ့လဂၩ",
			"19": "<sup>19</sup> ထိၭဒီၭယၧၩတၭဒုၭဆီၪ့ထၪ့ယၧၩ,- တၭစံၭဝ့ၫ,ၦလၧ အဘၪဆၧအဲၪဝ့ၫဖၭဒိၪလဂၩဧ့, ၥၭမဲၪဆၧလဂ့ၩ,နမိ ဘၪဆၧဘၪလိၬအိၭလိၬလီၫ. အီၪက့ၪဒူၩနၥၭတၭ,မွဲ မၬ,အီၪလၧနဂဲးနဘၭဆံၭ. အဝ့ၫဒၪချဲၩ့ဒုၪ့ယၧၩအ ဘိၩ့ဘၭတၭ, ယဂဲးယဘၭဆီၪ့ထၪ့တၭ, ယစံၭ,မွဲယ ကဆါချဲၩ့ထၪ့ဆၧဆံၭ. အဂဲးဘဲၫယီၩ နဒုၭဆီၪ့ထၪ့ ယၧၩလီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့စံၭဝ့ၫဒၪ, ယဂဲၫမွဲဘၪလဲၪနီၪ,နၥ့ၪ ယၫဆ့ဧၪ.ဘိၩ့နဲၪ့ယီၩ, ယမိဘၪထဲၩ့ထဲၩ့တၭ, ဒုၭဆၧ လၧပၧၡၫအခိၪတၭ, ယမိစဲၪ့ထၪ့တၭ,ယိခွါ, ဂြံစၭအ ခိၪမိဂဲၫလီၫ.",
			"21": "<sup>21</sup> မွဲလါနၫ့တၭ, ယမိလီၩဘၪနၧၩလၧဆၧလၧအကွ့ၭ အၥၭလၧဆၧမွဲဆၧတီၩအလံၬဖၧၩ့လီၫ. အ့ၪလမွဲဘၪ နၥံၪအၦဒိၪမဲၫခအ့လၭတၭ ၦအီၪဝ့ၫလၧယၥိၭလၧ ဆၧယီၩလဖၪအဖၧၩ့အီၪအ့ၬ."
		},
		"11": {
			"1": "<sup>1</sup> လၧၦမံဒအၫဖိၪစဒရဲအၧၭ အနံၪ့အခၪ့ထံၭလနံၪ့ နီၪယဆၧၫ့ထုၪ့ဘဲၫၥိၭယမိဒုၭဆီၪ့ထၪ့အဝ့ၫ, ဒဲမၩဂုးမၩ ခၧၫ့အဝ့ၫလီၫ.",
			"2": "<sup>2</sup> ဘိၩ့နဲၪ့ယီၩယမိဒုၭနဲၪနၧၩလၧ ဆၧမွဲဆၧတီၩလီၫ. ယိခွါ,ပၧၡၫအစဎွၩ ၥၧၫ့ဂၩၥံၪမိဆၧၫ့ထုၪ့ဒံၭတၭ, ၦလံဂၩလဂၩနီၪ မိအီၪလၧအစူၪလးအခၪ့ခိၪအၪနဲၪ့ ဒံၭအဝ့ၫၥံၪထီးအလူၬလီၫ. တၭထီးအဂဲးအဘၭဆီၪ့ ထၪ့လၧအစူၪလးအခၪ့ခိၪအကၠီၩ့တၭ, မိထိၪဂဲၩၦထီး အလူၬဘဲၫၥိၭအမိထၫ့ဒုၪဒၩ ဂြံစၭအဘၩ့အမုးနီၪ လီၫ.",
			"3": "<sup>3</sup> စဎွၩဖၭဒိၪနးဂၩ မိဆၧၫ့ထုၪ့လၧအမိကဲၪစဎွၩလၧ ဆၧပၧၩ့အလးဖၭလဲအဖၫ့ခိၪတၭ, မိမၩထီးဒၪအၥၭ",
			"4": "<sup>4</sup> လီၫ.- ထီးအဆၧၫ့ထုၪ့တၭ အဘၩ့အမုးမိခါဝ့ၫတၭ မိလၩ့မုလၩ့ဖၭလၧမူၭခိၪအလံၩလံခီၫတၭ, လမွဲဘၪ လၧအဆၨၩအဆၬအဂးတၭ မွဲလၧဆၧပၧၩ့အလးဘဲၫ အပၧၩ့ဝ့ၫအၥိၭနီၪဆ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧမိထ့ၭ ထၪ့ခွံၬအဘၩ့အမုးတၭ, လၧအဝ့ၫၥံၪအမ့ၬယၫနီၪမိ ကဲၪထၪ့ၦဂူၫဂၩအဆၧလီၫ.",
			"5": "<sup>5</sup> စဎွၩလၧမုခံၫ့လခီၫမိဆီၪ့ထၪ့လါနၫ့တၭ, ၦလၧအ ၦဒိၪဖၭဒိၪအကျၩလဂၩမိဆီၪ့နဲၪ့အဝ့ၫတၭ, မိကဲၪထၪ့ စဎွၩလီၫ. အဝ့ၫဒၪအဘၩ့အမုးနီၪမိကဲၪထၪ့ဆၧပၧၩ့",
			"6": "<sup>6</sup> အခးဖၭလဲလီၫ.- တၭလၧနံၪ့လဖၪအထုၬနီၪအဝ့ၫၥံၪ မိအုၩ့လၩ့ဆၧစီၪ့ဎးလိၬအၥၭလီၫ. အဂဲးဘဲၫယီၩမု ခံၫ့စဎွၩအဖိၪမုၪလဂၩ မိဂဲၫထၪ့လၧမုဖၩအစဎွၩအ အီၪဘဲၫၥိၭအမိမၩဘၪလိၬ အိၭလိၬဆၧလီၫ. မွဲလါ နၫ့တၭ,မၩဆၧၩ့ဆၧအစီၩ့အမၩ့နီၪ, ၦမုၪဖီၪ့ထၬဝ့ၫ အ့ၬ.တၭၦခွၫနီၪလဆၧၫ့ထုၪ့ဘၪဆ့, တၭအမၩဆၧၩ့ ဆၧနီၪခၧၫ့အ့ၬ. တၭဆၧမိဖ့ၪလၫ့ခွံၬၦမုၪ, ဒဲၦလၧအ ဂဲၫဆိၬအဝ့ၫဒဲၦလၧအထၪ့ဖိၪအဝ့ၫ, ဒဲၦလၧအဖီၪ့ထၬ",
			"7": "<sup>7</sup> အဝ့ၫလၧဆၧအဆၧၫ့အထီအဖၧၩ့နီၪလီၫ.- အ့ၪမွဲလၧ အဝံအထဲၩ့ဖၭနီၪ ၦမိဆၧၫ့ထုၪ့လၧအလးလဂၩ,မိဂဲၫ စိၩဝ့ၫလၧဆၧၥုၭမုတၭ, မိလ့ၩနုၬဝ့ၫလၧမုဖၩအစဎွၩ အထိၬဖၧၩ့တၭ, မိမၩထီးဒၪအၥၭလၧအဖၧၩ့တၭ,မိ",
			"8": "<sup>8</sup> မၩနၧၩ့ဝ့ၫလီၫ.- တၭမိဆိၬထၪ့ခွံၬအၪ့မၧၫ့ဎီးအယွၩ လဖၪလၧခးအံဇံၭအဖၧၩ့ အီၪဝ့ၫလၧအဆၧဂၩ့ၥိၫ့အ ၥၭလဖၪ, ဒဲအထွ့ၫစ့ၩ, ဒဲအထွ့ၫထီၫ့ လၧအလူဒိၪဎွ့ၩ ဒိၪတၭ,မိဆၧၫ့ထုၪ့ဝ့ၫလၧမုဖၩ အစဎွၩအဖၫ့ခိၪလီၫ.",
			"9": "<sup>9</sup> တၭမိဂဲၫဝ့ၫလၧမုခံၫ့အစဎွၩ အဘၩ့အမုးလါနၫ့တၭ, မိထဲၩ့ထဲၩ့လၧအခးဒၪဝ့ၫအဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> အဖိၪခွၫလဖၪ မိဒုၭၥုၭတၭ, မိဒုၭအီၪကီၪ့ၦၥုၭမု ခမျၧးတၭမိလ့ၩဆၧ, ဒဲလုၬဘံၭဆၧ, ဒဲခၫ့ဂၬဆၧတၭ, မိထဲၩ့ထဲၩ့တၭ, မိဒုၭဆၧဖိးလၧအထိၬဖၧၩ့ဒၪလ့ၬ",
			"11": "<sup>11</sup> လီၫ.- မုခံၫ့အစဎွၩမိၥၭထၪ့တၭ, မိလ့ၩဆၧတၭ, ဒုၭ ဆၧလၧအဝ့ၫတၭ, မုဖၩအစဎွၩ မိဒုၭအီၪထၪ့ၦခမျၧး ဖၭဒိၪလီၫ. တၭဆၧမိဖ့ၪလၫ့ခွံၬၦခမျၧးနီၪ လၧအစူၪ",
			"12": "<sup>12</sup> ဖၧၩ့လီၫ.- ထီးအမၩန့ထၪ့ခွံၬၦခမျၧးနီၪဂီၩ့တၭ, အီၪ က့ၪထၪ့ထီၫအၥၭး တၭမိခွံၬလၩ့ခွံၬ ၦအလၬၥံၪနီၪ",
			"13": "<sup>13</sup> လီၫ.မွဲလါနၫ့တၭဆီၪ့ထၪ့ဝ့ၫအ့ၬ.- မုဖၩအစဎွၩမိဂဲၫ ထဲၩ့ထဲၩ့တၭ, မိဒုၭအီၪထၪ့ၦခမျၧးအၪနဲၪ့ဒံၭလၧအ ခၪ့ထံၭလီၫ. တၭအဆၧၫ့အထီလဖၪဖီၩ့ခွံၬ, နံၪ့လဖၪ အ့ၪထုၬမိဂဲၫဝ့ၫလၧၥုၭမုဖၭဒိၪ, ဒဲအစူၪလးအခၪ့ခိၪ",
			"14": "<sup>14</sup> အၪအၪလ့ၬလီၫ.- လၧအထီလဖၪအထးဖၧၩ့နီၪၦအၪ ဂၩမိဆၧၫ့ထုၪ့ထၫ့ဒၩမုခံၫ့အစဎွၩ, ၦလၧအထမျၬနၡၩ ခမျၧးလဖၪ မိအီၪက့ၪထၪ့ထီၫအၥၭ ဘဲၫၥိၭအမိဒုၭ အီၪခၧၫ့ဆၧဒၪဆၧလၧယၫလခီၫလီၫ. မွဲလါနၫ့တၭ,",
			"15": "<sup>15</sup> မိလၩ့ထံၩဖါဝ့ၫလီၫ.- တၭမုဖၩအစဎွၩမိဂဲၫဝ့ၫတၭ, မၩထၪ့ဆၧခိၪဒၧၩ့တၭ, မၩန့ဒိၩ့အီၪလၧအခိၪဒၧၩ့ ခၧၫ့း တၭမုခံၫ့အၥုၭမုအၥုၭဖိၪ လၧအရွံန့ဝ့ၫဒၪလ့ၬ လမိဆၧၫ့ထုၪ့ဘၪဝ့ၫတၭ, အဂဲးအဘၭလၧအမိဆၧၫ့",
			"16": "<sup>16</sup> ထုၪ့ဝ့ၫနီၪအီၪအ့ၬ.- ၦလၧအဂဲၫထၫ့ဒၩဝ့ၫနီၪမိမၩဝ့ၫ ထီးဒၪအၥၭဒၪဝ့ၫတၭ, ၦမိဆၧၫ့ထုၪ့ဝ့ၫလၧအမ့ၬယၫ နးဂၩအ့ၬ. တၭမိဆၧၫ့ထုၪ့ဝ့ၫလၧခးအီၪလၧအဎံၫအ",
			"17": "<sup>17</sup> လၩတၭ, မိမၩလူၬဝ့ၫလၧအစူၪလီၫ.- မိဒိၭအမ့ၬဘဲၫ ၥိၭအမိလ့ၩနုၬလၧအဘၩ့အမုး ထၧၫ့ဘၩ့မုးယၫတၭ, ၦအတီၩအလီၩ့ လ့ၩဖိၬအခဲၫ့လီၫ. တၭမိဖ့ၪလၫ့ဝ့ၫ လၧၦမုၪအဖိၪမုၪလဂၩ, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ဝ့ၫလီၫ. မွဲလါနၫ့တၭ, ဆၧနီၪလမံၩ့လခၧၫ့ဘၪတၭ, ကဲၪထၪ့ဝ့ၫ",
			"18": "<sup>18</sup> လၧအဂးအ့ၬ.- မၩဒီၭလဖၧၫ့အဝ့ၫမိကၠၪစိၩအမ့ၬလၧ ကျိၩ့လဖၪအအီၪတၭ, မိမၩန့ဝ့ၫအၪဖျိၪ့လီၫ. မွဲလါနၫ့ တၭ,ဆၧအခိၪလဂၩမိဒုၭအီၪပထုၬအဆၧဒုၪဒွ့ၪ,မွဲ မၬ,လၧနီၪအမ့ၬယၫမိဒုၭဘၪကဒၩထဲၩ့အဆၧဒုၪဒွ့ၪ",
			"19": "<sup>19</sup> လၧအနၫ့ဆါဒၪဝ့ၫအလီၩ့လီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫမိ ကၠၪစိၩအမ့ၬလၧထိၬလဖၪ လၧအအီၪဝ့ၫလၧအခးဒၪ ဝ့ၫအဖၧၩ့လီၫ. အခၪ့မိဘၪထၧၩ့တၭ, လၩ့ထံၩဖါဝ့ၫ တၭ,ဆၧဒၪန့လၧၩ့အဝ့ၫအ့ၬ.",
			"20": "<sup>20</sup> တၭၦမိဆၧၫ့ထုၪ့ထၪ့လၧအလးနးဂၩ လၧအမိဒုၭ ခၫ့ဂၬၦအၪ့ကံၩ့အခီၫ့ လၧဘၩ့မုးအဎံၫအလၩအဖၧၩ့ လီၫ.တၭလၧမုနံၩလဖၪ ၡၩခိၬအလးခဲၫ့နီၪမိထီၩ့ လၧဆၧဂၭဂီၩ့လါနၫ့တၭ, လမွဲဘၪလၧဆၧၥၭထၪ့အ",
			"21": "<sup>21</sup> ကၠီၩ့,မွဲလၧဆၧဒုၭၥုၭအဖၧၩ့ဆ့အ့ၬ.- ၦလၧဆၧလဒူၩ လယၪ့ဘၪဝ့ၫလဂၩ မိဆၧၫ့ထုၪ့လၧအလး, လၧၦလ ဖ့ၪလၫ့ဘၪအဝ့ၫလၧဘၩ့မုးအလၩအဖၩ့တၭ, မိဂဲၫနုၬ ဝ့ၫလၧဆၧဘၪလိၬအိၭလိၬအဖၧၩ့တၭ, အ့ၪမွဲမိန့ဘၪ",
			"22": "<sup>22</sup> ဘၩ့မုးလၧဆၧချဲၩ့မုၬနါအကၠီၩ့လီၫ.- တၭၥုၭမုလၧ အလုၬဘံၭဆၧနီၪ မိမၩလၩ့ဘၧၩ့ဝ့ၫ လၧအမ့ၬယၫ တၭ,မိခါလၩ့ဘျ့ၭဝ့ၫ,မွဲမၬ, ဆၧအခိၪဘၪဆဲၫ့လၧဆၧ",
			"23": "<sup>23</sup> အုၩ့လၩ့ဆ့လီၫ.- ထီးအအုၩ့လၩ့ဆၧလၧအဝ့ၫဒၪအ လးခဲၫ့နီၪမိမၩဝ့ၫလၧအအၪ့လီၫဆၧတၭ, မိဂဲၫထၪ့လၧ အခ့ၫအၡၩၡၩခိၬဂၩလါနၫ့တၭ, အစီၩ့အမၩ့ဒိၪဝ့ၫ",
			"24": "<sup>24</sup> လီၫ.- မွဲအမိဂဲၫနုၬဝ့ၫလၧဆၧဘၪလိၬအိၭလိၬလၧခး အဂ့ၩထုၬအဖၧၩ့တၭ, မိမၩဆၧလၧအဖါၥံၪ, ဒဲအဖါ ၥံၪအဖါလဖၪလမၩဘၪဝ့ၫလီၫ. တၭမိဖ့ၪလၫ့အၪ့နၩ့ ဖၭဝ့ၫလၧဆၧမၩန့ဆီၪ့, အၪ့ဂူၬန့ဆီၪ့,ဒဲဆၧထူၭဆၧ လၧၫ့လီၫ. တၭမိကိၪ့ဆၧထၫ့ဒုၪဒၩထိၬလဖၪထီးအမု",
			"25": "<sup>25</sup> အလၩဘၪလီၫ.- မိထိၪဂဲၩအၡၩၥုၭမုတၭ, အီၪက့ၪ အၥၭဒူၩအီၪလၧဆၧၥုၭမုခမျၧးထၫ့ဒၩ မုခံၫ့အစဎွၩ လီၫ.တၭမုခံၫ့အစဎွၩ မိထိၪဂဲၩအၥၭအီၪဝ့ၫလၧဆၧ ၥုၭမုဖၭဒိၪဒဲဆီၪ့ဝ့ၫလီၫ. မွဲလါနၫ့တၭ လဆၧၫ့ထုၪ့ ဘၪဝ့ၫ,အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမိကိၪ့ဆၧထၫ့ဒၩဝ့ၫ",
			"26": "<sup>26</sup> လီၫ.- မွဲမၬ, ၦလၧအအၪ့ဘၪအဝ့ၫဒၪအဆၧအၪ့အွံၪ ဒၪဝ့ၫလဖၪနီၪမိမၩဂၭဂီၩ့အဝ့ၫတၭ, အၥုၭမုခမျၧးမိ စဲၪ့တလဲးလုၬဘံၭဆၧတၭ, ၦမိလၩ့ထံၩဖါဘၪဆၧမၩ",
			"27": "<sup>27</sup> ၥံၫဝ့ၫအၪဂၩလီၫ.- တၭဆၧလၧစဎွၩနံၫဂၩနီၪကိၪ့ဝ့ၫ လၧအမိမၩအၧၩ့ဆၧ မိချဲၩ့ဆၧအဘျံၭအဘျၪလၧစပွဲ လဖျိၪ့ဎးအနဲၩ့ထံၭလီၫ. မွဲလါနၫ့တၭ ကဲၪထၪ့ဆၧ အ့ၬ.ထီးဆၧဖၭဝဲၩအထီနီၪဘၪဝ့ၫတၭ, ဆၧအထုၬ",
			"28": "<sup>28</sup> မိအီၪလီၫ.- မိထဲၩ့ထဲၩ့လၧအခးဒၪဝ့ၫအဖၧၩ့အီၪလၧ အစူၪလးခၪ့ခိၪဖၭဒိၪတၭ, အၥၭမိထၫ့ဒၩဆၧအုၩ့လၩ့ ဆံၫ့ဎံၪတၭ, မိမၩဆၧတၭ ထဲၩ့ထဲၩ့ဝ့ၫလၧအခးဒၪဝ့ၫ",
			"29": "<sup>29</sup> အဖၧၩ့လီၫ.- ဆၧဖၭဝဲၩအထီဘၪတၭ, မိလ့ၩနုၬဒီၭ လၧမုခံၫ့လခီၫလါနၫ့တၭ, ဆၧမၩအၥၭလၧခဲၫ့လဘျၩ့",
			"30": "<sup>30</sup> ဘဲၫလၧအခၪ့ထံၭလဘျၩ့အၥိၭအ့ၬ.- ဆံၭတံၫ့အက ဘၩ့လဖၪမိဂဲၫထၫ့ဒၩအဝ့ၫတၭ, အခိးမွဲအၥၭမိဂၭဂီၩ့ ဝ့ၫ,မိထဲၩ့ထဲၩ့တၭ, အၥၭမိခဲၩထၪ့ဘၪ ဆၧအုၩ့လၩ့ ဆံၫ့ဎံၪတၭး မိထဲၩ့ထဲၩ့ဝ့ၫဒဲမၩဆ့တၭ, မိနၪၥ့ၪဆၧ ဘၪဆဲၫ့လၧၦလၧအစဲၪ့ဒၪ ဆၧအုၩ့လၩ့ ဆံၫ့ဎံၪနီၪလီၫ.",
			"31": "<sup>31</sup> ဆၧၥုၭမုလ့ၩဆၧလၧအအီၪနီၪ မိမၩဘၪၥၭလိၪဆၧ အလးဆံၫ့ဎံၪ, ဆၧအလးခၧၫ့တၭ, မိအီၪက့ၪခွံၬဆၧ လုလနံၩဘၪလနံၩတၭ, မိအီၪက့ၪလၩ့ဆၧဘၪၥၭလိၪ",
			"32": "<sup>32</sup> လမံၩ့လၧအမၩယူဆၧလီၫ.- တၭၦလၧအလၨၪခၫ့ဖၬ ဆၧအုၩ့လၩ့လဖၪနီၪ အဆၧမိဒုၭကဲၪထၪ့ဝ့ၫလၧၦဒုၪ ဒွ့ၪဆၧဆံၫ့ဎံၪ ဒဲအၪ့လီၫဆၧလီၫ. အ့ၪမွဲၦလၧအၥ့ၪ ယၫယွၩလဖၪနီၪ မိဆီၪ့ထၪ့ဝ့ၫတၭ, ဘီၪထၪ့ယီၫထၪ့",
			"33": "<sup>33</sup> ဝ့ၫလီၫ.- တၭၦလၧအကိၪ့ဆၧၥ့ၪလၧၦခမျၧးအကျၩ လဖၪနီၪမိၥီၪ့လိၪၦအၪဂၩလီၫ. မွဲလါနၫ့တၭမိလူၬဝ့ၫ လၧနၭ,ဒဲမ့ၪလၪ, ဒဲဆၧအၪ့မၧၫ့ဎီးဝ့ၫ, ဒဲဆၧမၩန့ဆီၪ့",
			"34": "<sup>34</sup> ဝ့ၫလၧမုနံၩလဖၪအထးဖၧၩ့လီၫ.- ထီးအဝ့ၫၥံၪအ့ၪ လၩ့ထံၩဖါတၭ, ဆၧမိမၩဆၧၩ့ဝ့ၫလၧဆၧမၩဆၧၩ့လ ဆံၭဖိၪတၭ, ၦအၪဂၩအၥၭမိဘုၭထၬလၧအဝ့ၫၥံၪလၧ",
			"35": "<sup>35</sup> ဆၧချဲၩ့မုၬနါအကၠီၩ့နီၪလီၫ.- ၦလၧအမၩဝ့ၫလၧဆၧ ကိၪ့ၥ့ၪလနၩ့နၩ့နီၪ မိလၩ့ထံၩဖါဝ့ၫဘဲၫၥိၭဆၧမိမၩခွါ ဝ့ၫတၭ, မၩဆံၫ့ဝ့ၫ,ဒဲမၩဘွၩဝ့ၫထီးအဆၧၫ့အထီအ ထုၬဘၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အီၪလၧဆၧဖၭဝဲၩအ ထီအဂးလီၫ.",
			"36": "<sup>36</sup> စဎွၩလဂၩနီၪမိမၩဝ့ၫထီးဒၪအၥၭတၭ, မိအီၪက့ၪ ထၪ့ထီၫအၥၭတၭ, မိအီၪက့ၪဒိၪအၥၭလၧကယဲယွၩ လဂၩလါလါအဖၫ့ခိၪတၭ, မိချဲၩ့ဆၧလၩ့လၭလဖၪ ထၫ့ဒၩယွၩလဖၪအယွၩတၭ, မိဘီၪထၪ့ယီၫထၪ့ထီး ဆၧၥၭထၪ့မိလူၬဝ့ၫလီၫ. အဂဲးဘဲၫယီၩဆၧလၧဆၧစ့ၩ",
			"37": "<sup>37</sup> ရၫ့ဝဲၩဝ့ၫနီၪ မိမၩအၥၭလၩ့ထံးလၩ့ဆ့ၭလီၫ.- အဝ့ၫ လမိဒူၩယၪ့ဘၪအဖါၥံၪအယွၩ, လမိဒူၩယၪ့ဘၪဆၧ လၧအဘၪၦမုၪအၥၭဆ့တၭ, ဒူၩယၪ့ယွၩနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ မိအီၪက့ၪဒိၪအၥၭ လၧဆၧထီးအလူၬ",
			"38": "<sup>38</sup> နီၪအဖၫ့ခိၪလီၫ.- အဝ့ၫမိမၩလၩဖၩ့ဆၧၥုၭမုအယွၩ လၧအလးတၭ, ယွၩလဂၩလၧအဖါလဖၪ လၥ့ၪယၫ ဘၪဝ့ၫနီၪမိမၩဘိၪ့ဝ့ၫလၧထီၫ့ ဒဲစ့ၩ ဒဲထၫ့မျါ, ဒဲလၧ",
			"39": "<sup>39</sup> ဆၧလူဒိၪဎွ့ၩဒိၪလီၫ.- အဝ့ၫမိမၩထိၬလဖၪ ဘၪဆဲၫ့ လၧၦလခီၫဘၩ့မုးဖိၪအယွၩထီးဒၪအၥၭလီၫ. ထီးဒၪ ၦလၧအမိအုၩ့လၩ့ဝ့ၫလဂၩလါလါနီၪ မိမၩလၩဖၩ့ဝ့ၫ လီၫ. တၭမိအီၪက့ၪၦလဖၪနီၪ လၧအမိပၧၩ့ၦအၪဂၩ တၭ,မိဖ့ၪလၫ့အၪ့နၩ့ဖၭ ထံၫၥံၪခးၥံၪ အဆၧၫ့လၧအ လံၩ့အလဲၫအဂးလီၫ.",
			"40": "<sup>40</sup> လၧဆၧအဆၧၫ့အထီအထုၬနီၪ မုခံၫ့အစဎွၩမိဒုၭ ၥုၭလၧအဝ့ၫတၭ, မုဖၩအစဎွၩမိဂဲၫၥၡိၫထၫ့ဒၩအဝ့ၫ ဘဲၫလံၩၥဝံၬအၥိၭအီၪလၧလဲၪ့ၥုၭၥံၪ, ဒဲၦထူၬကၥ့ၪ,ဒဲ ကဘၩ့အၪဖျိၪ့တၭ, မိလ့ၩနုၬလၧခးလဖၪအဖၧၩ့တၭ,",
			"41": "<sup>41</sup> မိလုၬဘံၭဆၧဒဲခၫ့ဂၬဆၧလီၫ.- အဝ့ၫဒၪမိလ့ၩနုၬလၧ ခးအီၪလၧအဎံၫအလၩလဘံၪ့အဖၧၩ့တၭ, မိချႃၬလၩ့ ခွံၬခးအၪဘံၪ့လီၫ. မွဲလါနၫ့တၭ, အယီၩမိဖီၩ့မိဖျ့ၭ လၧအစူၪဖၧၩ့, အံဒၧၫ့,ဒဲမိအၭ, ဒဲၦအၫမၧၫ့ဖိၪလၧအ",
			"42": "<sup>42</sup> အၪနီၪလီၫ.- အဝ့ၫမိယၩ့ထၪ့အစူၪလၧခးလနၩ့နၩ့အ",
			"43": "<sup>43</sup> ဖၫ့ခိၪတၭ,ခးအံဇံၭဖီၩ့ဖျ့ၭဝ့ၫအ့ၬ.- တၭမိပၧၩ့ဝ့ၫလၧ ဆၧအီၪက့ၪကီၪ့ထီၫ့ဒဲစ့ၩအလး, ဒဲလၧဆၧလူဒိၪဎွ့ၩ ဒိၪလၧခးအံဇံၭအဖၧၩ့ ထီးအလူၬနီၪ မိပၧၩ့ဝ့ၫတၭ, ၦလံဘၠၫဖိၪဒဲၦအံၫၥအိပၠၫဖိၪ မိအီၪခိၭဝ့ၫလၧအခၪ့",
			"44": "<sup>44</sup> လးလီၫ.- တၭဆၧအပရၧၫ့လၧမုထၪ့, ဒဲလၧမုဖၩနီၪမိ မၩခိအၥၭလီၫ. မၩအၥၭဘဲၫနီၪတၭ မိလ့ၩဆၧလၧအ ၥၭခဲၩထၪ့ဆီၪ့ဆီၪ့လ့ၬ ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬဒဲမၩ",
			"45": "<sup>45</sup> ယူၦအၪဂၩလီၫ.- တၭမိၥုၪ့အနီးအတဲၩ လၧခိၪလီၩ့ ဆံၫ့ဎံၪအီၪလၧအဎံၫအလၩလဖျိၪ့လၧမၫဆမံၭၥံၪအ ဘိၩ့ဆၧၩ့တၭ, မိထီၩ့လၧအထုၬတၭ, ဆၧမၩဆၧၩ့ ဘၪအဝ့ၫနးဂၩအ့ၬ."
		},
		"12": {
			"1": "<sup>1</sup> အဆၧၫ့အထီထီးနီၪ ဆၧအခိၪဖၭဒိၪစမဲၫခအ့လၭ လၧအမၩဆၧၩ့ၦၡၩခမျၧးလဂၩနီၪ မိဆၧၫ့ထုၪ့ဝ့ၫလီၫ. တၭဆၧၡၪ့ဆၧနၭ အထီမိအီၪထၪ့ဝ့ၫလၧထီးဒၪၦလ ဆၨၩအီၪထၪ့ဝ့ၫ ခီၫလၧအထီလထီနီၪ, နၭဝ့ၫဘဲၫနီၪ ၥိၭလအီၪဘၪတၭ, ဆၧလၧအထီနီၪၦၡၩခမျၧး,ကယဲ ၦလၧအမံၩ့ကွ့ၭအၥၭ လၧလံၬဖၧၩ့လဂၩလါလါနီၪ",
			"2": "<sup>2</sup> မိဖီၩ့ဖျ့ၭဝ့ၫလီၫ.- ၦလၧအမံၫဝ့ၫလၧဂၪ့ခိၪမုၬအကျၩ အၪဂၩနီၪမိနၪ့ထၪ့အၥၭ, လနၩ့နၩ့လၧဆၧမၧၫ့အဆိၩ အကၠၪအဂးတၭ, လနၩ့နၩ့လၧဆၧမ့ၬမဲဒဲဆၧမၩကြၩ့",
			"3": "<sup>3</sup> ထမးဝ့ၫအဆိၩအကၠၪအဂးလီၫ.- ၦလၧအကိၪ့ဆၧၥ့ၪ မိယုၩ့ယဲထၪ့ဘဲၫမူၭခိၪအဆၧဖၩ့အၥိၭတၭး ၦလၧအ ဒုၭတီၩဒုၭလီၩ့ၦအၪဂၩနီၪ ဘဲၫၡၪၥံၪအၥိၭအဆိၩဆိၩ အကၠၪကၠၪလီၫ.",
			"4": "<sup>4</sup> နဝ့ၫဒၪယီၩ, စဒၫ့နအ့လၭဧ့, ကၭဘံၭထၬဆၧချဲၩ့ လဖၪအလးခဲၫ့နီၪတၭ, စဲၩနဲၪ့ထၬလံၬထီးဆၧအထီ အထုၬနီၪဆံၭ. ၦအၪဂၩမိယိဆီၫ့မီၪ့ဆၧထံၫထံၫဆၭ",
			"5": "<sup>5</sup> ဆၭတၭ, ဆၧၥ့ၪယၫမိအၪထၪ့လီၫ.- ယၧၩ,စဒၫ့နအ့ လၭယီၩ,ယယိဆၧတၭ,ယိခွါ, ၦဂူၫဂၩနံၫဂၩဆၧၫ့ထုၪ့ ဝ့ၫ,လဂၩလၧထံၫနဲၩ့အယီၩလခီၫ, အလဂၩလၧထံၫ",
			"6": "<sup>6</sup> နဲၩ့ဝါလခီၫလီၫ.- တၭၦစံၭၦကီၩ့ၥိၭဝ့ၫ လၧဆၧဘွၩ ဖျ့ၫလံၬကံၭလၧအအီၪဝ့ၫလၧထံၫအဖၫ့ခိၪနီၪ, ဆၧလၩ့",
			"7": "<sup>7</sup> လၭလဖၪအထုၬနီၪမိအီၪဆံၭယံၬလဲၪ.- ယနါဂၧၫ့ၦ လၧအကီၩ့ၥိၭဝ့ၫ လၧဆၧဘွၩဖျ့ၫလံၬကံၭလၧအအီၪ, ဝ့ၫလၧထံၫအဖၫ့ခိၪလဂၩအလူတၭ, ယူၬထၪ့အစူၪ ထွ့ၪဒဲအစူၪစ့ၪလၧမူၭခိၪတၭ, ဆိၪလၩ့အၥၭလၧဆၧ အမၧၫ့ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလဂၩအမ့ၬယၫတၭ, စံၭ ဝ့ၫ,မိအီၪဝ့ၫလၧအထီလထီ, ဒဲအထီလဖၪ,ဒဲဖိၭဖၫ့လ ထီအဂးလီၫ. တၭထီးဆၧမၩလၩ့ဘျ့ၭၦခမျၧးဆံၫ့ဎံၪ အစီၩ့အမၩ့တၭ, ဆၧထီးအလူၬနီၪမိမၩဎွ့ၩအၥၭလီၫ.",
			"8": "<sup>8</sup> ယနါဂၧၫ့ဆၧလါနၫ့တၭ,ယနၪၥ့ၪအ့ၬ. တၭယစံၭ, ယကဆါဧ့, ဆၧလဖၪနီၪအထုၬ မိမၩအၥၭဘဲၫၥ့ၪ",
			"9": "<sup>9</sup> လဲၪ.- အဝ့ၫဒၪစံၭဝ့ၫ, စဲၪ့ထၪ့တၭ, စဒၫ့နအ့လၭဧ့,အ ဂဲးဘဲၫယီၩဆၧချဲၩ့နီၪကၭဘံၭထၬယူၭအၥၭယူၭ, စဲၩ နဲၪ့ထၬယူၭအၥၭ ထီးဆၧအထီအထုၬ ဘၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ၦအၪဂၩမိဘၪဆၧမၩဆံၫ့ထၪ့ဝ့ၫတၭ, မိဘွၩဝ့ၫတၭ, မိဘၪဆၧမၩခွါဝ့ၫဒၪလီၫ. အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ လဖၪနီၪမိမၩဆၧလတီၩလလီၩ့ဘၪတၭ, ၦလတီၩလ လီၩ့ဘၪနီၪမိနၪၥ့ၪဝ့ၫနးဂၩအ့ၬ. အ့ၪမွဲၦကိၪ့ဆၧၥ့ၪလ",
			"11": "<sup>11</sup> ဖၪနီၪမိနၪၥ့ၪဆၧလီၫ.- လၧဆၧအထီလၧဆၧမိအီၪက့ၪ ခွံၬဆၧလုလနံၩဘၪလနံၩတၭ, လၧဆၧအီၪက့ၪထၪ့ ဆၧၥၭလိၪအဆၧလၧအမၩယူ ဆၧလံၩလံၩနီၪအနံၩ",
			"12": "<sup>12</sup> မိအီၪလထီၫ့နံၫယၩခွံၫဆံၫလီၫ.- ၦလၧအအီၪခိၭဆၧ ဒဲထီၩ့ဝ့ၫလၧလထီၫ့ၥၧၫ့ယၩၥၧၫ့ဆံၫယဲနံၩနီၪ ဘၪဆိၪ",
			"13": "<sup>13</sup> ဂ့ၩဝ့ၫလီၫ.- အ့ၪမွဲနဝ့ၫဒၪယီၩ, လ့ၩဆၧထီးအထုၬ ဆံၭ.တၭနမိအီၪပွံၭဒဲ ဆၧၫ့ထုၪ့လၧနလးဒၪနဝ့ၫလၧ မုနံၩလဖၪအထုၬနီၪလီၫ."
		}
	}
};
module.exports = book;